INSERT INTO `quotes` VALUES
(831,NULL,1,'„Hledali jsme štěstí a našli jsme sebe.”','ces','John Lennon','0028b08a81b17d8291fd713fcde6d20a',NULL),
(832,NULL,1,'„Jediná cesta, které budete litovat, je ta, kterou nepodniknete.“','ces',NULL,'004c19a17b23b4739424ff697b653830',NULL),
(833,NULL,1,'Dítě není malý dospělý – učme ho žít, ne jen vědět.','ces','Jean-Jacques Rousseau','0050d5eb95555cbfb1d9f495f451edcb',NULL),
(834,NULL,1,'Cesty nahoru a dolů jsou to samé.','ces','Herákleitos','0097f00b07cf32d0a99e0fd17066df80',NULL),
(835,NULL,1,'Když malířský štětec dělá to, co dělá, narazí na to, co by člověk nedokázal.','ces','Robert Motherwell','018c01194dad8da6ac889d46ce5e9081',NULL),
(836,NULL,1,'Nikdy se nebojte říct: „Tomu nerozumím!“','ces','Steve Rivkin','022b8ea379f5f42d51b396add545fc9a',NULL),
(837,NULL,1,'Civilizace zrodila potřeby, které člověk přirozeně nemá.','ces','Jean-Jacques Rousseau','034a1c2dad74f22cb18696e4ff27b153',NULL),
(838,NULL,1,'Člověk se rodí svobodný, ale všude je v okovech.','ces','Jean-Jacques Rousseau','03754e8e35c8c8b6ce94c1f55df7aca5',NULL),
(839,NULL,1,'„Problémy jsou tím, co činí život zajímavým a jejich překonávání je tím, co činí život smysluplným.“','ces','Joshua J. Marine','0507a8ce4bcd1f85078c43d3cf75fcd5',NULL),
(840,NULL,1,'Není třeba dítě příliš vychovávat. Je třeba hezky žít. Dítě se přidá.','ces','Ivan Štúr','054273fbecc934f4e4df0b4934101a4d',NULL),
(841,NULL,1,'„Jestli najdeš v životě cestu bez překážek, určitě nikam nevede.“','ces','Arthur C. Clarke','0550164297bc299b72b96844730e2760',NULL),
(842,NULL,1,'Jediný skutečný konec je tento: John a Mary umřou. John a Mary umřou. John a Mary umřou. Tolik ke koncům. Začátky jsou vždycky mnohem zábavnější. Skuteční znalci si ovšem nejvíce vychutnávají ty stránky mezi nimi, protože ty se píšou nejhůř.','ces','Margaret Atwoodová','05cf081763f4551da71d7ea9de0ae4cf',NULL),
(843,NULL,1,'„Milovat někoho znamená pochopit i to, že vás nemiluje.”','ces','Romain Rolland','0631f282b775d70d037b32177bcd1711',NULL),
(844,NULL,1,'„Nikdy si nikdo neplánoval, že bude na mizině, tlustý, líný, nebo hloupý. Tohle se právě stává, když nemáte plán.“','ces','Larry Winget','06614fec86063565d8fbecb8bfefe75e',NULL),
(845,NULL,1,'Neříkejte, že stará dáma křičela — popostrčte ji a nechte ji křičet.','ces','Mark Twain','06655a497b9dff6291f22680f06211e2',NULL),
(846,NULL,1,'„Důležitá věc je nepřestávat se ptát.“','ces','Albert Einstein','07b655b324ccb3647ab414d39908c5f8',NULL),
(847,NULL,1,'Ze všech lásek nejupřímnější je láska k jídlu.','ces','George Bernard Shaw','07de3b1821e0d63dfb2b5f5b2a8ed00d',NULL),
(848,NULL,1,'Seděl jsem na podlaze japonského domu a díval jsem se ven na malou rozkvetlou zahrádku a poletující vážky. Najednou mě napadlo, že jsem se příliš dlouho vznášel nad zemí.','ces','Mark Tobey','07f5df06b8ca4a96c5703d5669d5b0e7',NULL),
(849,NULL,1,'Společnost, která si ze všeho nejvíc váží pořádku, nebude tvůrčí. Bez správné míry nepořádku se tvořivost začne ztrácet jako v nějaké černé díře.','ces','Lester Thurow','08120406ea22561efe1bf0dd94bb939f',NULL),
(850,NULL,1,'Spisovatel není definován vysokoškolským titulem.','ces','Polly Adler','082f718457d705cfb47648234046bf6a',NULL),
(851,NULL,1,'Bohatě zdobená próza je těžko stravitelná, obecně nezdravá a občas způsobuje nevolnost.','ces','William Zinsser','08e7ee4beeac35d0f27f4fab8c9ca202',NULL),
(852,NULL,1,'„Život je neobratně sestavená hostina, při níž se netrpělivě čeká na předkrm, zatímco kolem přešla v tichu hlavní pečeně.“','ces','Franz Kafka','091313d06c77ae44e240155c25f8a5bd',NULL),
(853,NULL,1,'„Kdyby cestování bylo zadarmo, už nikdy byste mě neviděli.“','ces',NULL,'09513a097c9136bba7e0f9e4d76be6fb',NULL),
(854,NULL,1,'Největším objevem mé generace je skutečnost, že lidská bytost může svůj život pozměnit tím, že k němu změní přístup.','ces','William James','09b1fa3c5480e57d9f21e0753cc032ee',NULL),
