(896,NULL,1,'„Způsob, jak začít, je přestat mluvit a začít dělat.“','ces','Walt Disney','2856d5ddc2fa0df98b2583cfafbd4790',NULL),
(897,NULL,1,'Vraťme se k přírodě!','ces','Jean-Jacques Rousseau','2881ef4dcdaf1a145ab9548bae19dfc2',NULL),
