(914,NULL,1,'Banka je místo, kde vám půjčí peníze, pokud se vám podaří dokázat, že je nepotřebujete.','ces','Bob Hope','38d811e162524e6547ca554d811f8044',NULL),
(915,NULL,1,'Když píšu knihu nebo povídku, začnu psát každé ráno co nejdříve po rozednění. Nikdo mě neruší, je chladno a psaní mě zahřeje.','ces','Ernest Hemingway','395c74d619554195a367cc0b3d3a898a',NULL),
