(917,NULL,1,'Když mají manželé problémy tak za to můžou vždy obě strany. Jak manželka tak i tchýně.','ces',NULL,'3ab84e144c6ff40706c7dee6a672b3ca',NULL),
(918,NULL,1,'Stromy jsou básně, které země píše do nebe.','ces','Ch. Fibrin','3aeee31635091ac04a24b495c7c1bbd3',NULL),
(919,NULL,1,'To, co je už za námi a to co je před námi jsou maličkosti ve srovnání s tím, co je uvnitř nás.','ces','Ralph Emerson','3b05ad5108c28409f9bc9abf48941d1e',NULL),
(920,NULL,1,'Někde ve světě je velice zklamaná pláž a přemítá, proč na ní právě teď neležím.','ces',NULL,'3b709cd17583e945a296684201dfac1c',NULL),
(921,NULL,1,'„Přemýšlíme o tom, co vidíme a slyšíme. To, o čem přemýšlíme, v nás vyvolává pocity. Naše pocity ovlivňují naše reakce. Reakce se mění v návyky, které určují náš úděl.“','ces','Bob Gass','3bc8d3ecbc5fadca6d9c84cb1d568ff8',NULL),
