(932,NULL,1,'„Štěstí není něco, co k člověku přijde jen tak. Přichází spolu s našimi činy.“','ces','Dalajláma','41a2bfc81580207f3b2d45c53ce41d0e',NULL),
(933,NULL,1,'„Veškerý pokrok se děje mimo zónu komfortu.“','ces','Michael John Bobak','426496f06271ef80b66be593b6407946',NULL),
