(946,NULL,1,'Pravý účel není v podstatě nic jiného, než aby naše škola byla dílnou lidskosti a předehrou života. Aby zde probíhalo vše, co člověka činí člověkem.','ces','Komenský, Škola hrou','4be820a2b8f3aeb62d790916b2a8c6d5',NULL),
(947,NULL,1,'Dělejte to, z čeho máte strach. A dělejte to opakovaně. To je nejrychlejší a nejjistějších způsob, jak strach porazit.','ces','Dale Carnegie','4d758d5fc57241171bf2337c34115ffb',NULL),
(948,NULL,1,'Protože lidé nedovedou ocenit přítomnost a naplnit ji životem, touží tolik po lepší budoucnosti a koketují tolik s minulostí.','ces','J. W. Goethe','4f3c5d8ff2be58cd6d5490b45754309e',NULL),
(949,NULL,1,'„Přijměte odpovědnost za Váš život. Vězte, že jste to Vy, kdo Vás dostane tam, kam chcete, nikdo jiný to neudělá.“','ces','Les Brown','4f746350a44e7ad6a67df98b29243bbe',NULL),
