(1026,NULL,1,'„Cíl můžete snadno minout, když míříte moc vysoko. Stejně tak ho však můžete minout, když míříte moc nízko.“','ces','Thomas Fuller','848559143d3b6f6cfa0bcec0a6147221',NULL),
