(1048,NULL,1,'Chcete uspět? Zdvojnásobte počet svých neúspěchů!','ces','Tom Watson','9962d4e3278e226ad8ad20f514ea88e6',NULL),
(1049,NULL,1,'Výplata – Jeden z důkazů, že i zaměstnavatel má smysl pro humor.','ces',NULL,'996609e82751e50176c0164bc68f2f24',NULL),
(1050,NULL,1,'Než půjdete zlepšovat svět, projděte se třikrát vlastním domem.','ces','čínské přísloví','9a1b8a1bdbfe06665262c5709d1911f2',NULL),
(1051,NULL,1,'Víte, všechno je vypravování. A právě o tom je novinařina.','ces','Tom Brokaw','9aa6427b73a47779503b355505dff378',NULL),
(1052,NULL,1,'Děti potřebují spíš vzory než kritiku.','ces','Joseph Joubert','9ac2d92fb9393e21262e1905db2ae0de',NULL),
(1053,NULL,1,'Když často kritizujete své děti, nepřestanou vás milovat. Přestanou milovat sebe.','ces','Rudraksha','9af3bfb5a9bc8239b92474b64ccde64b',NULL),
(1054,NULL,1,'Budete-li pilně osm hodin denně pracovat, možná se vám nakonec podaří stát se šéfem a pracovat dvanáct hodin denně.','ces','Robert Frost','9bf0f9cce12615a8f6a8ba632dc4e85d',NULL),
(1055,NULL,1,'Život je umění kreslit bez možnosti gumovat.','ces','J. W. Gardner','9d9714ec3902c37e0a756abdb9a610b4',NULL),
(1056,NULL,1,'V dětství je celý svět starší než my.','ces','Greene','9dcd382731f0527f61c9af5f98add980',NULL),
(1057,NULL,1,'Příběh, všechno má příběh – jen ho stačí vidět.','ces','Bohumil Hrabal','9e3e3a4414c7df6b0e594a5aefdd5b11',NULL),
(1058,NULL,1,'„Nový život začíná tam, kde starý končí. A nové otázky si položíte, když pohřbíte staré odpovědi. Buďte při tom rozvážní, ale odhodlaní.”','ces',NULL,'9e7093ead7099d1f8f1b22cb798d430b',NULL),
(1059,NULL,1,'„Příběh je základním principem myšlení.“','ces','Mark Turner','9f219086b0b34906165e0809ea1b4c0d',NULL),
(1060,NULL,1,'Svoboda je každá moje hodina. Jedna z největších je ta, že říkám, co si myslím. Ať to má jakýkoliv dopad. A jsem si vědom, že někdy říkám kraviny. Ale jsou moje.','ces','Jan Kraus','9f68fb6d45b08d1323f491b41c9811d8',NULL),
(1061,NULL,1,'Zapamatujte si toto: Dobře napsaná kniha se špatnými argumenty bude mít mnohem větší vliv, než špatně napsaná kniha s nekonečným množstvím nuancí. A zapamatujte si také: bezduchá próza vzniká z bezduchého myšlení.','ces','Scot McKnight','9f87ab232fcff6f55d23c237e461d642',NULL),
(1062,NULL,1,'Milovat znamená dávat, ne vlastnit.','ces','Jean-Jacques Rousseau','9fd198da3e7d1ed63c7013f7e6a34fc5',NULL),
(1063,NULL,1,'Dospělí čekají celý týden na pátek, celý rok na léto a celý život na štěstí.','ces',NULL,'9ff1890e76ba62b45f087b0c22927b54',NULL),
(1064,NULL,1,'Hledej v člověku strom, hluboké kořeny, pevný kmen a košatou korunu.','ces','Japonské přísloví','a055fe2a83d3c0272dcbbd71f8f0148f',NULL),
(1065,NULL,1,'„Držte se dál od všech, kteří Vás okrádají o radost. Život je příliš krátký na to, abyste ho trávili s hlupáky.“','ces',NULL,'a0999ae8d690cac748e112449c58bb3a',NULL),
(1066,NULL,1,'„Láska žije v tom, kdo miluje, nikoli v tom, kdo je milován.”','ces','Romain Rolland','a1df37ae8daa527e8ea3216c3e976a55',NULL),
(1067,NULL,1,'Stvořila jsem si svůj svět, a je to mnohem lepší svět, než jaký jsem kdy viděla venku.','ces','Louise Nevelsonová','a23815006809519e97b767c7053c9b1d',NULL),
(1068,NULL,1,'Strom, který nekvetl, nemůže mít plody.','ces','Japonské přísloví','a26fbfebdef2344eb4addb8feafe62fa',NULL),
(1069,NULL,1,'„Nebojte se selhání. Strachujte se o tu šanci, která Vám uteče, když to nezkusíte.“','ces','Jack Canfield','a35b900867342045048b57186840e115',NULL),
(1070,NULL,1,'Je těžké milovat ženu a současně dělat něco rozumného.','ces','Lev Nikolajevič Tolstoj','a365376fa272196e24573b2003e63f88',NULL),
(1071,NULL,1,'„Čím více víš, tím méně potřebuješ.“','ces','Yvon Chouinard','a3d7f6ee751d337d65f571ef9bf1490c',NULL),
(1072,NULL,1,'Neexistuje morální nebo nemorální kniha. Knihy jsou buď dobře, nebo špatně napsané. Toť vše.','ces','Oscar Wilde','a4025573851db56e6256f1a0625ffb26',NULL),
(1073,NULL,1,'Každý potřebuje strom, od kolébky po rakev.','ces','Mohamed','a406fbb8173ed61939df6f5c3744ef9d',NULL),
(1074,NULL,1,'„Nepokoušejte se stát úspěšnou osobou, ale raději se pokuste stát se hodnotnou osobou.“','ces','Albert Einstein','a457a9ee354f3035b013fd348da3b5c9',NULL),
(1075,NULL,1,'Vyprávění je myšlenkový modul, který lidstvo vyvinulo, aby mu pomohl chápat vztah mezi příčinou a následkem.','ces','Chris Crawford','a461fac2c3ec8dda878b6628064abf0b',NULL),
(1076,NULL,1,'Štěstí je to jediné, co můžeme dávat, aniž bychom to měli.','ces','Mark Rutherford','a4b527cae7ad27447946803619c1a1eb',NULL),
(1077,NULL,1,'„Cestování zabíjí předsudky, uzavřenost a úzkoprsost.“','ces','Mark Twain','a4cebc05daf3c4fbb366602a94c93f56',NULL),
(1078,NULL,1,'Dokud budou kakaové boby růst na stromech, je pro mě čokoláda ovoce.','ces',NULL,'a549e633481a1c3d84182c7dcaf07d68',NULL),
(1079,NULL,1,'Svoboda není darem, nýbrž výsledkem společné vůle.','ces','Jean-Jacques Rousseau','a5837f9ff07ab5a9fb171240f114e278',NULL),
(1080,NULL,1,'Měl jsem smůlu na obě manželky. Ta první mě opustila a ta druhá mě opustit nechtěla.','ces','Patrick Murray','a5cab2e930767e528e01232bfa533a7d',NULL),
(1081,NULL,1,'Jestliže skrz naskrz pochopíte žábu, dosáhnete osvícení.','ces','Šunriju Suzuki','a62d03c51e6dd0f630766b82f50efd6f',NULL),
(1082,NULL,1,'„Sebevědomí je nejatraktivnější kvalita, kterou člověk může mít. Jak mohou ostatní vidět, jak jste úžasní, pokud to nevidíte Vy sami?“','ces',NULL,'a6ae15c25a07ae135fd775eee08af618',NULL),
(1083,NULL,1,'„Život je krátký, žijte ho. Láska je vzácná, chyťte ji. Hněv je špatný, zbavte se ho. Strach je hrozný, čelte mu. Vzpomínky jsou sladké, važte si jich.“','ces',NULL,'a75a4411cc4558db77bef0172a75fd97',NULL),
(1084,NULL,1,'„Zamilovaní zavírají při líbání oči, protože chtějí vidět srdcem.”','ces','Daphne Du Maurier','a78b72b93ada5fd70dbfa7137970fb05',NULL),
(1085,NULL,1,'Víte co je to tragédie? Když se dívka vdá z lásky a po svatbě zjistí, že muž nemá žádné peníze.','ces','Mark Twain','a83a3f3239a5530780366f022c39ea87',NULL),
(1086,NULL,1,'„Lepší je vidět něco jednou, než o tom tisíckrát slyšet.“','ces',NULL,'a88ac9a3d537566b2d9fec036668205e',NULL),
(1087,NULL,1,'Uschlé listí nehyzdí krásné stromy.','ces','Kurdské přísloví','a8954303bd590e85386da92a4107cfe2',NULL),
(1088,NULL,1,'„Náš největší úspěch není v tom, že nepadneme, ale v tom, že vždy vstaneme, kdykoli padneme.“','ces','Konfucius','a8dfd2cc020660c6b0a261a815546e9d',NULL),
(1089,NULL,1,'Nedovol názorům ostatních, aby se staly tvými.','ces',NULL,'a96d94342d562f0194c9bb2d606211bd',NULL),
(1090,NULL,1,'„Važte si sami sebe, protože jste jediní, kdo může něco pro svět udělat. Když si nebudete vážit sami sebe, Vaše pomoc nebude nic víc než iluze.”','ces',NULL,'a9e0fdccf0b28ab211c6a0fe3fbd4bdc',NULL),
(1091,NULL,1,'Nakonec se z nás všech stanou příběhy.','ces','Margaret Atwood','aadecb48e2542f3a217acce4c7ef5668',NULL),
(1092,NULL,1,'Prvním a nejdůležitějším vzděláním je výchova příkladem.','ces','Jean-Jacques Rousseau','ab0fdfe9955ca6b8470bc92f5f6b92f3',NULL),
(1093,NULL,1,'Kdyby nikdo nikdy neriskoval, pak i Michelangelo vymaloval v Sixtinské kapli jen podlahu.','ces','Neil Simon','ab87be8eebb391b848df9d7df790efaa',NULL),
(1094,NULL,1,'Vše, co opravdu potřebuji znát, jsem se naučil v mateřské škole.','ces','Robert Fulghum','abc91a3b5cf35393bfea21920078ff6b',NULL),
(1095,NULL,1,'Žvanění se často kryje s vágním myšlením.','ces','Thomas Sowell','ac287085ff02200486ae4573c2c3f370',NULL),
(1096,NULL,1,'Důvodem, proč se neodvažujeme, není to, že jsou věcí obtížné; věci jsou obtížné proto, že se neodvažujeme.','ces','Seneca','ac77cf537c05a337275a81423dac5a9b',NULL),
(1097,NULL,1,'Není důležité, jak umění svět eticky soudí, nýbrž zda a jak pojmenovává, odhaluje a dává spatřit věci skrývané a skryté.','ces','Sylvie Richterová','acc8be97a549d0163ccc6eb93b9b0cb8',NULL),
(1098,NULL,1,'„Vždy si pamatujte, že někde ve světě je někdo, kdo je spokojenější s větším málem, než máte Vy.“','ces',NULL,'ad17a24e9861f455853e3c0f0ed2805f',NULL),
(1099,NULL,1,'Musíte pochopit, mí drazí, že nejkratší vzdálenost mezi pravdou a lidským bytím je příběh.','ces','Anthony de Mello','aeed13bd20458c7f8069aab61f860f5d',NULL),
(1100,NULL,1,'Každý člověk má jenom tolik minut, hodin a dní kolik jich využije.','ces','Zig Ziglar','aefe17b2067eb8cf7cb2b6d00bd3756b',NULL),
(1101,NULL,1,'„Ať už si myslíš, že to dokážeš, nebo že to nezvládneš, pokaždé máš pravdu.“','ces','Henry Ford','afe791cff662d87cce9e534d79d33156',NULL),
(1102,NULL,1,'„Nic velkého nebylo nikdy dosaženo bez nadšení.“','ces','Ralph Waldo Emerson','b0209a2825118403546018946865b176',NULL),
(1103,NULL,1,'Snažím se pracovat každý den, i když nemám motivaci. Rituál je pro mě velmi důležitý.','ces','Mel Ramos','b078de9b7da05c95733b55a338128b58',NULL),
(1104,NULL,1,'Snaž se být duhou v mračnu někoho jiného.','ces','Maya Angelou','b0c5de6957b8bf79a6b650ba495e1c7d',NULL),
(1105,NULL,1,'Muži o lásce možná nemluví tolik jako ženy. Přesto když milují, milují doopravdy a se vším všudy.','ces',NULL,'b127b2eac2b684cdd6b865d592a8f6d9',NULL),
(1106,NULL,1,'„Cítit, milovat, trpět, obětovat se, bude vždycky obsahem života ženy.“','ces','Honoré De Balzac','b1b7bf6d43acc2d138cb0c3c4342118a',NULL),
(1107,NULL,1,'Abyste mohli dělat věci jinak, musíte je jinak i vidět.','ces','Paul Allaire','b258e99c68f7b47c38657753cb8be76e',NULL),
(1108,NULL,1,'„Ať se dostanete kamkoliv, stane se toto místo vaší součástí.“','ces','Anita Desai','b308d49d538808040b9a906777a2626e',NULL),
(1109,NULL,1,'„Vybuduj hřiště a zájemci se objeví.“','ces','Field of dreams','b348a3571ea9bff3932ba4752b8cb81f',NULL),
(1110,NULL,1,'Láska je jako šachy. Dáma se vždycky zamiluje do koně.','ces',NULL,'b3bdcd4cbfc8b2cfb8e16524fe1d1dd2',NULL),
(1111,NULL,1,'Rozhodl jsem se, že všechny svoje úspory dám do alkoholu. Kde jinde mi dají 40%.','ces',NULL,'b3c35798095920e5ad9eb6992fffca44',NULL),
(1112,NULL,1,'„Každému připadají hvězdy jiné. Tomu, kdo cestuje, ukazují cestu. Pro jiného jsou to jen světélka na nebi. Pro vědce je to problém k řešení.“','ces','Antoine de Saint-Exupéry','b47f60c26865ccc7fad077eb1fd1bf09',NULL),
(1113,NULL,1,'„Nebojte se postavit se za to, čemu věříte, i kdybyste za tím měli stát sami.“','ces',NULL,'b49baaf4e262e93c063909de2ef64e35',NULL),
(1114,NULL,1,'Existuje riziko, které si můžeme dovolit podstoupit a riziko, které si nemůžeme dovolit nepodstoupit.','ces','Peter Drucker','b566edfbff2d326fb076cd62c17f575b',NULL),
(1115,NULL,1,'Věřím, že nůžky v mých rukou dokáží více, než tužka.','ces','Truman Capote','b84a2ecb25b1c52d989ef0115db4a657',NULL),
(1116,NULL,1,'„Pokud se podíváte opravdu pozorně, tak na většině úspěchů, jenž přišly ze dne na den, se pracovalo již dlouhou dobu předtím.“','ces','Steve Jobs','b9576590085ab73d7d249b4a42e8df14',NULL),
(1117,NULL,1,'Den má 86400 vteřin. Tedy 86400 okamžiků.','ces',NULL,'b99e04a1921ee14edbb897d3c519369a',NULL),
(1118,NULL,1,'Hrajeme hazardní hry, protože se nám život zdá být příliš předvídatelný a bezpečný.','ces','Dan Savage','b9bfeed3a6af137a03a85177869268e9',NULL),
(1119,NULL,1,'Pytle peněz nemusí být vždy jen symbolem ohromného bohatství, ale také ohromné inflace.','ces',NULL,'ba2b750d1c548c4060e6d309c253b9b7',NULL),
(1120,NULL,1,'„Láska to je štěstí, které si dáváme navzájem.”','ces',NULL,'ba5bc7197cb4d1724cad5569b535147d',NULL),
(1121,NULL,1,'Strom na rozdíl od člověka vždy pozná svou porážku.','ces','Ivan Fontana','bbd18ff404eb5a45fb761b48cc414475',NULL),
(1122,NULL,1,'Tak dlouho se chodí se džbánem pro pivo, až dojdou peníze!','ces',NULL,'bca95612d2ac1e578657f7320209b613',NULL),
(1123,NULL,1,'Komár by byl oblíbený, kdyby místo krve sál tuk.','ces',NULL,'bccda64da963279c8ab7cdca7169f3ec',NULL),
(1124,NULL,1,'Není pravda, že máme málo času, pravdou ale je, že ho hodně promarníme.','ces','Seneca','be80a8ffdbbd24492b3108317c1f01ce',NULL),
(1125,NULL,1,'Děti, které se ptají PROČ, jsou ty, které změní svět.','ces','Neal Thompson','be86a9979a4ab9c8deb3cad1bdee13ff',NULL),
(1126,NULL,1,'„Skoč, křídla roztáhneš cestou.“','ces','Ray Bradbury','bfe20d25e51696114052548109541c27',NULL),
(1127,NULL,1,'Jsou dny, které by měl člověk radši prospat. Jako například dny od pondělí do pátku.','ces',NULL,'c086e85f14e3cb3ef7ff49bdcf0e044a',NULL),
(1128,NULL,1,'Skončil víkend: Kam se proboha poděla ta noc z pátku na neděli?!','ces',NULL,'c1dcda082507a58a4649aa5f665faa37',NULL),
(1129,NULL,1,'Těžké časy vám dodávají odvahu k tomu, abyste mysleli na nemyslitelné.','ces','Andy Grove','c284796ba5376ade9f142213ccc9083a',NULL),
(1130,NULL,1,'Můžu mít všechno, co chci, ale nemusím to mít dvakrát, nemusím to mít dvakrát větší a nemusím to mít dvakrát dražší, než je nutné.','ces','Warren Buffett - tehdy nejbohatší muž světa','c310db0c55b392f3e9f78c7dafdd9296',NULL),
(1131,NULL,1,'Jsme tím, co si myslíme. Ze svých myšlenek stavíme svůj svět.','ces','Buddha','c34e3f58a662857eb9624543d4c4a97c',NULL),
(1132,NULL,1,'Stárnutí je otrava, ale je to jediný způsob, jak se dožít vysokého věku.','ces','G. B. Shaw','c3ab4a04bf2638c55fee58d1f2686275',NULL),
(1133,NULL,1,'„Zpětná vazba neobsahuje absolutní pravdu, ale je pravdivá v očích toho, kdo ji poskytuje.“','ces',NULL,'c41f7ef93efb43b05417334dec6942f4',NULL),
(1134,NULL,1,'Věta by neměla obsahovat žádná zbytečná slova a odstavce by neměly obsahovat zbytečné věty ze stejného důvodu,','ces',NULL,'c483f49544d33693a429d491f51cfa7d',NULL),
(1135,NULL,1,'Žádné dítě není tak roztomilé, aby matka nebyla šťastná, když konečně usne.','ces','Ralph Waldo Emerson','c4bf73dd5eece04988f252bf7b2d6c5f',NULL),
(1136,NULL,1,'„Je třeba být si trochu podobni, abychom si rozuměli, ale trochu rozdílní, abychom se milovali.”','ces','Jean-Jacques Rousseau','c5091d08b9d730abb8ee6015b0abdece',NULL),
(1137,NULL,1,'„Kreativita může vyřešit téměř jakýkoliv problém. Tvůrčí akt, porážka zvyku originalitou, překoná všechno.“','ces','George Lois','c512f2ebe911548e79ec8ec4f516cef8',NULL),
(1138,NULL,1,'V přírodě nenajdeš dva stejné stromy, dva stejné klasy…','ces',NULL,'c6558dde0ced295c91ac95559e0c89df',NULL),
(1139,NULL,1,'„Dobré věci přicházejí k těm, kteří čekají. Velké věci přicházejí k těm, kteří zvednou zadek a dělají něco pro to, aby přišly.“','ces',NULL,'c66a80f62f3af49b82022ed6c46cd456',NULL),
(1140,NULL,1,'„Duchovní život je život za hranicemi běžných nálad. Je to život, v němž si volíme radost a nedovolujeme sami sobě stát se oběťmi pocitů štěstí nebo sklíčenosti.“','ces','Henri J. M. Nouwen','c671070e3c379b45d5aa7a3597014c04',NULL),
(1141,NULL,1,'Co slyším, to zapomenu. Co vidím, to si pamatuji. Co si vyzkouším, tomu taky rozumím.','ces','Confucius','c6eec200933539fd837f5b663cb6e4fe',NULL),
(1142,NULL,1,'Nepoužívejte příliš velká slova pro vaše téma. Nepište “nekonečně”, když chcete říct “velmi”, jinak nebudete mít slovo, když budete chtít mluvit o něčem opravdu nekonečném. C. S. Lewis','ces',NULL,'c71b121903bff769185929bc1b0d5c69',NULL),
(1143,NULL,1,'Každé dítě je umělec. Problém je, jak má zůstat umělcem, až jednou vyroste.','ces','Pablo Picasso','c763aa8a1b0ce9e0be5f016aa3ea5a2e',NULL),
(1144,NULL,1,'Zřídkakdy je vhodné říci všechno.','ces','Strunk and White','c7a6ad5e838e6a6af289a23da1aac410',NULL),
(1145,NULL,1,'Když píšu o zloději koní, chcete, abych napsal, že krást koně je špatné. Ale to přece každý ví!','ces','A. P. Čechov','c9396685e1f206a7c70cafe648d70191',NULL),
(1146,NULL,1,'Nejdřív máme děti na rukou, potom na klíně a nakonec na krku.','ces','japonské přísloví','c9a8ef593e672c6d864ac77ce6cb74d3',NULL),
(1147,NULL,1,'Teprve až pokácíte poslední strom,\r\naž otrávíte poslední řeku,\r\naž ulovíte poslední rybu,\r\nteprve tehdy přijdete na to,\r\nže peníze se nedají jíst.\r\n','ces','Teprve až pokácíte poslední strom,\r\naž otrávíte poslední řeku,\r\naž ulovíte poslední rybu,\r\nteprve te','ca2fa2694f6c07d517f16f7c0a277ed9',NULL),
(1148,NULL,1,'Problémy jsou nevyhnutelnou součástí života. Očekávej je a až přijdou, drž hlavu zpříma, podívej se jim přímo do očí a řekni: „Jsem větší než vy, neporazíte mě.“','ces','Ann Landersová','ca43aabc05410166c90e772994f2d178',NULL),
(1149,NULL,1,'Je těžké zbavit se vad, jež s námi vyrostly.','ces','Seneca mladší','ca9594154a49aabd40a227651e40c178',NULL),
(1150,NULL,1,'Stromy, jichž se mohu bezprostředně dotýkat a z nichž cítím ohromnou energii – růstové fluidum.\r\nVždyť každoročně – po celý svůj život – mi demonstrují své znovuzrození.','ces','Stromy, jichž se mohu bezprostředně dotýkat a z nichž cítím ohromnou energii – růstové fluidum.\r\nVžd','cb86245f98afd3a5e6e23119cf060c4a',NULL),
(1151,NULL,1,'„Když jsem s tebou, hodiny utíkají jako vteřiny. Když jsem bez tebe, dny mi připadají jako roky.”','ces',NULL,'cb8d6b76da3ecba2d4485c5b9451591e',NULL),
(1152,NULL,1,'„Svět nezajímá, co všechno víte a znáte. Svět se zajímá jen o to, co děláte s tím, co víte a znáte.“','ces','Tony Wagner','ce57d2ee541686516e164345a3600c7b',NULL),
(1153,NULL,1,'„Polibek je krásný vynález přírody, jak zastavit řeč, když už jsou slova zbytečná.”','ces','Ingrid Bergmanová','ce5fe958db34354de4b15a1947ec34c9',NULL),
(1154,NULL,1,'Čas musíme využívat kreativně a s vědomím, že doba je vždy zralá na konání dobra.','ces','Martin Luther King jr.','cf180a0dd2aa971a8e447b8ef191b92b',NULL),
(1155,NULL,1,'Pouze ti, kteří se odváží jít příliš daleko, mohou přijít na to, jak daleko se dá jít.','ces','T. S. Eliot','cf50f10d3d5a18495d8eed06b182b37e',NULL),
(1156,NULL,1,'„Jsem vděčný všem, kteří mi řekli NE. Díky nim jsem to totiž zvládl sám.“','ces','Albert Einstein','d1f4e6d74e7944520a325b0bb76e5395',NULL),
(1157,NULL,1,'Archeolog je ten nejlepší manžel, jakého si žena může přát; čím je žena starší, tím je pro něj zajímavější.','ces','Agatha Christie','d20e2b7bc7f570687b8f467f12b331fd',NULL),
(1158,NULL,1,'Svědomí je nejlepší kompas, který máme.','ces','Jean-Jacques Rousseau','d2da0403571e2a897ca22c49842fde05',NULL),
(1159,NULL,1,'„Motivace je to, díky čemuž začnete. Zvyk je to, díky čemuž v tom budete pokračovat.“','ces','Jim Ryan','d380ed21d5b240be9ab53dd000dfd720',NULL),
(1160,NULL,1,'„Cestovat znamená nacházet věci, které by tě nikdy nenapadlo hledat.“','ces',NULL,'d54c86629b16b2fa03db97ed81c4d4fa',NULL),
(1161,NULL,1,'Dům bez dětí je jako zvon bez srdce.','ces','Sylva','d5ef91783cbf0e5dac063ecffa985495',NULL),
(1162,NULL,1,'Nepiju alkohol. Pouze dezinfikuji svoji duši.','ces',NULL,'d62041077b309db2481854b955e9455b',NULL),
(1163,NULL,1,'„Úspěch je chůze od neúspěchu k neúspěchu bez ztráty nadšení.“','ces','Winston Churchill','d69a0775cfa567d7bae37fe1406db088',NULL),
(1164,NULL,1,'Je pravda, že tvrdá práce ještě nikdy nikoho nezabila, ale já si říkám, proč to riskovat?','ces','Ronald Reagan','d769cfddaf1082dac70eee59fc27fe41',NULL),
(1165,NULL,1,'Zásadovost je posledním útočištěm lidí bez představivosti.','ces','Oscar Wilde','d812eb799bb60543c564932b906b0905',NULL),
(1166,NULL,1,'Tvůrčí práce je hra. Je to svobodná úvaha s použitím materiálů ve tvaru, který si člověk zvolí.','ces','Stephen Nachmanovitch','d84a2169d28bad72dc9bd18fae09008e',NULL),
(1167,NULL,1,'Odchýlit se od norem znamená, že na to musíte mít. Než začnete být tvořiví, musíte být odvážní. Tvořivost je osud, ale odvaha je cestou.','ces','Joye Reiman','d922a9beed0aae5ce6ad1e50de785674',NULL),
(1168,NULL,1,'„Vykonávat věc, které se bojíme, je první krok k úspěchu.“','ces','Mahátma Gándhí','d9524dd5a43eec581e675699ecd4d913',NULL),
(1169,NULL,1,'Romantické citáty a myšlenky slavných i neznámých autorů zamilované muže potěší stejně jako zamilované ženy.','ces',NULL,'db27e57fa0b5b529e1664ca27cf05683',NULL),
(1170,NULL,1,'„Musíte být schopni dělat dnes věci, které ostatní nedělají, abyste zítra měli věci, které ostatní nikdy mít nebudou.“','ces','Les Brown','db3189ba3c3110285530538ae8557619',NULL),
(1171,NULL,1,'„Pokud opravdu chcete dosáhnout úspěchu, nikdy se nevzdávejte. A to bez ohledu na to, do jak špatné situace se můžete dostat.“','ces',NULL,'dc11aeee2233b7c26986cb8b4da3f039',NULL),
(1172,NULL,1,'Neexistence pointy v dramatu neosvobuzuje diváky od povinnosti opustit sál.','ces','S. J. Lec','dd7249547081d67408d5d1f606c83dcd',NULL),
(1173,NULL,1,'„I na malé cestě se dají zažít velká dobrodružství.“','ces',NULL,'dd89d6cefd0bf9905f62aae52c270706',NULL),
(1174,NULL,1,'Příběhy, kde se lidé učí z chyb druhých, jsou známkou civilizované společnosti.','ces','Terry Pratchett','ddc72f32af9058e378ddb9011d7474a8',NULL),
(1175,NULL,1,'Nikdy nepoužívejte dlouhé slovo, které může být nahrazeno krátkým.','ces','George Orwell','dde49b4e1934c128a323f38dae577a0a',NULL),
(1176,NULL,1,'Pokud mi něco vysvětlujete, je to esej. Pokud mi něco přímo ukazujete, je to příběh.','ces','Barbara Greene','de93c21f562122f15b1525e7cf8c75d0',NULL),
(1177,NULL,1,'Dělat z jednoduchého složité je zcela běžné. Ale vytvářet z komplikovaných věcí díla jednoduchá, to je opravdová kreativita!','ces','Charles Mingus','df4299e7857b0c2acf99b2ea986f9aef',NULL),
(1178,NULL,1,'Vše, co si dokážete představit, je skutečné.','ces','Pablo Picasso','df592ce06069942f05bb4ab7e5f31d22',NULL),
(1179,NULL,1,'Ženy mají dvě zbraně – kosmetiku a slzy. Naštěstí pro muže mohou být jen zřídkakdy s úspěchem použity obě současně.','ces','Napoleon Bonaparte','df6b5250cd0a201a28f92782d015dc91',NULL),
(1180,NULL,1,'„Opravdová láska je umění najít ve světě někoho, s kým si rozumíš lépe, než se sebou samým.”','ces','Henri Fréderic Amiel','dfab209413d34b815e72bd0ff59e0db3',NULL),
(1181,NULL,1,'„Máme se od každého, kdo se ocitne v našem životě, něco naučit. Některé lekce jsou bolestivé, jiné bezbolestné, ale všechny jsou k nezaplacení.“','ces',NULL,'e1052841f48d0b0aa758b920eaeedbc3',NULL),
(1182,NULL,1,'„Správně stanovený cíl je polovina úspěchu.“','ces','Zig Ziglar','e19e9c4c30cadfc10e3ae38ca982ba6f',NULL),
(1183,NULL,1,'Kdo sází stromy, má druhé raději, než sebe.','ces','Staré anglické rčení','e24d119136c47fde05e01f38ded0e1de',NULL),
(1184,NULL,1,'„Život je jako fotografie. Také potřebujete negativy k rozvoji.“','ces',NULL,'e2f4b9ee76a1fa178c4e8e12d3162ead',NULL),
(1185,NULL,1,'Dítě není žádný stroj, proto nelze vyslovit radu nebo návod k upotřebení či použití. Každá situace je jiná, každé dítě je jiné.','ces',NULL,'e390ff419ebc75ee2b9e1a365c8e0baa',NULL),
(1186,NULL,1,'Průměrný učitel vypráví. Dobrý učitel vysvětluje. Výborný učitel ukazuje. Nejlepší učitel inspiruje.','ces','Charles Farrar Browne','e439d71003ca0516c001cc2c7ada29be',NULL),
(1187,NULL,1,'Mnohem těžší než dostat ženu do postele, je dostat jí ráno z postele.','ces','Talmer','e4b7498d2af7d5cc529a0a742d638641',NULL),
(1188,NULL,1,'Až jednoho dne ucítíš velké prázdno, jez. Je to hlad!','ces',NULL,'e4c40cf81b643e32c56278c6711eb71b',NULL),
(1189,NULL,1,'Pracujte tak, jako byste na všechno měli jen jeden den času.','ces','Zig Ziglar','e800afaeb255c2b785723a1c3994c669',NULL),
(1190,NULL,1,'Sebedůvěra je schopnost vidět sebe sama jako schopného a způsobilého člověka, který dokáže lásku přijímat i dávat, který je jedinečný a kterého lidé uznávají.','ces','Patricia H. Berneová, Louis M. Savary','e81e4c2891162f4f12d766a4985af726',NULL),
(1191,NULL,1,'„Největší chyba, kterou v životě můžete udělat, je mít pořád strach, že nějakou uděláte.“','ces','Elbert Hubbard','e97b6cbb81a0681813ac86c232a606fc',NULL),
(1192,NULL,1,'„Cesta k úspěchu a cesta k neúspěchu jsou téměř přesně stejné.“','ces','Colin R. Davis','ea3c1c6baf2146f4015126c26bb3b0e5',NULL),
(1193,NULL,1,'Krása je moc, kterou žena okouzluje milence, a děsí manžela.','ces','Ambrose Bierce','ebafb20624c44536d7d0cf5b4a1706a0',NULL),
(1194,NULL,1,'Stavu větví nejlépe prospívá péče o kořeny.','ces',NULL,'ebd91b8dc5ff3668177b7e232c56769b',NULL),
(1195,NULL,1,'„Vrátit se tam, odkud pocházíte, není to samé, jako nikdy neodejít.“','ces','Terry Pratchett','ec31d6d5724d8009e90c5b476e85661e',NULL),
(1196,NULL,1,'Není toho moc, co by mělo být řečeno o souvětí s výjimkou toho, že většina spisovatelů neví, kdy má souvětí ukončit.','ces','William Zinsser','ec57c7d46cfbf7b82a4169fcb8c3fb46',NULL),
(1197,NULL,1,'Každé ráno máme po zazvonění budíku úplně novou příležitost udělat v čase, který nám byl darován, to, co chceme. A po celý zbytek života budeme tento dar dostávat znovu a znovu.','ces','Hyrum Smith','ed25868c78d9027504e069cdccc7e980',NULL),
(1198,NULL,1,'Rodiče, na které děti zapomněly, jsou jako stromy bez listí.','ces','Korejské přísloví','edb9d0774fdfd7e0c7c62d598d793ab8',NULL),
(1199,NULL,1,'„Cestování je jediná věc, kterou si koupíš a učiní tě bohatším.“','ces',NULL,'eeaa3b83521e7239c6febf343dacb608',NULL),
(1200,NULL,1,'Na dně hlavního proudu řeky nacházíme pouze průměrnost.','ces','Jonas Ridderstrale','ef14b7ac456c719e572823b0a0fa4f4c',NULL),
(1201,NULL,1,'Daň z cigaret má lidi odradit od kouření, daň z alkoholu od pití a daň ze mzdy…','ces',NULL,'ef64ce3320fd3bce0db4b53e0f437df7',NULL),
(1202,NULL,1,'Nulová rozmanitost zabíjí tvořivost. Stejnost plodí stejné a ještě více stejného.','ces','Jonas Ridderstrale','ef71cf410ba4d181967c06c312cdf29e',NULL),
(1203,NULL,1,'„Sněte si svůj vlastní sen. Nebo si Vás najme někdo jiný, abyste snili ten jeho.“','ces','Farrah Gray','f0760f6fa81e22b6fb49aa0209e7c1d1',NULL),
(1204,NULL,1,'Máš ujít deset mil a už jsi ušel devět? Raduj se, jsi v polovině cesty!','ces','zenové úsloví','f09979a0569ef6e3a1a71e729b4b42e8',NULL),
(1205,NULL,1,'Síla příběhu. Neodcházejte bez ní z domu. A nikdy, nikdy, nikdy ji nepodceňujte!','ces','Terry Pratchett','f1a173a0c54126f54e11e0378d2e108d',NULL),
(1206,NULL,1,'„Cestování zlepšuje naši představivost, uspokojuje naši zvědavost a připomíná nám, kolik máme všichni společného.“','ces','Deborah Lloyd','f1be92c05e51e0440523fbe2de5350dd',NULL),
(1207,NULL,1,'„Vše, co potřebuji k životu, je spát pod hvězdnou oblohou, probudit se do švitoření ptáků a vychutnat si kávu při ranním svitu slunce.“','ces',NULL,'f2027587f5baa7687331882e7dd81bc8',NULL),
(1208,NULL,1,'Pokud jsme v něčem úspěšní, není to práce, je to životní styl.','ces','Granatelli','f2507f77a60ba187b167769478280300',NULL),
(1209,NULL,1,'Rostoucí strom je živým symbolem pokrokového národa.','ces','D. Nehrů','f2a36294106cf968baca377e223734ac',NULL),
(1210,NULL,1,'Postavení umělce je pokorné. Je ve své podstatě kanálem.','ces','Piet Mondrian','f3095cec6fc4e5574faab98befefd91e',NULL),
(1211,NULL,1,'Jednou ranou strom nepadá.','ces',NULL,'f38cb9413b7e026f5163c7f06c7c0f05',NULL),
(1212,NULL,1,'Neučme děti to, co si mohou samy objevit.','ces','Jean-Jacques Rousseau','f3d399abcf1f1812121cf42854cc632a',NULL),
(1213,NULL,1,'„Nic není dobré ani špatné, pouze naše myšlení to činí takovým či onakým.“','ces','William Shakespeare','f403375ce914776bc110861eb3cdf744',NULL),
(1214,NULL,1,'„Zapomeňte na všechno, co jste slyšeli o prvním dojmu. Mnohem důležitější je poslední dojem. Ten si totiž budou všichni pamatovat.“','ces','Liz Danzico','f4425a723ca0b97f208573340bf03800',NULL),
(1215,NULL,1,'Mezi nejdůležitější věty v každém textu patří ta první. Pokud nepřiměje čtenáře, aby přistoupil k druhé větě, váš text je mrtvý. A pokud ho druhá věta nezaujme tak, aby pokračoval ke třetí větě, je stejně mrtvý. Takové vrstvení, které nutí čtenáře neustále pokračovat, dokud ho příběh nepohltí, je pro spisovatele životně důležitá dovednost.','ces','William Zinsser','f48978f33a508229b128ee4e4255a046',NULL),
(1216,NULL,1,'Láska je bezproblémová jako vozidlo. Problematičtí jsou pouze řidiči, cestující a cesta.','ces','Franz Kafka','f54c6f4bc593fe907d0a78db1a3be75b',NULL),
(1217,NULL,1,'Hodina výtvarné výchovy pro mě byla jako náboženský obřad. Dříve než jsem se dotkl papíru nebo tužky, pečlivě jsem si umyl ruce. Pracovní nástroje pro mě byly posvátnými předměty.','ces','Joan Miró','f80fa314aba724f3a5246ad48c94d609',NULL),
(1218,NULL,1,'„Nejlepší pomsta je obrovský úspěch.“','ces','Frank Sinatra','f8c7f5ccc50e66182edbe1473aa24763',NULL),
(1219,NULL,1,'„Naše současné výsledky nejsou nic jiného než výsledek našeho dřívějšího uvažování. Jsme tam, kam nás naše myšlenky přivedly, a zítra budeme tam, kam nás dovedou naše dnešní úvahy.“','ces','Blaise Pascal','f95002d55454cbab388e9a3955dcea26',NULL),
(1220,NULL,1,'„Cesta dlouhá i 1000 mil vždy začíná prvním krokem.“','ces','Lao Tzu','f9e30f8c55c95cbce0220f640461dc83',NULL),
(1221,NULL,1,'Naše běžná realita je hustě zaplněná absurdními zprávami a znameními. Všimněte si jich. Mají nejen sociální význam, ale často jsou dost nepředvídatelným úvodem k odlišení jednoho jedince od druhého.','ces','William Zinsser','f9eb5dd72cf9c795a47bec9ac860115c',NULL),
(1222,NULL,1,'„Jestli najdeš v životě cestu bez překážek, pravděpodobně nikam nevede.“','ces','Arthur C. Clarke','fb19ece9e5aa58cb6e6e960eadd2c8bb',NULL),
(1223,NULL,1,'Skutečná svoboda člověka nespočívá v tom, aby dělal co che, nýbrž spíš v tom, aby nikdy nedělal, co nechce.\r\n','ces','Skutečná svoboda člověka nespočívá v tom, aby dělal co che, nýbrž spíš v tom, aby nikdy nedělal, co ','fbffdacf1b5838311b267b07a82962f8',NULL),
(1224,NULL,1,'Spousta tvorů je inteligentních, ale jen jediný vypráví příběhy – a to jsme my.','ces','Terry Pratchett','fc1a04260ecf268e2775254d6fa93449',NULL),
(1225,NULL,1,'„Nešťastná láska není to nejhorší. To pravé neštěstí je nemilovat.”','ces','Eduard Bass','fc1cd80dda906d13b4c57aa96b936030',NULL),
(1226,NULL,1,'„Nejděsivější je to vždycky před začátkem psaní. Pak už vše může být jenom lepší.“','ces','Stephen King','fc4eb33c96a39e3bad574da783968ac9',NULL),
(1227,NULL,1,'„Pokud opravdu chcete něco udělat, tak najdete cestu. Pokud tak neučiníte, tak najdete výmluvu.“','ces','Jim Rohn','fccfb005c1ad28a627ced488be3b92d5',NULL),
(1228,NULL,1,'Vypravování odhaluje smysl všeho, aniž by se dopustilo špatné definice.','ces','Hannah Arendt','fddfdb422aa466814dda30f7bc8cbfd7',NULL),
(1229,NULL,1,'Kdo dal život dítěti, stává se jeho dlužníkem.','ces','Fabroe','fde72704df60e8cf0e2af684997db8a6',NULL),
(1230,NULL,1,'„V životě jsou tři věci, které už nevrátíte. Slovo, které jste vyřknuli, moment, který jste propásli a čas, který uplynul. Buďte proto opatrní.“','ces',NULL,'fe0bab120e2d778573914b0eb8923f7a',NULL),
(1231,NULL,1,'Každá kniha by měla být zábavná. A dobrá kniha bude více, v žádném případě ne méně.','ces','C. S. Lewis','fe65f85aea062234c874bb4c87a16e96',NULL),
(1232,NULL,1,'Když celý svět křičí: „Vzdej to!“, naděje šeptá: „Zkus to ještě jednou.“','ces',NULL,'fe749e27fc93700a2282da444a0f345c',NULL),
(1233,NULL,1,'„Je těžké čekat na něco, co víte, že se možná nikdy nestane. Ale je ještě těžší vzdát se, když víte, že to je to jediné, co opravdu chcete.“','ces',NULL,'ff9af1b90413bb06d7e00ae852183d0b',NULL),
(1234,NULL,1,'Člověk, který cestuje s touhou dozvědět se, směřuje přes všechny dálky hlavně k sobě samému.','ces','Jan Werich','ffcc8029f9e15f403623019a58d99cdd',NULL),
(1342,'Nikdy jsem neudělal nic důležitého náhodou, ani žádný z mých vynálezů nevznikl náhodou.',1,'I never did anything worth doing by accident, nor did any of my inventions come by accident','eng','Thomas Edison','885c43247aea1c3e442199996308f1e0',NULL),
(1343,'Za své slzy se nikdy nemusíme stydět.',0,'We need never be ashamed of our tears.','eng','Charles Dickens','41c677871dbabee31811373c3c7f013f',NULL),
(1344,'Nikdo na tomto světě není zbytečný, kdo ulehčuje břemeno druhému.',0,'No one is useless in this world who lightens the burdens of another.','eng','Charles Dickens','7c99aa90ef04307727c204a1bbb3b815',NULL),
(1345,'Mysli, stejně jako těla, často upadnou do pimpled, špatně podmíněného stavu z pouhého přebytku pohodlí.',0,'Minds, like bodies, will often fall into a pimpled, ill-conditioned state from mere excess of comfort.','eng','Charles Dickens','4bd10c7e9df3c9b2507af813845843a8',NULL),
(1346,'Podmaňte si chuť k jídlu, moji drazí, a přemohli jste lidskou přirozenost.',0,'Subdue your appetites, my dears, and you\'ve conquered human nature.','fra','Charles Dickens','bb4b29cf74a194570b49f175e9102950',NULL),
(1347,'Všechno přijde k tomu, kdo spěchá, zatímco čeká.',0,'Everything comes to him who hustles while he waits.','eng','Thomas Edison','53069633490fba334ca3b835947a95cb',NULL),
(1348,'Nevíme o ničem ani miliontinu jednoho procenta.',1,'We don\'t know a millionth of one percent about anything.','eng','Thomas Edison','515b053e70ce7c7ca89678f56f529820',NULL),
(1349,'Výsledky! Ale člověče, mám spoustu výsledků. Znám několik tisíc věcí, které nefungují.',1,'Results! Why, man, I have gotten a lot of results. I know several thousand things that won\'t work.','eng','Thomas Edison','47be22100e53e86d74dd9e280ef8d5c4',NULL),
(1350,'Kdybychom všichni dělali věci, kterých jsme schopni, doslova bychom sami sebe ohromili.',0,'If we all did the things we are capable of doing, we would literally astound ourselves.','eng','Thomas Edison','d564fa5fc17166cbd2cd2dd8a8ce3adc',NULL),
(1351,'Vycvičte fíkovník tak, jak by měl, a až budete staří, posaďte se do jeho stínu.',0,'Train up a fig tree in the way it should go, and when you are old sit under the shade of it.','eng','Charles Dickens','f67fb1dd796982f2c4f6c24b14b5eca0',NULL),
(1352,'Neznám amerického gentlemana, Bůh mi odpusť, že jsem dal dvě taková slova dohromady.',0,'I do not know the American gentleman, god forgive me for putting two such words together.','eng','Charles Dickens','ac8b1a2be235af3bb35c78c1a07043d9',NULL),
(1353,'Lékař budoucnosti nebude dávat žádné léky, ale bude své pacienty zajímat o péči o lidský rám, o správnou stravu, o příčinu a prevenci nemocí.',0,'The doctor of the future will give no medicine, but will interest her or his patients in the care of the human frame, in a proper diet, and in the cause and prevention of disease.','eng','Thomas Edison','1972f1f026881bd9d20fafb853cd032f',NULL),
(1354,'Génius je jedno procento inspirace, devadesát devět procent potu.',1,'Genius is one per cent inspiration, ninety-nine per cent perspiration.','eng','Thomas Edison','2df6ff4aa5b3a5577ea511d8dfec42af',NULL),
(1355,'Nikdy jsem v životě nedělal denní práci.',0,'I never did a day\'s work in my life.  It was all fun.','eng','Thomas Edison','c832601f003120eccca4a8d331afc9e7',NULL),
(1356,'Pokud najdu 10 000 způsobů, jak něco nefunguje, nezklamal jsem. Nenechám se odradit, protože každý chybný pokus je dalším krokem vpřed.',0,'If I find 10,000 ways something won\'t work, I haven\'t failed. I am not discouraged, because every wrong attempt discarded is another step forward.','eng','Thomas Edison','16926fe7a8ca2d7499913bb80efedfe2',NULL),
(1357,'Chcete-li vynalézat, potřebujete dobrou představivost a hromadu šrotu.',1,'To invent, you need a good imagination and a pile of junk.','eng','Thomas Edison','0ae844760629ffdfbe51f2b75f5d5927',NULL),
(1358,'Neexistuje žádný účel, kterému člověk nebude chodit, aby se vyhnul práci myšlení.',0,'There is no expedient to which a man will not go to avoid the labor of thinking.','eng','Thomas Edison','86e5d2273cc7db6c0b53f53b389eb67c',NULL),
(1359,'Většina lidí přehlédne příležitost, protože je oblečená v kombinéze a vypadá jako práce.',1,'Opportunity is missed by most people because it is dressed in overalls and looks like work.','eng','Thomas Edison','d2d24f4c2e108c42ae5a2be43988572e',NULL),
(1360,'Jako lék na znepokojení je práce lepší než whisky.',1,'As a cure for worrying, work is better than whisky.','eng','Thomas Edison','07a3860f309e2012ef4849c9d0647dc7',NULL),
(1361,'Přemýšlejte o svých současných požehnáních, kterých má každý člověk mnoho; ne o svých minulých neštěstích, ta má každy několik.',1,'Reflect on your present blessings, of which every man has many; not on your past misfortunes, of which all men have some.','eng','Charles Dickens','a21a7f895cf643e2b3b19858ee7725b6',NULL),
(1362,'Nedělejte si starosti se svými potížemi v matematice. Mohu vás ujistit, že moje jsou ještě větší.',1,'Do not worry about your difficulties in Mathematics. I can assure you mine are still greater.','eng','Albert Einstein','2c8912402a4b45ff03b2eb871ba141b7',NULL),
(1363,'Kdybych to jen věděl, stal bych se zámečníkem.',1,'If I had only known, I would have been a locksmith.','eng','Albert Einstein','fa0b0583e574c132a22bec887b1ddce2',NULL),
(1364,'Každý den si připomínám, že můj vnitřní a vnější život je založen na práci jiných mužů, žijících a mrtvých, a že se musím vyvíjet, abych dal ve stejném opatření, jaké jsem obdržel, a stále dostávám.',0,'Every day I remind myself that my inner and outer life are based on the labors of other men, living and dead, and that I must exert myself in order to give in the same measure as I have received and am still receiving.','eng','Albert Einstein','3c74630edb5a64bb3c7ce9427c2de8ed',NULL),
(1365,'Pokud jste venku popisovat pravdu, nechte eleganci krejčímu.',0,'If you are out to describe the truth, leave elegance to the tailor.','eng','Albert Einstein','8e0386cbeaaf81dae7eb574b0df49e44',NULL),
(1366,'Etické axiomy jsou nalezeny a testovány ne příliš odlišně od axiomů vědy.',0,'Ethical axioms are found and tested not very differently from the axioms of science. Truth is what stands the test of experience.','eng','Albert Einstein','6c294f23197ebbbedd13de7ce6904884',NULL),
(1367,'Je to nejvyšší umění učitele, aby probudil radost z tvůrčího vyjádření a znalostí.',0,'It is the supreme art of the teacher to awaken joy in creative expression and knowledge.','eng','Albert Einstein','90a37d1bc8ee52615b0722f288d4da28',NULL),
(1368,'Před Bohem jsme všichni stejně moudří - a stejně pošetilí.',1,'Before God we are all equally wise - and equally foolish.','eng','Albert Einstein','8b4faae603c41699ffcfa18dcd879f1f',NULL),
(1369,'Nikdy nemyslím na budoucnost - přijde to dost brzy.',0,'I never think of the future - it comes soon enough.','eng','Albert Einstein','9692c99336adfdcdf4dbdef3456da99c',NULL),
(1370,'Své žáky nikdy neučím. Pouze se snažím poskytnout podmínky, za kterých se mohou učit.',0,'I never teach my pupils. I only attempt to provide the conditions in which they can learn.','eng','Albert Einstein','411ef918161245c7ac30332e12488ec2',NULL),
(1371,'Čtení po určitém věku příliš odvádí mysl od jejích tvůrčích snah. Každý člověk, který čte příliš mnoho a používá svůj vlastní mozek příliš málo, spadá do líných návyků myšlení.',1,'Reading, after a certain age, diverts the mind too much from its creative pursuits. Any man who reads too much and uses his own brain too little falls into lazy habits of thinking.','eng','Albert Einstein','96d5492c4b420202c5211ca37e21e43e',NULL),
(1372,'Gravitace nemůže být zodpovědná za to, že se lidé zamilují. Jak proboha můžete vysvětlit z hlediska chemie a fyziky tak důležitý biologický jev jako je první láska? Položte ruku na sporák na minutu a zdá se to jako hodina. Posaďte se s tou zvláštní dívkou na hodinu a zdá se to jako minuta. To je relativita.',0,'Gravitation cannot be held responsible for people falling in love. How on earth can you explain in terms of chemistry and physics so important a biological phenomenon as first love? Put your hand on a stove for a minute and it seems like an hour. Sit with that special girl for an hour and it seems like a minute. That\'s relativity.','eng','Albert Einstein','b5a5d47d0000bcecc1578edb5daf587c',NULL),
(1373,'Ideály, které mi osvětlily cestu a znovu a znovu mi dodávaly odvahu vesele čelit životu, byly laskavost, krása a pravda. Drobné předměty lidského úsilí, majetku, vnějšího úspěchu, luxusu se mi vždy zdály opovrženíhodné.',0,'The ideals which have lighted my way, and time after time have given me new courage to face life cheerfully, have been Kindness, Beauty, and Truth. The trite subjects of human efforts, possessions, outward success, luxury have always seemed to me contemptible.','eng','Albert Einstein','74d18879f8f8e759015a699d4ef50b0b',NULL),
(1374,'Jen málo lidí je schopno vyjádřit názory na vyrovnání, které se liší od předsudků jejich sociálního prostředí.',0,'Few people are capable of expressing with equanimity opinions which differ from the prejudices of their social environment. Most people are even incapable of forming such opinions.','eng','Albert Einstein','a6bc8b061def346864e4373c2bde694c',NULL),
(1375,'Samotné zákony nemohou zajistit svobodu projevu; aby každý člověk prezentoval své názory bez trestu, musí být v celé populaci duch tolerance.',0,'Laws alone can not secure freedom of expression; in order that every man present his views without penalty there must be spirit of tolerance in the entire population.','eng','Albert Einstein','ef37c4b665c2f2d3afa298e67a7ea328',NULL),
(1376,'Pouze dvě věci jsou nekonečné, vesmír a lidská hloupost a nejsem si jistý tím prvním.',0,'Only two things are infinite, the universe and human stupidity, and I\'m not sure about the former.','eng','Albert Einstein','e509471fd05d07d593de2b4e8265466b',NULL),
(1377,'Představivost je důležitější než znalosti ...',0,'Imagination is more important than knowledge...','eng','Albert Einstein','3e93d87711a5a5ce460cf062fcf49b29',NULL),
(1378,'Nevím, s jakými zbraněmi se bude bojovat třetí světová válka, ale čtvrtá světová válka se bude bojovat holemi a kameny.',1,'I know not with what weapons World War III will be fought, but World War IV will be fought with sticks and stones.','eng','Albert Einstein','21661c9e63a0008f1c0c7bf1d2be0212',NULL),
(1379,'Je to zázrak, že zvědavost přežije formální vzdělání.',1,'It is a miracle that curiosity survives formal education.','eng','Albert Einstein','5e8ab65554a87e0480dadc0c753f2ab6',NULL),
(1380,'Zdá se, že náš věk charakterizuje dokonalost prostředků a zmatek cílů.',0,'Perfection of means and confusion of ends seems to characterize our age.','eng','Albert Einstein','8b47629452ef6146b35f83bc03e0b60f',NULL),
(1381,'Moje náboženství se skládá z skromného obdivu nelezeného nadřazeného ducha, který se odhaluje v lehkých detailech, které jsme schopni vnímat s naší křehkou a slabou myslí.',0,'My religion consists of a humble admiration of the illimitable superior spirit who reveals himself in the slight details we are able to perceive with our frail and feeble mind.','eng','Albert Einstein','0b151acf33acb76e7937dbdcdb5ba94f',NULL),
(1382,'Čím menší mysl, tím větší domýšlivost.',1,'The smaller the mind the greater the conceit.','eng','Aesop','94a0499492f32accb265bc7334be38a0',NULL),
(1383,'Buďte spokojeni se svým údělem; člověk nemůže být ve všem první.',1,'Be content with your lot; one cannot be first in everything.','eng','Aesop','a1b06224e1edf4efc8644b0218c91af4',NULL),
(1384,'Cena je to, co platíte. Hodnota je to, co dostanete.',0,'Price is what you pay. Value is what you get.','fra','Warren Buffett','facfb83acf6118cbf2906047353602e7',NULL),
(1385,'Jediný čas na jejich nákup je den bez „y“.',0,'The only time to buy these is on a day with no \'y\' in it.','eng','Warren Buffett','f73a03475555322715636c2ebdf73733',NULL),
(1386,'Zranění může být odpuštěna, ale nezapomenout.',0,'Injuries may be forgiven, but not forgotten.','eng','Aesop','98acf103971f26565a6011fc387790cd',NULL),
(1387,'Většina lidí se o akcie zajímá, když se o ně zajímají všichni ostatní. Čas se začít zajímat je tehdy, když se o to nikdo jiný nezajímá. Nemůžete kupovat to, co je populární, a uspět.',1,'Most people get interested in stocks when everyone else is. The time to get interested is when no one else is. You can\'t buy what is popular and do well.','eng','Warren Buffett','e176f3def0f23491df7f1bc59c9be4ea',NULL),
(1388,'Nezavřu podnik s podprůměrnou ziskovostí jen proto, abych přidal zlomek bodu k našim firemním výnosům. Také považuji za nevhodné, aby i mimořádně zisková společnost financovala operaci, jakmile se zdá, že má v vyhlídce nekonečné ztráty. Adam Smith by nesouhlasil s mým prvním návrhem a Karl Marx by nesouhlasil s mým druhým; střední cesta je jediná pozice, která mi dává pohodlí.',0,'I won\'t close down a business of subnormal profitability merely to add a fraction of a point to our corporate returns. I also feel it inappropriate for even an exceptionally profitable company to fund an operation once it appears to have unending losses in prospect. Adam Smith would disagree with my first proposition and Karl Marx would disagree with my second; the middle ground is the only position that leaves me comfortable.','eng','Warren Buffett','322e72ac9d37b5902becd7dea957f76b',NULL),
(1389,'Raději buďte moudří neštěstí ostatních než ze svých vlastních.',0,'Better be wise by the misfortunes of others than by your own.','eng','Aesop','6e54f913c0149fe40cd97f9c4d67a198',NULL),
(1390,'Porušil jsem pravidlo Noea: předpovídání deště se nepočítá;',0,'I violated the Noah rule: Predicting rain doesn\'t count; building arks does.','eng','Warren Buffett','38b7a8a63e6026db18dde516a6fa2499',NULL),
(1391,'Je snadné být statečný z bezpečné vzdálenosti.',1,'It is easy to be brave from a safe distance.','eng','Aesop','fcce97c61f5b21b4fd911393d8baf6fd',NULL),
(1392,'Teprve když vyjde příliv, zjistíte, kdo plaval nahý.',0,'It\'s only when the tide goes out that you discover who\'s been swimming naked.','eng','Warren Buffett','e9c6b036c0af1a6b7c4ddd3efbe2042d',NULL),
(1393,'Dejte si pozor, abyste neztratili látku uchopením ve stínu.',0,'Beware lest you lose the substance by grasping at the shadow.','eng','Aesop','078045513184b746fe0fbf384b1654ec',NULL),
(1394,'Mysl, který se rozrušil nejasnosti štěstí, od smutku osvobozeného, od nečistot očištěných, od osvobozeného strachu - je to největší požehnání.',0,'A mind unruffled by the vagaries of fortune, from sorrow freed, from defilements cleansed, from fear liberated — this is the greatest blessing.','eng','The Buddha','948b014c420430ca80262d245ca38ca5',NULL),
(1395,'Nenávist není na tomto světě nikdy utišena nenávistí. Nenávist sama o sobě je nenávist uklidněna. To je věčný zákon.',0,'Hatred is never appeased by hatred in this world. By non-hatred alone is hatred appeased. This is a law eternal.','eng','The Buddha','548dd5acc4055781593cf420f0b46692',NULL),
(1396,'Věc, která se mi nelíbí, se nelíbí i ostatním. Když se mi to nelíbí, jak to můžu udělat někomu jinému?',1,'The thing that is disliked by me is also disliked by others. Since I dislike this thing, how can I inflict it on someone else?','eng','The Buddha','462f5435955050bfead572c86ec68117',NULL),
(1397,'„Všechny podmíněné věci jsou nestálé“ - když to člověk vidí s moudrostí, odvrátí se od utrpení.',0,'\'All conditioned things are impermanent\' — when one sees this with wisdom, one turns away from suffering.','eng','The Buddha','8c6b151e4b78f40d212c3dfcb8a49b17',NULL),
(1398,'Moudrý člověk by měl být naléhavě přesunut při příležitostech, které přispívají k naléhavosti.',0,'A wise person should be urgently moved on occasions that make for urgency.','eng','The Buddha','4edabefcd03d95e863c7e207a9593f72',NULL),
(1399,'Člověk by měl trénovat skutky zásluh-Generozita, vyvážený život, rozvíjet milující mysl-který přináší dlouhodobé štěstí.',0,'One should train in deeds of merit—generosity, a balanced life, developing a loving mind—that yield long-lasting happiness.','eng','The Buddha','0a40bd9037ed678143723034b7081615',NULL),
(1400,'„Jaký jsem já, takoví jsou i oni; jaký jsou oni, tak jsem i já.“ Při porovnávání druhých se sebou samým nezabíjejte ani nenechávejte druhé zabíjet.',0,'\'As I am, so are they; as they are, so am I.\' Comparing others with oneself, do not kill nor cause others to kill.','eng','The Buddha','c997f45ea4398ce6e8b2cce71a850aa4',NULL),
(1401,'Ať nikdo nehledá chyby na druhých, ať nikdo nevidí opomenutí a provize druhých. Ale ať člověk vidí své vlastní činy, vykonané a odčiněné.',0,'Let none find fault with others; let none see the omissions and commissions of others. But let one see one\'s own acts, done and undone.','eng','The Buddha','76e6f00cc773e46add24865549011ec4',NULL),
(1402,'Budeme rozvíjet a kultivovat osvobození mysli milujícím zaklínavostí, učinit z něj naše vozidlo, učinit z něj náš základ, stabilizovat ho, cvičit v něm a plně to zdokonalit.',0,'We will develop and cultivate the liberation of mind by lovingkindness, make it our vehicle, make it our basis, stabilize it, exercise ourselves in it, and fully perfect it.','eng','The Buddha','efc7d3b0d7defb78a273daf687c43d46',NULL),
(1403,'Pokud najdete moudrého kritika, který poukáže na vaše chyby, následujte ho jako průvodce ke skrytému pokladu.',1,'Should you find a wise critic to point out your faults, follow him as you would a guide to hidden treasure.','eng','The Buddha','20a8136f4f1d8c54bccbec859ad14914',NULL),
(1404,'Všechny zkušenosti předchází mysl, která má mysl jako jejich pán, vytvořená myslí.',0,'All experiences are preceded by mind, having mind as their master, created by mind.','eng','The Buddha','49383a88cb1e17d71cd999089270f1b6',NULL),
(1405,'Jako vodní korálek na lotosovém listu, jako voda na červené lilii, se nedrží, takže mudrc nelze dodržovat viděné, slyšené nebo snímané.',0,'As a water bead on a lotus leaf, as water on a red lily, does not adhere, so the sage does not adhere to the seen, the heard, or the sensed.','eng','The Buddha','83bccd36d6ea57b8de42f36887c359d2',NULL),
(1406,'Jeden není nazýván Noble, který poškozuje živé bytosti.',0,'One is not called noble who harms living beings. By not harming living beings one is called noble.','eng','The Buddha','858fded1f56b33eac034f5fb4fe029ce',NULL),
(1407,'Přestat dělat zlo, kultivovat dobro, očistit srdce: Toto je učení Buddhů.',0,'Ceasing to do evil, Cultivating the good, Purifying the heart: This is the teaching of the Buddhas.','eng','The Buddha','0a05e318c69e1a4cb4640317f09dde60',NULL),
(1408,'Pokud člověk koná dobro, nechť ho koná znovu a znovu. Ať v tom nalézá potěšení, neboť blažené je nashromaždění dobra.',1,'Should a person do good, let him do it again and again. Let him find pleasure therein, for blissful is the accumulation of good.','eng','The Buddha','af63e14209d5e15a4214d3c82bd52f42',NULL),
(1409,'„Jací jsem já, takoví jsou i oni. Stejně jako oni, i já.“ Nakreslením paralely k sobě nezabíjíš ani nepřiměješ ostatní, aby zabíjeli.',0,'\'As I am, so are these. As are these, so am I.\' Drawing the parallel to yourself, neither kill nor get others to kill.','eng','The Buddha','0afe8b7b2acd169ab05c2771652be505',NULL),
(1410,'Je-li muž sestupující do vzdouvající se rychle tekoucí řeky unesen proudem - jak může pomoci jiným přejít na druhou stranu? – Buddha',1,'If a man going down into a river, swollen and swiftly flowing, is carried away by the current — how can he help others across? – The Buddha','eng','The Buddha','f22a58f84972e5d696c0b459e97890bb',NULL),
(1411,'Ten, kdo dokáže zkrotit svůj hněv, jakmile vznikne, jako včasný protijed zastaví hadí jed, který se tak rychle šíří - takový mnich se vzdává tohoto světa i onoho, stejně jako had svléká svou opotřebenou kůži.',1,'He who can curb his wrath as soon as it arises, as a timely antidote will check snake\'s venom that so quickly spreads, — such a monk gives up the here and the beyond, just as a serpent sheds its worn-out skin.','eng','The Buddha','3ec1de45bb5520e24c65ab2ed4ab0ee4',NULL),
(1412,'Stejně jako pevná skála není bouří otřesena, tak ani moudří nejsou ovlivněni chválou nebo obviněním.',1,'Just as a solid rock is not shaken by the storm, even so the wise are not affected by praise or blame.','eng','The Buddha','aa4bf60a1acf9f0b5ee866ded45de09d',NULL),
(1413,'Mluvte pouze roztomilou řeč, řeč, která je vítána. Řeč, když nepřináší druhým zlo, je příjemná věc.',0,'Speak only endearing speech, speech that is welcomed. Speech, when it brings no evil to others, is a pleasant thing.','eng','The Buddha','15e97b0ec4d35b0f139992cc99c24246',NULL),
(1414,'Pokud s čistou myslí, že člověk mluví nebo jedná, následuje je štěstí jako nikdy nepracující stín.',0,'If with a pure mind a person speaks or acts, happiness follows them like a never-departing shadow.','eng','The Buddha','8fb35e1fb7722f399f19dfb5003b6172',NULL),
(1415,'Kdokoli se na někoho, kdo se rozzlobil, vyhrává bitvu těžce vyhrát.',0,'Whoever doesn\'t flare up at someone who\'s angry wins a battle hard to win.','eng','The Buddha','0fefd65fbb27a21ae5203aaf781aa26b',NULL),
(1416,'Podporovat matku a otce, vážit si partnera a dětí a zapojit se do mírového zaměstnání - je to největší požehnání.',1,'To support mother and father, to cherish partner and children, and to be engaged in peaceful occupation — this is the greatest blessing.','eng','The Buddha','f9cbc460aa850f2238ade6191cc88b9d',NULL),
(1417,'Dříve i nyní jen trpí jen popisem a zastavení utrpení.',0,'Both formerly and now, it is only suffering that I describe, and the cessation of suffering.','eng','The Buddha','143071cde6c2904c9aa4e7f385ba6440',NULL),
(1418,'Obviňují ty, kteří mlčí, obviňují ty, kteří hodně mluví, obviňují ty, kteří mluví s mírou.',0,'They blame those who remain silent, they blame those who speak much, they blame those who speak in moderation. There is none in the world who is not blamed.','eng','The Buddha','3ca0e47f209e3987ecff55c106c747aa',NULL),
(1419,'Rozhodně se trénujte, abyste dosáhli míru.',0,'Resolutely train yourself to attain peace.','eng','The Buddha','ac7a6c345cf343cce610f1044e3ffca7',NULL),
(1420,'Sami se musíte snažit. Buddhové jen ukazují cestu.',0,'You yourself must strive. The Buddhas only point the way.','eng','The Buddha','b4bb15ad54fac9471611175bd32d6d05',NULL),
(1421,'Je dobré být spokojen s tím, co člověk má.',1,'It\'s a good thing to be satisfied with what one has.','eng','The Buddha','8b38385a2168e2cb3e2d7a3b975da6d0',NULL),
(1422,'Neexistuje strach pro toho, jehož mysl není plná tužeb.',1,'There is no fear for one whose mind is not filled with desires.','eng','The Buddha','0ef9e9e53126413dac73c1aab2f56dbf',NULL),
(1423,'Ušlechtilý člověk vytváří hojnost zásluh tím, že má soucitnou mysl vůči všem živým bytostem.',0,'A noble one produces an abundance of merit by having a compassionate mind towards all living beings.','eng','The Buddha','6f61466226e75906ec64d439ea7938bf',NULL),
(1424,'Ti, kteří se drží vnímání a názory, putují po světě urážející lidi.',0,'Those who cling to perceptions and views wander the world offending people.','eng','The Buddha','b162443200f34ed35bcb3f0f8f470e52',NULL),
(1425,'Poznej z řek v rozsedlinách a štěrbinách: ty v malých korytech hlučně proudí, velké proudí tiše. Co není plné, dělá hluk. Co je plné, je tiché.',1,'Know from the rivers in clefts and in crevices: those in small channels flow noisily, the great flow silent. Whatever\'s not full makes noise. Whatever is full is quiet.','eng','The Buddha','150a6bbf59bdb5063cbfa8ada8d1b086',NULL),
(1426,'Kéž mají všechny bytosti šťastné mysli.',1,'May all beings have happy minds.','eng','The Buddha','edc78243685792900810f9ad976f7881',NULL),
(1427,'Čistota a nečistota závisí na sobě samém; nikdo nemůže očistit jiného.',1,'Purity and impurity depend on oneself; no one can purify another.','eng','The Buddha','ff14eece3404b74c49e7d10eb5a05460',NULL),
(1428,'Když sledujete po sobě, sledujete ostatní. Když sledujete po ostatních, sledujete po sobě.',0,'When watching after yourself, you watch after others. When watching after others, you watch after yourself.','deu','The Buddha','12c583195bf286873778c1e58937d592',NULL),
(1429,'Lepší je, že je jednoho dne žít vzestup a pád věcí, než žít sto let, aniž byste viděli vzestup a pád věcí.',0,'Better it is to live one day seeing the rise and fall of things than to live a hundred years without ever seeing the rise and fall of things.','eng','The Buddha','7262f771d86cfb735b50222e4463bc84',NULL),
(1430,'Vyzařujte neomezenou lásku k celému světu - výše, dole a napříč - neomezenými, bez špatné vůle, bez nepřátelství.',0,'Radiate boundless love towards the entire world — above, below, and across — unhindered, without ill will, without enmity.','eng','The Buddha','844b78084045ce0bea75d161077094d1',NULL),
(1431,'Pokud by někdo konal dobro, ať to dělá znovu a znovu. Měl by si tento zvyk rozvinout, protože hromadění dobra přináší radost.',0,'Should someone do good, let them do it again and again. They should develop this habit, for the accumulation of goodness brings joy.','eng','The Buddha','6730d797653600dc04fade78f84dc414',NULL),
(1432,'Cokoli má povahu vznikajícího, má povahu ukončení.',0,'Whatever has the nature of arising has the nature of ceasing.','eng','The Buddha','96a948c398513b2961c37f1b6291e9cb',NULL),
(1433,'Lepší než tisíc zbytečných slov je jedno užitečné slovo, když slyší, kterého z nich dosáhne míru.',0,'Better than a thousand useless words is one useful word, upon hearing which one attains peace.','eng','The Buddha','7c4be1c0425c7d15e14f9decebbb7922',NULL),
(1434,'Kořenem utrpení je připoutanost.',0,'The root of suffering is attachment.','eng','The Buddha','211955eb12c7463d69e6fc3947a1b5b3',NULL),
(1435,'Disciplinovaná mysl přináší štěstí.',1,'A disciplined mind brings happiness.','ita','The Buddha','7d5d06ea563f49cedbc6604df930be34',NULL),
(1436,'Dnes je to dělat, co je třeba udělat.',0,'Ardently do today what must be done. Who knows? Tomorrow, death comes.','eng','The Buddha','47a0b791022701271f77dbdff793adce',NULL),
(1437,'Svět je sužován smrtí a úpadkem. Moudří však netruchlí, když si uvědomili povahu světa.',0,'The world is afflicted by death and decay. But the wise do not grieve, having realized the nature of the world.','eng','The Buddha','0d507fbc0c870dbe3d445f738b4c7de6',NULL),
(1438,'Zvítězte nad hněvem pomocí ne-hněvu. Dobrotu přemáhejte špatností. Porazte podlost velkorysostí. Porazte nepoctivost pravdou.',0,'Conquer anger with non-anger. Conquer badness with goodness. Conquer meanness with generosity. Conquer dishonesty with truth.','eng','The Buddha','48a41bb942e37c177b32b1a9e9511086',NULL),
(1439,'Dej, i když máš jen trochu.',1,'Give, even if you only have a little.','eng','The Buddha','315d4033cf22286f46bc4d87f48bec8c',NULL),
(1440,'Pitching je umění vštípení strachu.',0,'Pitching is the art of instilling fear.','eng','Sandy Koufax','157af35a64e1d546decd8622fcb2dde4',NULL),
(1441,'Polovina lží, které o mně říkají, nejsou pravdivá.',0,'Half the lies they tell about me aren\'t true.','eng','Yogi Berra','ca60265fd5d595b7b9f3dfba6844a42c',NULL),
(1442,'Pokud muž sleduje tři fotbalové hry v řadě, měl by být prohlášen za legálně mrtvý.',0,'If a man watches three football games in a row, he should be declared legally dead.','fra','Erma Bombeck','5e96ed67f5f817738712ca30606a31e0',NULL),
(1443,'Nemůžete nic omezovat. Čím více sníte, tím dále se dostanete.',0,'You can\'t put a limit on anything. The more you dream, the farther you get.','eng','Michael Phelps','41e8289b67fbcee3c4dcbfa4bee0e116',NULL),
(1444,'Jen buďte trpěliví. Nechte hru přijít k vám. Nespěchejte. Buďte rychlí, cíl nespěchejte.',0,'Just be patient. Let the game come to you. Don\'t rush. Be quick, but don\'t hurry.','fra','Earl Monroe','cb877534bd7a6c3c593a5834146c7a49',NULL),
(1445,'Úspěch je místem, kde se setkává příprava a příležitost.',0,'Success is where preparation and opportunity meet.','eng','Bobby Unser','d3c66474a7fa31675029cf8119d82120',NULL),
(1446,'Nikdy si nestěžujte a nikdy nevysvětlujte.',0,'Never complain and never explain.','eng','Benjamin Disraeli','bd06276cb8e3a99bef6018ebc5d62a83',NULL),
(1447,'Víte, jaká je moje oblíbená část hry?',0,'Do you know what my favorite part of the game is? The opportunity to play.','eng','Mike Singletary (basketball)','b296817bd9688c76efa6b99a2ffc86a4',NULL),
(1448,'Bůh mě rychle udělal. A když běžím, cítím jeho potěšení.',0,'God made me fast. And when I run, I feel His pleasure.','fra','Eric Liddell','02cf5cd7cb7b52dc7e42a36e981677c3',NULL),
(1449,'Nápady zmáčknou spoušť, ale instinkt nabije zbraň.',1,'Ideas pull the trigger, but instinct loads the gun.','eng','Don Marquis','0375be1f72f00c1899b47e4ae44dc9cb',NULL),
(1450,'Strávíte dobrý kus svého života svíráním baseballového míčku a nakonec se ukáže, že to bylo naopak po celou dobu.',1,'You spend a good piece of your life gripping a baseball and in the end it turns out that it was the other way around all the time.','eng','Jim Bouton','f972e113b11f43e6653868797d769d23',NULL),
(1451,'Způsob, jakým tým hraje jako celek, určuje jeho úspěch. Můžete mít největší skupinu jednotlivých hvězd na světě, ale pokud nebudou hrát společně, klub nebude stát za desetník.',0,'The way a team plays as a whole determines its success. You may have the greatest bunch of individual stars in the world, but if they don\'t play together, the club won\'t be worth a dime.','eng','Babe Ruth','6ad3f7290aa6fab8579759ad34d793ee',NULL),
(1452,'Najít dobré hráče je snadné. Nechat je hrát jako tým je jiný příběh.',0,'Finding good players is easy. Getting them to play as a team is another story.','eng','Casey Stengel','b2dce0562ad3cf9376c53527e7dd813e',NULL),
(1453,'Šampioni neustále pokračují, dokud to nedokážou správně.',1,'Champions keep playing until they get it right.','eng','Billie Jean King','c8a2db644d30e465db65a7e8efd3b0f7',NULL),
(1454,'Pokud se snažíte vytvořit společnost, je to jako pečení dortu. Musíte mít všechny ingredience ve správném poměru.',1,'If you\'re trying to create a company, it\'s like baking a cake. You have to have all the ingredients in the right proportion.','eng','Elon Musk','a021d163572805ae8140d108fde08b1e',NULL),
(1455,'Chcete-li poznat skutečnou povahu člověka, zahrajte si s ním golf.',1,'To find a man\'s true character, play golf with him.','eng','P. G. Wodehouse','7dd50eb4a48ea1d97496a5ef32550a10',NULL),
(1456,'Nevěřím, že musíte být lepší než všichni ostatní. Věřím, že musíte být lepší, než jste si kdy mysleli, že můžete být.',1,'I don\'t believe you have to be better than everybody else. I believe you have to be better than you ever thought you could be.','eng','Ken Venturi','f82b02334d8f4b4a4fb438c67b252b67',NULL),
(1457,'Už mě nebaví poslouchat o penězích, penězích, penězích, penězích, penězích. Chci jen hrát hru, pít Pepsi a nosit Reebok.',0,'I\'m tired of hearing about money, money, money, money, money. I just want to play the game, drink Pepsi, and wear Reebok.','eng','Shaquille O\'Neal','b63d00bc2b6c292bc21abcb0f30b15b3',NULL),
(1458,'To, co dnes děláte, může zlepšit všechny vaše zítřky.',0,'What you do today can improve all your tomorrows.','eng','Ralph Marston','c6605d03a807f60dc170abbb4d81c580',NULL),
(1459,'Nebojte se, že vám lidé ukradnou vaše nápady. Pokud jsou vaše nápady dobré, budete je muset lidem vrazit do krku.',0,'Don\'t worry about people stealing your ideas. If your ideas are any good, you\'ll have to ram them down people\'s throats.','eng','Howard H. Aiken','bd7e8700b5f4dd69c71bacc029c2bf53',NULL),
(1460,'Golf je hra, ve které se člověk snaží ovládat míč s nářadí špatně přizpůsobené pro tento účel.',0,'Golf is a game in which one endeavors to control a ball with implements ill adapted for the purpose.','eng','Woodrow Wilson','7fc07d72e84395890e96f7e5dad696ff',NULL),
(1461,'Stavím oheň a každý den trénuji, přidávám další palivo.',0,'I am building a fire, and everyday I train, I add more fuel. At just the right moment, I light the match.','eng','Mia Hamm','1c0c9ab8ac665c8412aa74e2257e29f1',NULL),
(1462,'Značka pro firmu je jako pověst pro člověka. Pověst si získáváte tím, že se snažíte dělat těžké věci dobře.',0,'A brand for a company is like a reputation for a person. You earn reputation by trying to do hard things well.','eng','Jeff Bezos','094d0d82ccab37772568bb9c7cee3603',NULL),
(1463,'Baseball je jediný sport, kde může člověk uspět třikrát z deseti pokusů a být považován za dobrého hráče.',1,'Baseball is the only field of endeavor where a man can succeed three times out of ten and be considered a good performer.','eng','Ted Williams','5ee1c3e585753dfc52fba252e6ceb4b6',NULL),
(1464,'Nikdy se nevzdávejte, protože to je jen místo a čas, kdy se příliv obrátí.',0,'Never give up, for that is just the place and time that the tide will turn.','eng','Harriet Beecher Stowe','c01f8d8cd9bd88e109913950a3a193c2',NULL),
(1465,'Vědět nestačí; musíme to použít. Chtít nestačí; musíme jednat.',1,'Knowing is not enough; we must apply. Willing is not enough; we must do.','eng','Johann Wolfgang von Goethe','931a90dc657e4c876407fa200047f6e4',NULL),
(1466,'Schopnost organizace učit se a rychle převést toto učení do akce je největší konkurenční výhoda.',1,'An organization\'s ability to learn, and translate that learning into action rapidly, is the ultimate competitive advantage.','eng','Jack Welch','7240edb66a5d8e5132611a53c5c8abc1',NULL),
(1467,'Důvěra je mazání, které organizace umožňuje pracovat.',0,'Trust is the lubrication that makes it possible for organizations to work.','eng','Warren Bennis','b153bc74b69e798f3f0ce4ae43ac9bf6',NULL),
(1468,'Ekonom je odborník, který zítra bude vědět, proč se věci, které včera předpovídal, dnes nestaly.',1,'An economist is an expert who will know tomorrow why the things he predicted yesterday didn\'t happen today.','eng','Laurence J. Peter','5054ce99e38d7b6b5145c9ee038efaee',NULL),
(1469,'Neexistují žádná tajemství úspěchu. Je výsledkem přípravy, tvrdé práce a poučení se z neúspěchu.',0,'There are no secrets to success. It is the result of preparation, hard work, and learning from failure.','eng','Colin Powell','9ad815273591ee1dcd53e31eaab98128',NULL),
(1470,'Když jsou časy špatné, když se objeví skuteční podnikatelé.',0,'When times are bad is when the real entrepreneurs emerge.','eng','Robert Kiyosaki','aea1c51fe9992bfc17f072136f885e3f',NULL),
(1471,'Miř na Měsíc. Pokud minete, můžete trefit hvězdu.',0,'Aim for the moon. If you miss, you may hit a star.','eng','W. Clement Stone','06f2c8c872ad1d8371f93885483259f8',NULL),
(1472,'To, co ostatní lidé mohou najít v poezii nebo uměleckých muzeích, já nalézám při sledování míčku po dobrém úderu.',1,'What other people may find in poetry or art museums, I find in the flight of a good drive.','eng','Arnold Palmer','2f089373e7283e564b03dd58ee243db9',NULL),
(1473,'Šéf je jen jeden: zákazník! A ten může vyhodit kohokoli ve firmě, od předsedy představenstva až po posledního zaměstnance, jednoduše tím, že utratí své peníze někde jinde.',1,'There is only one boss. The customer. And he can fire everybody in the company from the chairman on down, simply by spending his money somewhere else.','eng','Sam Walton','cd01fddf76e971866a4bfebc7326ae14',NULL),
(1474,'V obchodním světě jsou všichni placeni ve dvou mincích: hotovost a zkušenosti. Vezmi si nejdříve zkušenosti; hotovost přijde později.',1,'In the business world, everyone is paid in two coins: cash and experience. Take the experience first; the cash will come later.','eng','Harold Geneen','25fbbd6dd3d850cc003899212def2348',NULL),
(1475,'Čím méně pravidel má trenér, tím méně pravidel je, aby se hráči zlomili.',0,'The fewer rules a coach has, the fewer rules there are for players to break.','eng','John Madden','d0e06bc826619b57e3eafaca953305b2',NULL),
(1476,'Každý den je nová příležitost. Můžete stavět na včerejším úspěchu nebo nechat jeho neúspěchy za sebou a začít znovu. Takový je život, s novou hrou každý den, a takový je baseball.',0,'Every day is a new opportunity. You can build on yesterday\'s success or put its failures behind and start over again. That\'s the way life is, with a new game every day, and that\'s the way baseball is.','eng','Bob Feller','c5194b733f672d90b50c5a2462e87e27',NULL),
(1477,'Když mi bylo 40, můj lékař mi poradil, že muž ve svých 40 letech by neměl hrát tenis.',0,'When I was 40, my doctor advised me that a man in his 40s shouldn\'t play tennis. I heeded his advice carefully and could hardly wait until I reached 50 to start again.','eng','Hugo Black','2ac9e582abe8222f4d69b28660e368d8',NULL),
(1478,'Podnikání, které nevydělává nic jiného než peníze, je špatný obchod.',0,'A business that makes nothing but money is a poor business.','eng','Henry Ford','7db686e324c6178033ca34a073e9aa52',NULL),
(1479,'Snažit se proklouznout rychlý míč kolem Hanka Aarona je jako pokusit se proklouznout východ slunce kolem kohouta.',1,'Trying to sneak a fastball past Hank Aaron is like trying to sneak the sunrise past a rooster.','eng','Joe Adcock','23b7f0608249cc81cc2a9ae34dcc8c8e',NULL),
(1480,'Organizace, bez ohledu na to, jak dobře navržená, je jen tak dobrá jako lidé, kteří v ní žijí a pracují.',0,'An organization, no matter how well designed, is only as good as the people who live and work in it.','eng','Dee Hock','9e0593d182376ae766c5be0ee3adc98b',NULL),
(1481,'Zlaté medaile nejsou ve skutečnosti vyrobeny ze zlata. Jsou vyrobeny z potu, odhodlání a těžko dostupné slitiny zvané střeva.',0,'Gold medals aren\'t really made of gold. They\'re made of sweat, determination, and a hard-to-find alloy called guts.','eng','Dan Gable','e678db434586a64e6c4f5108a2e55d58',NULL),
(1482,'Tenis je dokonalá kombinace bouřlivého dění, které se odehrává v atmosféře úplného klidu.',1,'Tennis is a perfect combination of violent action taking place in an atmosphere of total tranquillity.','eng','Billie Jean King','84254a636b749f4424afffdef04e99ac',NULL),
(1483,'Je to jen práce. Tráva roste, ptáci létají, vlny buší do písku. Mlátím lidi.',0,'It\'s just a job. Grass grows, birds fly, waves pound the sand. I beat people up.','eng','Muhammad Ali','5321222f21d7ec63cc0a75bd5d3e70e9',NULL),
(1484,'Vítězové nikdy neopustili a quitters nikdy nevyhrají.',0,'Winners never quit and quitters never win.','deu','Vince Lombardi','8b83af29c013f5e6f77725f4ac58b613',NULL),
(1485,'Seriózní sport nemá s fair play nic společného. Je spjat s nenávistí, žárlivostí, vychloubačností, nerespektováním všech pravidel a sadistickým potěšením být svědkem násilí. Jinými slovy, je to válka bez střelby.',1,'Serious sport has nothing to do with fair play. It is bound up with hatred, jealousy, boastfulness, disregard of all rules and sadistic pleasure in witnessing violence. In other words, it is war minus the shooting.','eng','George Orwell','fbf95740f3c1a8d56260bc8a1ef4a9ad',NULL),
(1486,'Štěstí nepochází ze snadné práce, ale z dosvitu spokojenosti, který přichází po dosažení obtížného úkolu, jenž vyžadoval to nejlepší z nás.',1,'Happiness does not come from doing easy work but from the afterglow of satisfaction that comes after the achievement of a difficult task that demanded our best.','eng','Theodore Isaac Rubin','a2cfbdb157a43f4e7cf76eaf98e089f5',NULL),
(1487,'Věci se samy nestávají. Věci se musí udělat tak, aby se staly.',1,'Things do not happen. Things are made to happen.','eng','John F. Kennedy','0b6dce92a378bfa88807d3cfc14a2322',NULL),
(1488,'Abychom uspěli, musíme nejprve uvěřit, že to můžeme.',0,'In order to succeed, we must first believe that we can.','eng','Nikos Kazantzakis','fc1f63b0ffffffa163fcd1b1295cd9f0',NULL),
(1489,'Někteří lidé se narodili na třetí metě a procházejí životem v domnění, že odpálili trojitý úder.',1,'Some people are born on third base and go through life thinking they hit a triple.','eng','Barry Switzer','06a9fcdacdf16b5e1a2f717f381d169d',NULL),
(1490,'Pro mě nezáleží na tom, jak dobrý jsi. Sport je o hraní a soutěžení. Ať už děláš v kriketu nebo ve sportu cokoli, užívej si to, buď pozitivní a snaž se vyhrát.',1,'To me, it doesn\'t matter how good you are. Sport is all about playing and competing. Whatever you do in cricket and in sport, enjoy it, be positive and try to win.','eng','Ian Botham','c18cfb00610900e8b410a5bd664f1adc',NULL),
(1491,'Dobrý plán provedený razantně nyní je lepší než dokonalý plán provedený příští týden.',1,'A good plan violently executed now is better than a perfect plan executed next week.','eng','George S. Patton','71793848772d1380e12c1c56f8bd2cb5',NULL),
(1492,'Pokud člověk neví, na který přístav jeden plaví, žádný vítr není příznivý.',0,'If one does not know to which port one is sailing, no wind is favorable.','eng','Seneca the Younger','5117ccd6a18bb3a1952230939cbee1b2',NULL),
(1493,'Podnikatel vždy hledá změnu, reaguje na ni a využívá ji jako příležitost.',0,'The entrepreneur always searches for change, responds to it, and exploits it as an opportunity.','eng','Peter Drucker','6b3db8d3632f2103740ea40afd113a8b',NULL),
(1494,'Každý má neviditelné znamení visící z krku a říká: „Nechte mě cítit se důležití.“',0,'Everyone has an invisible sign hanging from their neck saying, \'Make me feel important.\' Never forget this message when working with people.','eng','Mary Kay Ash','3d51d2f4f170b57df261dc03c42260af',NULL),
(1495,'Žádný podnik nemá větší šanci na úspěch než ten, který je skryt před nepřítelem, dokud není zralý k provedení.',1,'No enterprise is more likely to succeed than one concealed from the enemy until it is ripe for execution.','eng','Niccolò Machiavelli','cf8ef2b67ddb43d3fa2746c2366e0e6e',NULL),
(1496,'Nemůžete vyhrát, pokud se nenaučíte, jak ztratit.',0,'You can\'t win unless you learn how to lose.','eng','Kareem Abdul-Jabbar','7c4db86c110da4f16e96ddaf012dadd6',NULL),
(1497,'Naše práce je prezentace našich schopností.',0,'Our work is the presentation of our capabilities.','eng','Edward Gibbon','8151da54fb75c2111f7097f068da64ba',NULL),
(1498,'Fanoušci nemají boo nobodies.',0,'Fans don\'t boo nobodies.','eng','Reggie Jackson (basketball, born 1990)','e481cc10d6d3581d92db783c496a1d98',NULL),
(1499,'Kdykoli se ocitnete na straně většiny, je čas pozastavit se a přemýšlet.',0,'Whenever you find yourself on the side of the majority, it is time to pause and reflect.','eng','Mark Twain','0a7761ed4a80b1d486423a5949768c14',NULL),
(1500,'Vydělávat prachy je snadné. Je mnohem těžší něco změnit.',0,'It\'s easy to make a buck. It\'s a lot tougher to make a difference.','eng','Tom Brokaw','da69ef759fae6c0c4b58402b54de62a5',NULL),
(1501,'Nehrajete proti soupeřům, hrajete proti hře basketbalu.',0,'You don\'t play against opponents, you play against the game of basketball.','eng','Bob Knight','0c81678aa3c7ba6b8029d6625713ebf0',NULL),
(1502,'Fotbal je fotbal a talent je talent. Rozdíl je ale v myšlení vašeho týmu.',0,'Football is football and talent is talent. But the mindset of your team makes all the difference.','eng','Robert Griffin III','f24e609d75a8d12ad86aa37cedda47b5',NULL),
(1503,'Nedívejte se na hodiny; dělejte to, co dělají. Pokračujte.',1,'Don\'t watch the clock; do what it does. Keep going.','eng','Sam Levenson','64854d3b08bdb4e6a570d681ad5b1eba',NULL),
(1504,'Mnoho mužů chodí po celý svůj život, aniž by věděli, že to není ryba, po které jsou.',0,'Many men go fishing all of their lives without knowing that it is not fish they are after.','eng','Henry David Thoreau','fe4bbdb02cae2a3288ea840cf005aabb',NULL),
(1505,'Prvotřídní lidé najímají prvotřídní lidi; druhořadí lidé najímají lidi třetí třídy.',0,'First-rate people hire first-rate people; second-rate people hire third-rate people.','eng','Leo Rosten','0bf0f9046fd0e3f5d89a74dd4af15edc',NULL),
(1506,'Kde je vůle, tam je cesta. Pokud existuje šance z milionu, že můžete něco udělat, cokoliv, abyste zabránili tomu, aby to, co chcete, skončilo, udělejte to. Vyperte dveře otevřené, nebo v případě potřeby zasuňte nohu do těch dveří a nechte je otevřené.',1,'Where there is a will, there is a way. If there is a chance in a million that you can do something, anything, to keep what you want from ending, do it. Pry the door open or, if need be, wedge your foot in that door and keep it open.','eng','Pauline Kael','dc0f486f709a2c1d6c3b297f01d71bc2',NULL),
(1507,'Problémy nejsou značky STOP, jsou to návody.',1,'Problems are not stop signs, they are guidelines.','eng','Robert Schuller','280478f5d826f1557ed61f31277218b8',NULL),
(1508,'Příležitost neklepte, představuje se, když porazíte dveře.',0,'Opportunity does not knock, it presents itself when you beat down the door.','eng','Kyle Chandler','c9003b08313fac27f82a25527fc37741',NULL),
(1509,'Vláda lidí, lidmi, pro lidi, nezahyne ze Země.',0,'Government of the people, by the people, for the people, shall not perish from the Earth.','eng','Abraham Lincoln','f2e8c4fa64733a2b728b2e7dda5ded92',NULL),
(1510,'Kolik nohou má pes, když nazvete jeho ocas nohou? Čtyři. Tvrzení, že ocas je noha, neznamená, že je to noha.',0,'How many legs does a dog have if you call his tail a leg? Four. Saying that a tail is a leg doesn\'t make it a leg.','eng','Abraham Lincoln','1b877425e957797b932c4b0d626ad5de',NULL),
(1511,'Filozofií školní místnosti v jedné generaci bude v příštím filozofii vlády.',0,'The philosophy of the school room in one generation will be the philosophy of government in the next.','eng','Abraham Lincoln','87e38e57e9819048e2cea792c8004991',NULL),
(1512,'Nejsem povinen vyhrát, ale jsem povinen být pravdivý. Nejsem povinen uspět, ale jsem povinen žít podle světla, které mám. Musím stát s každým, kdo má pravdu, stát s ním, dokud má pravdu, a opustit ho, když začne chybovat.',1,'I am not bound to win, but I am bound to be true. I am not bound to succeed, but I am bound to live by the light that I have. I must stand with anybody that stands right, and stand with him while he is right, and part with him when he goes wrong.','eng','Abraham Lincoln','751131faf842df5c64bec5d7529f03f8',NULL),
(1513,'Všechny velké věci jsou jednoduché a mnoho z nich lze vyjádřit jediným slovem: svoboda, spravedlnost, čest, povinnost, milosrdenství, naděje.',1,'All the great things are simple, and many can be expressed in a single word: freedom, justice, honor, duty, mercy, hope.','eng','Winston Churchill','621fa279b8d135bd4753a4f81cba8db0',NULL),
(1514,'Můžete oklamat všechny lidi někdy, a některé lidi pořád, ale nemůžete oklamat všechny lidi pořád.',1,'You can fool all the people some of the time, and some of the people all the time, but you cannot fool all the people all the time.','eng','Abraham Lincoln','6846896ccc111c59d1963b3462bdae7a',NULL),
(1515,'My lidé jsme oprávnění mistry Kongresu i soudů, ne svržením ústavy, ale svržením mužů, kteří zvrátí ústavu.',0,'We the people are the rightful masters of both Congress and the courts, not to overthrow the Constitution but to overthrow the men who pervert the Constitution.','eng','Abraham Lincoln','abbf38cd80aea74b1f36f83d0d5a81ab',NULL),
(1516,'Pevně věřím v lidi. Je-li jim dána pravda, mohou se spolehnout na to, že se vypořádají s jakoukoli národní krizí. Důležité je přinést jim skutečná fakta.',0,'I am a firm believer in the people. If given the truth, they can be depended upon to meet any national crisis. The great point is to bring them the real facts.','eng','Abraham Lincoln','94e54add0ba03761c918ed70de780c74',NULL),
(1517,'Technologie je destruktivní pouze v rukou lidí, kteří si neuvědomují, že jsou jedním a stejným procesem jako vesmír.',0,'Technology is destructive only in the hands of people who do not realize that they are one and the same process as the universe.','eng','Alan Watts','522c663f2d1b592ccc4fd8a4d4dc82f8',NULL),
(1518,'Jsem optimista. Nevypadá to, že by mělo smysl být něčím jiným.',1,'I am an optimist. It does not seem too much use being anything else.','deu','Winston Churchill','d3fc837880ddc222ac6da4e4d4cb7fb3',NULL),
(1519,'Pane, mou starostí není, zda je Bůh na naší straně; mou největší starostí je být na Boží straně, protože Bůh má vždy pravdu.',1,'Sir, my concern is not whether God is on our side; my greatest concern is to be on God\'s side, for God is always right.','eng','Abraham Lincoln','51fe69c7c29937ef31f1692049ebad56',NULL),
(1520,'Věci jsou tak, jak jsou. Když se v noci díváme do vesmíru, neporovnáváme správné a špatné hvězdy, ani dobře a špatně uspořádaná souhvězdí.',0,'Things are as they are. Looking out into it the universe at night, we make no comparisons between right and wrong stars, nor between well and badly arranged constellations.','eng','Alan Watts','b3cad5e2fc9a1e6a9961fef8965f547e',NULL),
(1521,'Nic v životě není tak vzrušující, že je zastřelen bez výsledku.',0,'Nothing in life is so exhilarating as to be shot at without result.','eng','Winston Churchill','314e04ed1401c97f5d49282209e752c6',NULL),
(1522,'Všechno, čím jsem, nebo doufám, že budu, dlužím své andělské matce.',0,'All that I am, or hope to be, I owe to my angel mother.','eng','Abraham Lincoln','a55258dbd97a3c27d09d65fa2fad0122',NULL),
(1523,'Mít víru znamená svěřit se vodě. Když plavete, nechytáte se vody, protože pokud to uděláte, potopíte se a utopíte. Místo toho se uvolníte a vznášíte.',1,'To have faith is to trust yourself to the water. When you swim you don\'t grab hold of the water, because if you do you will sink and drown. Instead you relax, and float.','eng','Alan Watts','4fb8b623b7c16ca5d61f2cc5df4bce2e',NULL),
(1524,'Žádná práce ani láska nebude vzkvétat z viny, strachu nebo prázdnoty srdce, stejně jako žádné platné plány do budoucnosti nemohou vytvořit ti, kdo nemají schopnost žít v přítomnosti.',1,'No work or love will flourish out of guilt, fear, or hollowness of heart, just as no valid plans for the future can be made by those who have no capacity for living now.','eng','Alan Watts','a13b5fa95011a3e4019a8e51a800fa74',NULL),
(1525,'Dlužím své samotě ostatním lidem.',0,'I owe my solitude to other people.','eng','Alan Watts','3e1a1f5c6a9ed8bb4dd8f4f032865b39',NULL),
(1526,'Jsme pány neřečených slov, ale otroky těch, které jsme nechali vyklouznout.',1,'We are masters of the unsaid words, but slaves of those we let slip out.','eng','Winston Churchill','ca2259ec7229962a72df8bab7404e755',NULL),
(1527,'Nikdy předstírejte lásku, kterou ve skutečnosti necítíte, protože láska není naše velení.',0,'Never pretend to a love which you do not actually feel, for love is not ours to command.','eng','Alan Watts','5b87df20c1ed7d58733faa642ba02ce9',NULL),
(1528,'Snažit se definovat sebe sama je jako pokusit se kousnout své vlastní zuby.',1,'Trying to define yourself is like trying to bite your own teeth.','eng','Alan Watts','0c7adabb60059d12d29c6ecdfac43c40',NULL),
(1529,'Odvaha je právem pokládána za první z lidských vlastností... protože je to vlastnost, která zaručuje všechny ostatní.',1,'Courage is rightly esteemed the first of human qualities... because it is the quality which guarantees all others.','eng','Winston Churchill','0cfe78b03739945fde354eeffc00d5b6',NULL),
(1530,'Mám rád prasata. Psi k nám vzhlížejí. Kočky se na nás dívají shora. Prasata s námi jednají jako s rovnými.',1,'I am fond of pigs. Dogs look up to us. Cats look down on us. Pigs treat us as equals.','eng','Winston Churchill','619c9347ae0bd3a55bc927c212ce4b31',NULL),
(1531,'Nedíváte se tam pro Boha, něco na obloze, díváte se do vás.',0,'You don\'t look out there for God, something in the sky, you look in you.','eng','Alan Watts','3266c035b23fdcb3d19c343470b05b80',NULL),
(1532,'Vždy se můžete spolehnout na to, že Američané udělají správnou věc - poté, co vyzkoušeli všechno ostatní.',0,'You can always count on Americans to do the right thing - after they\'ve tried everything else.','eng','Winston Churchill','05e0c5e7ce39c1fa5b349fd82a3b62a4',NULL),
(1533,'Bylo to moje zkušenost, že lidé, kteří nemají žádné neřestí, mají jen velmi málo ctností.',0,'It has been my experience that folks who have no vices have very few virtues.','eng','Abraham Lincoln','f505274e90f653d308cf48e2aac7de2f',NULL),
(1534,'Ego není nic jiného než zaměření vědomé pozornosti.',1,'The ego is nothing other than the focus of conscious attention.','eng','Alan Watts','eaa79778fd10d826f2f80012d82f4931',NULL),
(1535,'Nemůžete uniknout zodpovědnosti zítřka tím, že se jí dnes vyhnete.',0,'You cannot escape the responsibility of tomorrow by evading it today.','eng','Abraham Lincoln','108c90b3164e70e891829b123b34d844',NULL),
(1536,'Za války je pravda tak vzácná, že by se jí měla vždy účastnit bodyguarda lží.',0,'In wartime, truth is so precious that she should always be attended by a bodyguard of lies.','eng','Winston Churchill','4268eb7d4fdc35790003cc3197defb98','2025-09-06 19:19:33'),
(1537,'Jste ta obrovská věc, kterou vidíte daleko, daleko s velkými dalekohledy.',0,'You are that vast thing that you see far, far off with great telescopes.','eng','Alan Watts','30b8ccb213c5733952e9e28471eb2a74',NULL),
(1538,'Zlepšovat se znamená měnit se; být dokonalý znamená měnit se často.',0,'To improve is to change; to be perfect is to change often.','eng','Winston Churchill','6d4460a170ceb897a013be021a894d02',NULL),
(1539,'Kdybych byl dvoutvarý, nosil bych tuhle tvář?',1,'If I were two-faced, would I be wearing this one?','eng','Abraham Lincoln','6ecc96ffe6e3dbb91b3d1ac7d6aad991',NULL),
(1540,'Žádný člověk nemá dostatečně dobrou paměť, aby byl úspěšným lhářem.',1,'No man has a good enough memory to be a successful liar.','eng','Abraham Lincoln','cf5d068dae7f8ca9cc0c0389b39026c9',NULL),
(1541,'Postoj je malá věc, která dělá velký rozdíl.',1,'Attitude is a little thing that makes a big difference.','eng','Winston Churchill','8f61ab9ebf10b102ddbe5d009139e80f',NULL),
(1542,'Jsem vždy připraven se učit, i když se mi nelíbí.',0,'I am always ready to learn although I do not always like being taught.','eng','Winston Churchill','673e9105b9de694bac78c541e68c24ba',NULL),
(1543,'Vždy jsem zjistil, že Mercy nese bohatší ovoce než přísná spravedlnost.',0,'I have always found that mercy bears richer fruits than strict justice.','eng','Abraham Lincoln','22d1f14646c61f15effcd8ede952c35e',NULL),
(1544,'Tím to ale nekončí. Není to ani začátek konce. Ale možná je to konec začátku.',0,'Now this is not the end. It is not even the beginning of the end. But it is, perhaps, the end of the beginning.','eng','Winston Churchill','179619b2d42f528dac26c06a6efad5a3',NULL),
(1545,'Úspěch spočívá v přechodu ze selhání k selhání bez ztráty nadšení.',1,'Success consists of going from failure to failure without loss of enthusiasm.','eng','Winston Churchill','3819b9c675989dea6f69f5e996bc7b69',NULL),
(1546,'Rusko je hádanka zabalená v tajemství uvnitř záhady.',1,'Russia is a riddle wrapped in a mystery inside an enigma.','eng','Winston Churchill','8774d519a8df239975d68924fdc4d9de',NULL),
(1547,'Lež se dostane na půli cesty po celém světě, než má pravda šanci dostat si své kalhoty.',0,'A lie gets halfway around the world before the truth has a chance to get its pants on.','eng','Winston Churchill','7a2fa7f410cb23207263738ae6f0f27f',NULL),
(1548,'Vztah sebe sama k druhému je tedy úplné uvědomění si toho, že milovat sebe sama je nemožné, aniž bychom milovali všechno, co je definováno jako jiné než my sami.',1,'So then, the relationship of self to other is the complete realization that loving yourself is impossible without loving everything defined as other than yourself.','eng','Alan Watts','0c08f422309e12e73738a5f99b098dab',NULL),
(1549,'Postoj víry je však pustit se a otevřít se pravdě, ať už se ukáže jako cokoliv.',1,'But the attitude of faith is to let go, and become open to truth, whatever it might turn out to be.','eng','Alan Watts','29ca3a6b21b2e657e2297139872b3f70',NULL),
(1550,'Nemůžeme být citlivější na potěšení, aniž bychom byli citlivější na bolest.',0,'We cannot be more sensitive to pleasure without being more sensitive to pain.','eng','Alan Watts','4d330e1e4d869388aebc473ab841731a',NULL),
(1551,'Nemá smysl říkat: „Děláme, co je v našich silách.„ Musíš uspět v tom, co je nezbytné.',0,'It is no use saying, \'We are doing our best.\' You have got to succeed in doing what is necessary.','eng','Winston Churchill','f3488963f56a022eab383fb120edc73a',NULL),
(1552,'Pravda je nezvratná. Zlovůle na něj může zaútočit, nevědomost se mu může vysmívat, ale nakonec to tak je.',0,'The truth is incontrovertible. Malice may attack it, ignorance may deride it, but in the end, there it is.','eng','Winston Churchill','83bbe685ae59da2900ec4f13ece9f60b',NULL),
(1553,'Většina lidí je stejně šťastná, jak si vymýšlejí.',0,'Most folks are as happy as they make up their minds to be.','eng','Abraham Lincoln','d64bfbb5176645c07213eca598d9ff81',NULL),
(1554,'Ať už si myslíte, že můžete nebo si myslíte, že nemůžete, máte pravdu.',1,'Whether you think you can or you think you can\'t, you are right.','eng','Henry Ford','75c6312012165b5926ed7da976257d51',NULL),
(1555,'V doba změny ti, kdo se učí, zdědí zemi, zatímco vzdělaní se ocitnou skvěle vybaveni pro svět, který už neexistuje.',1,'In times of change, learners inherit the earth, while the learned find themselves beautifully equipped to deal with a world that no longer exists.','eng','Eric Hoffer','4b5dd6befb62d03d84ab54415ac31f0e',NULL),
(1556,'Je tu síla vypadat hloupě a nestarat se o to, že to děláš.',1,'There\'s power in looking silly and not caring that you do.','eng','Amy Poehler','2b89cb1d34e8100f986c6c668c928b21',NULL),
(1557,'Největší místnost na světě je prostor pro zlepšení.',0,'The biggest room in the world is room for improvement.','eng','Helmut Schmidt','ac54559e5df3fba7ff0c22e243eff79f',NULL),
(1558,'Pokud měníte svět, pracujete na důležitých věcech. Těšíš se, až ráno vstaneš.',0,'If you\'re changing the world, you\'re working on important things. You\'re excited to get up in the morning.','eng','Larry Page','f273c8f993af840138fcad4c9689a30f',NULL),
(1559,'Jediná věc, kterou máte a nikdo jiný ji nemá, jste vy. Váš hlas, vaše mysl, váš příběh, vaše vize. Takže piš, kresli, stavěj, hraj si, tancuj a žij tak, jak umíš jen ty.',0,'The one thing that you have that nobody else has is you. Your voice, your mind, your story, your vision. So write and draw and build and play and dance and live as only you can.','eng','Neil Gaiman','0b59c76300d3c88a0135a7d81e11bdc1',NULL),
(1560,'Moudrost, soucit a odvaha jsou tři všeobecně uznávané morální vlastnosti lidí.',0,'Wisdom, compassion, and courage are the three universally recognized moral qualities of men.','eng','Confucius','467f4d34764261d37be74ff402315f95',NULL),
(1561,'S věkem přichází moudrost a vysoká sexuální touha.',0,'With age comes wisdom and a high sex drive. And the wisdom to enjoy it.','eng','Amber Valletta','c661703a7985bc073f8b4f5b8d57dd86',NULL),
(1562,'Nemůžete obviňovat gravitaci za zamilování.',0,'You can\'t blame gravity for falling in love.','eng','Albert Einstein','dddf0bd734c968457e69f0f0154f79a2',NULL),
(1563,'Věci, které člověk chce udělat, jsou věci, které pravděpodobně nejvíce stojí za to.',0,'The things that one most wants to do are the things that are probably most worth doing.','eng','Winifred Holtby','1415b2d8e572f29919f074455e8c091d',NULL),
(1564,'Udělejte z svého zvyku být kritický ohledně malých věcí.',0,'Make it your habit not to be critical about small things.','eng','Edward Everett Hale','29ed68c03b278367fecbc30affc39d5e',NULL),
(1565,'Přátelství, jako je kredit, je nejvyšší, když se nepoužívá.',0,'Friendship, like credit, is highest when it is not used.','eng','Elbert Hubbard','c442bcb8cc545eaf6b1aa49b51c2fa5c',NULL),
(1566,'Nejméně věcí s významem stojí v životě více než ta největší věci bez něj.',0,'The least of things with a meaning is worth more in life than the greatest of things without it.','eng','Carl Jung','60cc3a39386f2dd9d09e6722531cb164',NULL),
(1567,'Někteří lidé prosperují při velkých, dramatických změnách. Jiní preferují pomalou a stabilní cestu. Dělejte to, co je pro vás správné.',1,'Some people thrive on huge, dramatic change. Some people prefer the slow and steady route. Do what\'s right for you.','eng','Julie Morgenstern','1a42dcf431af7614ea4f3966f08fff4e',NULL),
(1568,'Když je něco hotovo, je to hotovo. Neohlížej se. Zaměř se na svůj další cíl.',1,'When a thing is done, it\'s done. Don\'t look back. Look forward to your next objective.','eng','George Marshall','e7f030e4a35110842626f3b8e9150634',NULL),
(1569,'Za každým přátelstvím se skrývá nějaký vlastní zájem. Není přátelství bez vlastních zájmů. To je hořká pravda.',1,'There is some self-interest behind every friendship. There is no friendship without self-interests. This is a bitter truth.','eng','Chanakya','e3ea4e83b1a9ac7e2ebea85ce4e5f9b3',NULL),
(1570,'Nemluvte o tom, co jste udělali nebo co budete dělat.',0,'Don\'t talk about what you have done or what you are going to do.','eng','Thomas Jefferson','6d794f017407cd58f1bcdd386691b19a',NULL),
(1571,'Můžete stát vysoko, aniž byste na někoho stáli.',0,'You can stand tall without standing on someone. You can be a victor without having victims.','eng','Harriet Woods','ab75036ba2a356c60eb111b24cecd430',NULL),
(1572,'Úspěch není klíčem ke štěstí. Štěstí je klíčem k úspěchu. Pokud milujete to, co děláte, budete úspěšní.',0,'Success is not the key to happiness. Happiness is the key to success. If you love what you are doing, you will be successful.','eng','Albert Schweitzer','4b73e38e8eac8e49b94a728a997c0951',NULL),
(1573,'Ticho je spánek, který vyživuje moudrost.',0,'Silence is the sleep that nourishes wisdom.','eng','Francis Bacon','b30fa4bedfd4ffaa7138acb83ce0b9e2',NULL),
(1574,'Přátelství se zvyšuje při návštěvě přátel, ale při jejich návštěvě zřídka.',0,'Friendship increases in visiting friends, but in visiting them seldom.','eng','Francis Bacon','60a4369ff4026357c2f117377cf764d1',NULL),
(1575,'Ten, kdo ovládá ostatní, může být mocný, ale ten, kdo se zvládl, je stále mocnější.',0,'He who controls others may be powerful, but he who has mastered himself is mightier still.','eng','Laozi','ac91f5b505907659be63199a3d93b525',NULL),
(1576,'Být poškozen není nic, pokud si to nepamatujete.',0,'To be wronged is nothing unless you continue to remember it.','eng','Confucius','8f500bb305a51ae5b5c1c84a7193efb2',NULL),
(1577,'Přátelé jsou ti vzácní lidé, kteří se ptají, jak jsme, a pak čekají, až uslyší odpověď.',0,'Friends are those rare people who ask how we are and then wait to hear the answer.','eng','Ed Cunningham','ea3bc21d7b19cce2f00679ac163ee9ef',NULL),
(1578,'Buď teď tady. Buď později někde jinde. Je to tak složité?',0,'Be here now. Be someplace else later. Is that so complicated?','eng','David Bader','a117168b132d517da4fe0d451c04d609',NULL),
(1579,'Nikdy nepochybujte o tom, že malá skupina promyšlených, angažovaných lidí může změnit svět.',0,'Never doubt that a small group of thoughtful, committed people can change the world. Indeed. It is the only thing that ever has.','eng','Margaret Mead','c06ccea6e3e1139afc6e2fbec0e4cf74',NULL),
(1580,'Dobrý úsudek pochází ze zkušeností a mnoho z toho pochází ze špatného úsudku.',0,'Good judgment comes from experience, and a lot of that comes from bad judgment.','eng','Will Rogers','667af192a011086d03c4a1d168728831',NULL),
(1581,'Obavy nejsou nic jiného než stav mysli.',1,'Fears are nothing more than a state of mind.','eng','Napoleon Hill','1fb9c41517b5a7ac3c291b32ab563d44',NULL),
(1582,'Všechny naše znalosti mají svůj původ v našem vnímání.',0,'All our knowledge has its origins in our perceptions.','eng','Leonardo da Vinci','2756bc975e7d87acf4ad30ed1b7dc317',NULL),
(1583,'Jednou z nejkrásnějších vlastností skutečného přátelství je porozumět a pochopit.',0,'One of the most beautiful qualities of true friendship is to understand and to be understood.','eng','Seneca the Younger','d632b3b004473231dd6cd78d27a6cb36',NULL),
(1584,'Uprostřed všech obtíží spočívá příležitost.',0,'In the middle of every difficulty lies opportunity.','eng','Albert Einstein','17a03b23022931422b34dddca7cb73fd',NULL),
(1585,'Jen si věřte, pak budete vědět, jak žít.',0,'Just trust yourself, then you will know how to live.','eng','Johann Wolfgang von Goethe','5886dc69d52278a97e970d0c57d741eb',NULL),
(1586,'Myšlenka je květ; řeč je poupě; akce ovoce za ním.',0,'Thought is the blossom; language the bud; action the fruit behind it.','eng','Ralph Waldo Emerson','31b8a185170273d9be5ad56e223ef95e',NULL),
(1587,'Musíte přivítat změnu jako pravidlo, ale ne jako vládce.',0,'You must welcome change as the rule but not as your ruler.','eng','Denis Waitley','4955b79047e09228a427f75f121b7e5b',NULL),
(1588,'Dokud si neoceníte sami sebe, nebudete si vážit svého času. Dokud si svého času nevážíte, nic s ním neuděláte.',1,'Until you value yourself, you won\'t value your time. Until you value your time, you won\'t do anything with it.','eng','M. Scott Peck','a0231af3dbe2c047771267fb29686449',NULL),
(1589,'Ten, kdo zná druhé, je moudrý. Kdo zná sám sebe, je osvícený.',1,'He who knows others is wise. He who knows himself is enlightened.','eng','Laozi','be29c7e779f76db5be8dc913af3b36be',NULL),
(1590,'Moudrost přestane být moudrostí, když je příliš hrdá na to, aby plakala, příliš vážná na to, aby se smála a příliš sobecká na to, aby hledala jiné než sebe.',0,'Wisdom ceases to be wisdom when it becomes too proud to weep, too grave to laugh, and too selfish to seek other than itself.','eng','Kahlil Gibran','e3483358de407c13b4ec9e2268fbed84',NULL),
(1591,'Muž, který nedůvěřuje sám sobě, nemůže nikdy skutečně důvěřovat nikomu jinému.',1,'A man who doesn\'t trust himself can never really trust anyone else.','eng','Jean François Paul de Gondi','57f73d4ad151a8c9a7c45cba59267838',NULL),
(1592,'Lidé nejsou rozrušeni věcmi, ale názorem, který si o nich udělají.',1,'Men are disturbed not by things, but by the view which they take of them.','eng','Epictetus','9b6f0e4ff0facf1b67eefcc506433b05',NULL),
(1593,'V moudrosti shromážděné v průběhu času jsem zjistil, že každá zkušenost je formou průzkumu.',0,'In wisdom gathered over time I have found that every experience is a form of exploration.','eng','Ansel Adams','4b8256244bc9e073ddae6e3c0688144b',NULL),
(1594,'Nic nebude fungovat, pokud to neuděláte.',0,'Nothing will work unless you do.','eng','Maya Angelou','98fdaaa5efc249a5d048346335e9ad56',NULL),
(1595,'Argumentujte za vaše omezení a určitě jsou vaše.',0,'Argue for your limitations, and sure enough they\'re yours.','eng','Richard Bach','46128dcd18c02bcb926ded2cef12720e',NULL),
(1596,'Chyby jsou obvyklým mostem mezi nezkušeností a moudrostí.',0,'Mistakes are the usual bridge between inexperience and wisdom.','eng','Phyllis Grissim-Theroux','6bf70e81fe4a9c14a6b6d19a0cf3502c',NULL),
(1597,'Čím větší naše znalosti se zvyšují, tím více se rozvine naše nevědomost.',0,'The greater our knowledge increases the more our ignorance unfolds.','eng','John F. Kennedy','536085cc1c9b77855e99c5610686197d',NULL),
(1598,'Život je jediným skutečným rádcem; moudrost nefiltrovaná osobní zkušeností se nestává součástí morální tkáně.',0,'Life is the only real counselor; wisdom unfiltered through personal experience does not become a part of the moral tissue.','eng','Edith Wharton','c9752d202a7bf847fdfee612a05215db',NULL),
(1599,'Ten, kdo je Giddy, si myslí, že se svět otočí.',0,'He that is giddy thinks the world turns round.','eng','William Shakespeare','4aabdc1db3ad5c07332386312f2b289f',NULL),
(1600,'Přátelství je velmi zdaňovací a namáhavá forma volného času.',0,'Friendship is a very taxing and arduous form of leisure activity.','eng','Mortimer J. Adler','6f43b0dfa4f4d43d1e52cf30d6ba3383',NULL),
(1601,'Náš charakter je to, co děláme, když si myslíme, že se nikdo nedívá.',1,'Our character is what we do when we think no one is looking.','eng','H. Jackson Brown Jr.','905de7d8d24a2408e374b3a5a86d9ae0',NULL),
(1602,'Od té doby mě bylo dávno upozorněno, že lidé s úspěchem jen zřídka se posadili a nechali se jim věci stát.',0,'It had long since come to my attention that people of accomplishment rarely sat back and let things happen to them. They went out and happened to things.','eng','Leonardo da Vinci','00568bf9bcd56ee1a318a9585f3f8765',NULL),
(1603,'Trochu více vytrvalosti, trochu více úsilí a to, co se zdálo být beznadějným selháním, se může proměnit ve slavný úspěch.',1,'A little more persistence, a little more effort, and what seemed hopeless failure may turn to glorious success.','eng','Elbert Hubbard','a58ddbcffd99cf82c111e50b5bfe4ce0',NULL),
(1604,'Čas bláznovství měří hodiny, ale moudrost žádné hodiny nezmění.',1,'The hours of folly are measured by the clock; but of wisdom, no clock can measure.','eng','William Blake','f895cb29d16dd93717d83a79cec434cf',NULL),
(1605,'Každý velký sen začíná snílkem. Vždy si pamatujte, že máte v sobě sílu, trpělivost a vášeň, abyste dosáhli hvězd, které změní svět.',0,'Every great dream begins with a dreamer. Always remember, you have within you the strength, the patience, and the passion to reach for the stars to change the world.','eng','Harriet Tubman','57060f92f9fb09b0aa5b8dedcd0551d0',NULL),
(1606,'Vrásky by měly pouze naznačovat, kde byly úsměvy.',1,'Wrinkles should merely indicate where smiles have been.','fra','Mark Twain','431d20a3192707d768446fafc0de4c66',NULL),
(1607,'Láska léčí lidi - jak ti, kteří to dávají, tak ti, kteří ji přijímají.',0,'Love cures people - both the ones who give it and the ones who receive it.','eng','Karl Menninger','23949aaabc0b28c7cc6301be7052c5ca',NULL),
(1608,'Pokud má člověk štěstí, osamělá fantazie může zcela transformovat milion reality.',0,'If one is lucky, a solitary fantasy can totally transform one million realities.','eng','Maya Angelou','e26781815b3112164c99f6b94a06037a',NULL),
(1609,'Pokud se usmíváte, když nikdo jiný není kolem, opravdu to myslíš.',0,'If you smile when no one else is around, you really mean it.','eng','Andy Rooney','d2d89cc2c2776f19a7070e0986739e86',NULL),
(1610,'Existovat znamená změnit, změnit změnu, zrát, zrát je pokračovat v tvorbě nekonečně.',0,'To exist is to change, to change is to mature, to mature is to go on creating oneself endlessly.','eng','Henri Bergson','c9d6a6926bb930fb1f50afe1104c7d63',NULL),
(1611,'Musíme přijmout bolest a spálit ji jako palivo pro naši cestu.',1,'We must embrace pain and burn it as fuel for our journey.','eng','Kenji Miyazawa','fdbcae01aa0fac69e8ff10da2af36108',NULL),
(1612,'Když se protivník přiblíží, nastupte a pozdravte ho; pokud se chce stáhnout, pošlete ho na cestu.',1,'When an opponent comes forward, move in and greet him; if he wants to pull back, send him on his way.','eng','Morihei Ueshiba','d402eb8f17dbcc0e1564ca42a2700249',NULL),
(1613,'Pokud máte odvahu, abyste mohli dělat chyby, vaše moudrost a inteligence skočí vpřed s obrovskou dynamikou.',0,'If you have the guts to keep making mistakes, your wisdom and intelligence leap forward with huge momentum.','eng','Holly Near','1f467b6b9f30b03e4b59b60fe2b7d4ff',NULL),
(1614,'Začátek je vždy dnes.',1,'The beginning is always today.','eng','Mary Wollstonecraft','daf0c677c28441ceba3a63cbc5e567ff',NULL),
(1615,'Všichni vyrůstáme. Doufejme, že budeme moudřejší. Věk přináší moudrost a otcovství zcela mění život člověka.',1,'We all grow up. Hopefully, we get wiser. Age brings wisdom, and fatherhood changes one\'s life completely.','eng','Frank Abagnale','69f0867654c026b014be54109f42c104',NULL),
(1616,'Charakter je jako strom a pověst jako stín. Stín je to, co si o něm myslíme; strom je skutečná věc.',0,'Character is like a tree and reputation like a shadow. The shadow is what we think of it; the tree is the real thing.','eng','Abraham Lincoln','273156bf1d6e838b54e2ff1add431d29',NULL),
(1617,'Kapku po kapce je nádoba naplněná vodou. Stejně tak moudrý člověk, který je postupně sbírá, se naplňuje dobrem.',0,'Drop by drop is the water pot filled. Likewise, the wise man, gathering it little by little, fills himself with good.','eng','The Buddha','9b8c7c141b3505cc9e15f7c663dcb735',NULL),
(1618,'Přítel je takříkajíc druhé já.',1,'A friend is, as it were, a second self.','eng','Cicero','371d2275b4e370289bf7ffe28a9d1fa9',NULL),
(1619,'Kindness je důležitější než moudrost a jeho uznání je začátek moudrosti.',0,'Kindness is more important than wisdom, and the recognition of this is the beginning of wisdom.','eng','Theodore Isaac Rubin','4dbde99ee7385221da9649a359257e43',NULL),
(1620,'Člověk by neměl ostatním ublížit, pokud se člověk miluje.',0,'One should not hurt others if one loves oneself.','eng','The Buddha','7b189a6649132be08c5af2ed73d69742',NULL),
(1621,'Když se podíváte do svého vlastního srdce a najdete tam nic špatného, co si můžete dělat starosti?',0,'If you look into your own heart, and you find nothing wrong there, what is there to worry about? What is there to fear?','eng','Confucius','a5a3d7fb75892144ddefa36ec84727d3',NULL),
(1622,'Nikdy nevysvětlete - vaši přátelé to nepotřebují a vaši nepřátelé vám stejně nevěří.',0,'Never explain - your friends do not need it and your enemies will not believe you anyway.','eng','Elbert Hubbard','7b65302c9c3c9492999023fcaa271d19',NULL),
(1623,'Co vás znepokojuje, vám vládne.',1,'What worries you masters you.','eng','Haddon Robinson','d7fe5184869cdcb418218bc0a6675525',NULL),
(1624,'Ze všech věcí, které moudrost poskytuje, aby nás učinily zcela šťastnou, je největší držení přátelství.',0,'Of all the things which wisdom provides to make us entirely happy, much the greatest is the possession of friendship.','eng','Epicurus','0ad0b9588737fa46d8f2f967a3a50cbc',NULL),
(1625,'Den štěstí je jako den sklizně, musíme být zaneprázdněni, když je kukuřice zralá.',0,'The day of fortune is like a harvest day, we must be busy when the corn is ripe.','eng','Torquato Tasso','263aa8d8264052fb7fed21e9ce4358f6',NULL),
(1626,'Největším darem života je přátelství, a já jsem ho dostal.',1,'The greatest gift of life is friendship, and I have received it.','eng','Hubert Humphrey','e7d62ae5f0b2141bf777eed4ba021edd',NULL),
(1627,'Dlouho bylo mým axiomem, že malé věci jsou nekonečně nejdůležitější.',0,'It has long been an axiom of mine that the little things are infinitely the most important.','eng','Arthur Conan Doyle','ba1cbbca1f086ce90991e86c6f91e078',NULL),
(1628,'Každý si myslí, že změní svět, ale nikdo si nemyslí, že se změní.',0,'Everyone thinks of changing the world, but no one thinks of changing himself.','eng','Leo Tolstoy','50f6f3378372632bdc243f1309f5fb6d',NULL),
(1629,'Studujte minulost, pokud byste božskou budoucnost.',0,'Study the past, if you would divine the future.','eng','Confucius','0da87216efe4e749b54890874e8d8d35',NULL),
(1630,'Neudusujte se navzájem. Nikdo nemůže růst ve stínu.',0,'Don\'t smother each other. No one can grow in the shade.','eng','Leo Buscaglia','0f0568e032f72587b098af27760813f6',NULL),
(1631,'Přátelství, které může přestat, nebylo nikdy skutečné.',0,'The friendship that can cease has never been real.','eng','Jerome','ea4792a16e8c0f0301b5d6b51d8361e3',NULL),
(1632,'To je riziko, které podstoupíte, pokud se změníte: že lidé, se kterými jste byli zapojeni, se vám nelíbí.',0,'That\'s the risk you take if you change: that people you\'ve been involved with won\'t like the new you. But other people who do will come along.','eng','Lisa Alther','89b7aa36294bc50d7dc41dbcc9b666b1',NULL),
(1633,'Chcete -li přinést cokoli do svého života, představte si, že už tam je.',0,'To bring anything into your life, imagine that it\'s already there.','eng','Richard Bach','c868458e7e31342e3fd180c213ae21c8',NULL),
(1634,'Láska je duševní onemocnění.',0,'Love is a serious mental disease.','spa','Plato','d1f405b67abc9bfb750dccc3bba20b47',NULL),
(1635,'\"Naše spojení je začátkem; držení pohromadě je pokrokem; pracování společně je úspěchem.\"',0,'Coming together is a beginning; keeping together is progress; working together is success.','eng','Edward Everett Hale','b8c12d2cb3a54acb6648df4a7c98f03b',NULL),
(1636,'Kamkoli jdete, jděte celým svým srdcem.',0,'Wherever you go, go with all your heart.','eng','Confucius','95556ade78bb98be65338a2e0848ff0c',NULL),
(1637,'Žijeme ve společnosti přeplněné daty, ale hladovějící po moudrosti. Jsme spojeni 24 hodin denně, 7 dní v týdnu, ale úzkost, strach, deprese a osamělost jsou na historickém maximu. Musíme změnit směr.',1,'We live in a society bloated with data yet starved for wisdom. We\'re connected 24/7, yet anxiety, fear, depression and loneliness are at an all-time high. We must course-correct.','eng','Elizabeth Kapu\'uwailani Lindsey','30a165e640b5faba691f15e1126be743',NULL),
(1638,'Učitel, který je skutečně moudrý, vám neposkytuje vstup do domu jeho moudrosti, ale spíše vás vede k prahu vaší mysli.',0,'The teacher who is indeed wise does not bid you to enter the house of his wisdom but rather leads you to the threshold of your mind.','eng','Kahlil Gibran','7b97e9addec2d9c4a4d0b80b6c7962e6',NULL),
(1639,'Naše nedůvěra je velmi drahá.',0,'Our distrust is very expensive.','eng','Ralph Waldo Emerson','eb25433c944e86cb8ca4758edd79e240',NULL),
(1640,'Oko vidí jen to, co je mysl připravena pochopit.',0,'The eye sees only what the mind is prepared to comprehend.','eng','Henri Bergson','26af65f371bf56eb2a9f4f0f12ad7b09',NULL),
(1641,'Neměnitelnou známkou moudrosti je vidět zázračné ve společné.',0,'The invariable mark of wisdom is to see the miraculous in the common.','eng','Ralph Waldo Emerson','301ec6f6f77eb044dff1dbe72db1b788',NULL),
(1642,'Ten, kdo se učí žít na Little dluží více moudře svého otce, než ten, kdo ho hodně nechal péči svého otce.',0,'He who is taught to live upon little owes more to his father\'s wisdom than he who has a great deal left him does to his father\'s care.','eng','William C. Menninger','03cae8951dbee34496d4f181a4584f46',NULL),
(1643,'S realizací vlastního potenciálu a sebevědomí ve schopnosti člověka lze vybudovat lepší svět.',0,'With the realization of one\'s own potential and self-confidence in one\'s ability, one can build a better world.','eng','Dalai Lama','e1248dd28e32d8216ddbad94ae232e0f',NULL),
(1644,'Je fatální vstoupit do jakékoli války bez vůle ji vyhrát.',1,'It is fatal to enter any war without the will to win it.','eng','Douglas MacArthur','ba757611900c090eea78d96ae3a55253',NULL),
(1645,'Včerejší domácí běhy nevyhrají dnešní hry.',0,'Yesterday\'s home runs don\'t win today\'s games.','eng','Babe Ruth','f798c2156c86cfe98d11a0ecb47c7e88',NULL),
(1646,'Štěstí není v pouhém vlastnictví peněz; spočívá v radosti z úspěchu, ve vzrušení z tvůrčího úsilí.',1,'Happiness is not in the mere possession of money; it lies in the joy of achievement, in the thrill of creative effort.','eng','Franklin D. Roosevelt','cb395aecbf28314602b5d96e7a9063c8',NULL),
(1647,'Odvaha není absence strachu, ale i přes tento strach jednoduše pokračuje v důstojnosti.',0,'Courage is not the absence of fear, but simply moving on with dignity despite that fear.','eng','Pat Riley','f060b01ce647413c416d2ff15975d78a',NULL),
(1648,'Problém s většinou lidí je v tom, že myslí spíše se svými nadějemi nebo obavami nebo přáním než s jejich myslí.',0,'The trouble with most people is that they think with their hopes or fears or wishes rather than with their minds.','eng','Will Durant','61745f13a2bab17fefa395ed6badecc8',NULL),
(1649,'Přátelství je jedním z našich nejcennějších vztahů, ale není kodifikované a slavené; nikdy vám neuspořádá večírek.',1,'Friendship is one of our most treasured relationships, but it isn\'t codified and celebrated; it\'s never going to give you a party.','eng','Hanya Yanagihara','69ad1f6473c2774e0aae53ae82604fce',NULL),
(1650,'Tam, kde je velká láska, vždy existují zázraky.',0,'Where there is great love, there are always miracles.','eng','Willa Cather','badea2f2f5ccb8f2d2fa8bc1e40d79fb',NULL),
(1651,'Ve vašem srdci je magnet, který přiláká opravdové přátele. Tím magnetem je nesobeckost, myslet nejdříve na druhé; když se naučíte žít pro druhé, budou žít pro vás.',1,'There is a magnet in your heart that will attract true friends. That magnet is unselfishness, thinking of others first; when you learn to live for others, they will live for you.','eng','Paramahansa Yogananda','6a58d44bd8496e6d155e78d4e8a153e2',NULL),
(1652,'Někdy je lepší ztratit a dělat správnou věc, než vyhrát a dělat špatnou věc.',0,'Sometimes it is better to lose and do the right thing than to win and do the wrong thing.','eng','Tony Blair','ddba9de04f7b051016ebcf32b64e70d3',NULL),
(1653,'Nejsem v tomto světě, abych splnil vaše očekávání a nejste v tomto světě, abyste žili podle mého.',0,'I\'m not in this world to live up to your expectations and you\'re not in this world to live up to mine.','eng','Bruce Lee','0bacb1831d2a3e372cedeb985f379eec',NULL),
(1654,'Moudrost má svůj kořen v dobrotě, ne dobrota v moudrosti.',0,'Wisdom has its root in goodness, not goodness its root in wisdom.','eng','Ralph Waldo Emerson','cb0c6eb3516ce7dc56a00c18fa3956fc',NULL),
(1655,'Dokonalost není dovednost. Je to postoj.',0,'Excellence is not a skill. It is an attitude.','fra','Ralph Marston','49480f1e56f2ad95d364e6e679dc277a',NULL),
(1656,'Nikdy nepřerušte svého nepřítele, když dělá chybu.',0,'Never interrupt your enemy when he is making a mistake.','eng','Napoleon','9bd350cd88d80925251200ffb6d39df7',NULL),
(1657,'Nápady jsou počáteční body všech bohatství.',0,'Ideas are the beginning points of all fortunes.','eng','Napoleon Hill','3240f0507b01b7b13ac515f1917dec0e',NULL),
(1658,'Vždy můžete říct skutečnému příteli: Když jste si ze sebe udělali blázna, nemá pocit, že jste odvedli trvalou práci.',0,'You can always tell a real friend: when you\'ve made a fool of yourself he doesn\'t feel you\'ve done a permanent job.','eng','Laurence J. Peter','7156814f7f359ceba85bebbb9b1a7cbc',NULL),
(1659,'Jeden může říci, že věčné tajemství světa je jeho srozumitelnost.',0,'One may say the eternal mystery of the world is its comprehensibility.','eng','Albert Einstein','2d12adff194a77f9f5f1d3853cf7b3a0',NULL),
(1660,'Neexistuje selhání kromě toho, že už nezkoušíme.',1,'There is no failure except in no longer trying.','eng','Elbert Hubbard','f64d500ca31fff8c6cd21a7641eb8ddf',NULL),
(1661,'Nic nikdy nezmizí, dokud nás nenaučilo, co potřebujeme vědět.',0,'Nothing ever goes away until it has taught us what we need to know.','eng','Pema Chödrön','185e99386e393a8cd0c43f4c3493d693',NULL),
(1662,'Hádaní mezi přáteli, když je vytvořena, přidá novou kravatu k příteli.',0,'A quarrel between friends, when made up, adds a new tie to friendship.','fra','Francis de Sales','20fc2be84792d7f439d5d29c8ee91afe',NULL),
(1663,'Neexistuje větší škoda než ztráta času.',0,'There is no greater harm than that of time wasted.','eng','Michelangelo','98c8808f9853504ced36c9da9eb51c8f',NULL),
(1664,'Všichni bychom měli být vděčni za ty lidi, kteří oživují vnitřní ducha.',1,'We should all be thankful for those people who rekindle the inner spirit.','eng','Albert Schweitzer','2b65d7f6959e5a00a07013b0328199ac',NULL),
(1665,'Vážíme si našich starších. Je moudrost, která vychází ze zkušenosti, a já se nepřestanu učit z moudrých rad.',1,'We respect our elders. There is wisdom that comes from experience, and I am not going to stop learning from wise counsel.','eng','Marcia Fudge','6ed651b0b4451f61b1e4f4dbb90f9456',NULL),
(1666,'Celou dobu buď postupujeme, nebo retrográdně postupujeme. V tomto životě není nic takového jako setrvání na místě.',0,'We are either progressing or retrograding all the while. There is no such thing as remaining stationary in this life.','eng','James Freeman Clarke','c25d233fba44dd13abd98c02e36093a6',NULL),
(1667,'Pokud jsou fakta semena, která později vytvářejí znalosti a moudrost, pak emoce a dojmy smyslů jsou úrodná půda, ve které musí semena růst.',0,'If facts are the seeds that later produce knowledge and wisdom, then the emotions and the impressions of the senses are the fertile soil in which the seeds must grow.','eng','Rachel Carson','c7094948b3e2ec9a100f28e311dae22f',NULL),
(1668,'Skutečný přítel je největší ze všech požehnání a to, co se nejméně staráme o všechny.',0,'A true friend is the greatest of all blessings, and that which we take the least care of all to acquire.','eng','François de La Rochefoucauld','434994b0bde79ca219a3d75a93ba77de',NULL),
(1669,'Strom se pozná po ovoci, člověk po skutcích. Dobrý skutek není nikdy ztracen; ten, kdo zasévá zdvořilost, sklízí přátelství, a ten, kdo zasévá laskavost, shromažďuje lásku.',0,'A tree is known by its fruit; a man by his deeds. A good deed is never lost; he who sows courtesy reaps friendship, and he who plants kindness gathers love.','eng','Basil of Caesarea','fdecbe3f9c3753472c018bb99e41c2d9',NULL),
(1670,'Neuskutečnit se do nevědomosti je moudrost.',0,'Not engaging in ignorance is wisdom.','eng','Bodhidharma','3f66b66a6e76f887a8ca5783b07d7736',NULL),
(1671,'V naprosté temnotě jsme všichni stejní, je to jen naše znalosti a moudrost, která nás odděluje, nenechte se oklamat.',0,'In complete darkness we are all the same, it is only our knowledge and wisdom that separates us, don\'t let your eyes deceive you.','eng','Janet Jackson','970153861f554c858a0fcb4d7665915a',NULL),
(1672,'Když jsme osvobozeni od našeho vlastního strachu, naše přítomnost automaticky osvobozuje ostatní.',1,'As we are liberated from our own fear, our presence automatically liberates others.','eng','Nelson Mandela','97d81bd48cc2715abd80fe19d8a36269',NULL),
(1673,'Pokud chcete jít na východ, nechoďte na západ.',0,'If you want to go east, don\'t go west.','eng','Ramakrishna','e0e5dd51848d05e50b0b8ed9e4e64e24',NULL),
(1674,'Počítače jsou jako bikiny. Ušetří lidem spoustu dohadů.',0,'Computers are like bikinis. They save people a lot of guesswork.','eng','Sam Ewing','8c0a3efd2330f3d861ba67e34a713229',NULL),
(1675,'Přítel, který s námi může mlčet v okamžiku zoufalství nebo zmatku, který s námi může zůstat za hodinu zármutku a úmrtí, který dokáže tolerovat, že neví ... není uzdravení, ne vytvrzování ... to je přítel, který se stará.',0,'The friend who can be silent with us in a moment of despair or confusion, who can stay with us in an hour of grief and bereavement, who can tolerate not knowing... not healing, not curing... that is a friend who cares.','eng','Henri Nouwen','f5139402205a065f38a0f8a7b3d077c2',NULL),
(1676,'Nejlepší učíte, co se nejvíce potřebujete naučit.',0,'You teach best what you most need to learn.','eng','Richard Bach','f646b338dff80962af8092adac028253',NULL),
(1677,'Zlaté pravidlo jsme si vtiskli do paměti; nyní si je vtiskněme do života.',1,'We have committed the Golden Rule to memory; let us now commit it to life.','eng','Edwin Markham','95d04d018d4a46dde9dd36791d01274d',NULL),
(1678,'Efektivita znamená dělat věci správně; efektivita znamená dělat správné věci.',0,'Efficiency is doing things right; effectiveness is doing the right things.','eng','Peter Drucker','d81f48f35e970555e28ecb543bfbce32',NULL),
(1679,'Štěstí je, když si myslíte, co říkáte a co děláte, jsou v harmonii.',0,'Happiness is when what you think, what you say, and what you do are in harmony.','eng','Mahatma Gandhi','2c52fc7eb880bbd54a23f82626bbf9c7',NULL),
(1680,'Zanedbávání včasných oprav činí nutnou úplnou přestavbu.',1,'It is the neglect of timely repair that makes rebuilding necessary.','eng','Richard Whately','0ddaba1a64ca9cd39e1ac1276943e6f5',NULL),
(1681,'Je nemožné objektivně zažít smrt člověka a stále nést melodii.',0,'It is impossible to experience one\'s death objectively and still carry a tune.','eng','Woody Allen','2be6f1f47ad8d0b8770bab7767be4e84',NULL),
(1682,'Filozofie člověka není nejlépe vyjádřena slovy; je vyjádřena v rozhodnutích, která člověk činí... a rozhodnutí, která činíme, jsou v konečném důsledku naší odpovědností.',0,'One\'s philosophy is not best expressed in words; it is expressed in the choices one makes... and the choices we make are ultimately our responsibility.','eng','Eleanor Roosevelt','00ed8eaf4242ca8f3dd6b370cde6e3b5',NULL),
(1683,'Lepší než tisíc dutých slov, je jedno slovo, které přináší mír.',0,'Better than a thousand hollow words, is one word that brings peace.','eng','The Buddha','d32dc24c1f1d5993a4dd8229b2a4cc5c',NULL),
(1684,'Nebojte se jít ven na končetinu.',0,'Don\'t be afraid to go out on a limb. That\'s where the fruit is.','eng','H. Jackson Brown Jr.','6618439f282f729c767eaa3aadb506ef',NULL),
(1685,'Když vidíte dobrého člověka, přemýšlejte o tom, že se stanete jako on.',0,'When you see a good person, think of becoming like him. When you see someone not so good, reflect on your own weak points.','eng','Confucius','b4b0221d3649a0186263e1eea14f3094',NULL),
(1686,'Ignorance a Bungling s láskou jsou lepší než moudrost a dovednost bez.',0,'Ignorance and bungling with love are better than wisdom and skill without.','eng','Henry David Thoreau','09b30f43c1e0b2fb478ddf9383399dbc',NULL),
(1687,'Pokud někdo sebejistě postupuje směrem ke svému snu a snaží se žít život, který si představoval, setká se s úspěchem neočekávaným v běžných chvílích.',1,'If one advances confidently in the direction of his dream, and endeavors to live the life which he had imagines, he will meet with a success unexpected in common hours.','eng','Henry David Thoreau','68aef4da5e22e1dae79b3c3659128d23',NULL),
(1688,'Každé přátelství je jiné, protože osobnost každého je jiná.',0,'Every friendship is different because everyone\'s personality is different.','eng','Nargis Fakhri','dd644088186e73ad33f2e9f3b819c43b',NULL),
(1689,'Často lituje své řeči, nikdy své ticho.',0,'I have often regretted my speech, never my silence.','fra','Publilius Syrus','90f6784880e47c6a67b9f398d60d8ab8',NULL),
(1690,'Je to známka vzdělané mysli, že dokáže uvažovat o myšlence, aniž by ji přijala.',1,'It is the mark of an educated mind to be able to entertain a thought without accepting it.','eng','Aristotle','b6c375a83e64644ffb2d14e5e4511895',NULL),
(1691,'Vždy se stane něco, v co opravdu věříte, a víra v něco to způsobí.',1,'The thing always happens that you really believe in; and the belief in a thing makes it happen.','eng','Frank Lloyd Wright','82e1c7724aa678b4ed999d98e5d67ae0',NULL),
(1692,'Srdce má oči, o kterých mozek nic neví.',0,'The heart has eyes which the brain knows nothing of.','eng','Charles Henry Parkhurst','39a3d2d9bb59006d55ae48063774d0c7',NULL),
(1693,'Využij talenty, které máš. Les by byl velmi tichý, kdyby tam nezpívali žádní ptáci kromě těch, kteří zpívají nejlépe.',1,'Use what talents you possess; the woods would be very silent if no birds sang there except those that sang best.','eng','Henry van Dyke Jr.','ee2ab2825cbc322f865ff8325fbbeee1',NULL),
(1694,'Život bez lásky je jako strom bez květů nebo ovoce.',0,'Life without love is like a tree without blossoms or fruit.','eng','Kahlil Gibran','badefc517904b6ef0921e5ab95f07dd5',NULL),
(1695,'Nestačí mít dobrou mysl, hlavní je ji dobře používat.',0,'It is not enough to have a good mind; the main thing is to use it well.','eng','René Descartes','48155ad8648d56a9c08016c69736d5d8',NULL),
(1696,'Pokud nevíte, kam jdete, pravděpodobně skončíte někde jinde.',0,'If you don\'t know where you are going, you will probably end up somewhere else.','eng','Laurence J. Peter','61d951a95bc884760875259e77047117',NULL),
(1697,'Pokud neexistuje žádný boj, nedochází k žádnému pokroku.',0,'If there is no struggle, there is no progress.','eng','Frederick Douglass','85920f29726df5ced73cb3e00d8bec2e',NULL),
(1698,'Liška má mnoho triků. Ježek má jen jednoho. Ale to je to nejlepší ze všeho.',0,'The fox has many tricks. The hedgehog has but one. But that is the best of all.','eng','Erasmus','e89afb24cab1b1a974c5c3420862bbd6',NULL),
(1699,'Svět se velmi málo stará o to, co muž nebo žena ví; záleží na tom, co muž nebo žena umí.',0,'The world cares very little about what a man or woman knows; it is what a man or woman is able to do that counts.','eng','Booker T. Washington','11cde0cc7327a6cc6d65e377d4b3ace5',NULL),
(1700,'Pokud budete dělat to, co jste vždy dělali, dostanete to, co jste vždy dostávali.',1,'If you do what you\'ve always done, you\'ll get what you\'ve always gotten.','fra','Tony Robbins','645e16b0ecc22788bc3e03318b3772a6',NULL),
(1701,'Život není o hledání sebe sama. Život je o vytváření sebe sama.',1,'Life isn\'t about finding yourself. Life is about creating yourself.','eng','Bernard Shaw','bfe91c841566959cb24767dcb6eac960',NULL),
(1702,'PROBLEMATICKÝ: \n\nHlavní problémy současného překladu:\n1. \"Cash in on\" je idiom znamenající \"vytěžit/využít\", ne doslovně \"vyplatit\"\n2. \"Experience\" zde znamená \"zkušenost\", ne \"zážitek\"\n3. Překlad zní nepřirozeně a strojově\n4. Ztrácí se plynulost a aforistická kvalita originálu\n\nNAVRHUJI:\n\"Neúspěšný člověk je ten, kdo udělal chybu, ale nedokáže se z ní poučit.\"\n\nnebo poetičtěji:\n\"Skutečně selhal jen ten, kdo ze svého omylu nedokázal vytěžit zkušenost.\"\n\nZdůvodnění:\n- Používá přirozenější českou idiomatiku\n- Zachovává hlavní myšlenku o nevyužité příležitosti učit se z chyb\n- Vyhýbá se doslovnému překladu \"cash in\"\n- Má lepší rytmus a aforistickou kvalitu\n- Používá genderově neutrální jazyk, což je v češtině',0,'A failure is a man who has blundered but is not capable of cashing in on the experience.','eng','Elbert Hubbard','82d125a5a823c8e60e3b41219966a96c',NULL),
(1703,'Trik je v tom, co člověk zdůrazňuje. Buď se cítíme mizerně, nebo se činíme šťastnými. Množství práce je stejné.',0,'The trick is in what one emphasizes. We either make ourselves miserable, or we make ourselves happy. The amount of work is the same.','eng','Carlos Castaneda','7095929da07e706cef89255e7da787f8',NULL),
(1704,'Opatrná zřídka se mýlí.',0,'The cautious seldom err.','eng','Confucius','ecfbc0f726684f1d38c75f5fcf566e46',NULL),
(1705,'Poznání přichází, ale moudrost přetrvává. Není snad těžké nashromáždit v mysli ohromné množství faktů v poměrně krátkém čase, ale schopnost tvořit úsudky vyžaduje přísnou disciplínu tvrdé práce a kalící žár zkušeností a zralosti.',1,'Knowledge comes, but wisdom lingers. It may not be difficult to store up in the mind a vast quantity of facts within a comparatively short time, but the ability to form judgments requires the severe discipline of hard work and the tempering heat of experience and maturity.','eng','Calvin Coolidge','717b80ca8929d4319cf5c0c41226d6c7',NULL),
(1706,'Možná si dobře pamatujete, že vám nic nemůže přinést úspěch, ale sami sebe.',0,'You might well remember that nothing can bring you success but yourself.','eng','Napoleon Hill','cf1d0894e9862a4300574389c0f74772',NULL),
(1707,'Jste produktem svého prostředí. Vyberte si tedy prostředí, které vás nejlépe posune k vašemu cíli. Analyzujte svůj život z hlediska jeho prostředí. Pomáhají vám věci kolem vás k úspěchu - nebo vás brzdí?',0,'You are a product of your environment. So choose the environment that will best develop you toward your objective. Analyze your life in terms of its environment. Are the things around you helping you toward success - or are they holding you back?','eng','W. Clement Stone','ce2d148495de06c38ff15928cb74d2c4',NULL),
(1708,'Muž, který činí vše, co vede ke štěstí, závislé na sobě samém, a ne na jiných lidech, přijal nejlepší plán pro šťastný život. To je muž umírněnosti, muž mužného charakteru a moudrosti.',1,'The man who makes everything that leads to happiness depends upon himself, and not upon other men, has adopted the very best plan for living happily. This is the man of moderation, the man of manly character and of wisdom.','eng','Plato','c0f180225f363f0ae68bf69799813a38',NULL),
(1709,'Zůstaňte odhodláni ke svým rozhodnutím, ale zůstaňte ve svém přístupu flexibilní.',0,'Stay committed to your decisions, but stay flexible in your approach.','eng','Tony Robbins','9bd6f23e73a2a776b37e133efccf4a21',NULL),
(1710,'Síla nepochází z fyzické kondice. Pochází z nepřekonatelné vůle.',1,'Strength does not come from physical capacity. It comes from an indomitable will.','fra','Mahatma Gandhi','e4115726578b12f557f1fe5e7851354a',NULL),
(1711,'Je obtížné dosáhnout ducha skutečné spolupráce, pokud lidé zůstávají lhostejní vůči pocitům a štěstí druhých.',0,'It is difficult to achieve a spirit of genuine cooperation as long as people remain indifferent to the feelings and happiness of others.','eng','Dalai Lama','6fd9ec9d7afa3a40bb0edd320e693625',NULL),
(1712,'Skutečné přátelství je rostlina pomalého růstu a musí se podrobit a odolat šokům protivenství, než má nárok na označení.',0,'True friendship is a plant of slow growth, and must undergo and withstand the shocks of adversity, before it is entitled to the appellation.','eng','George Washington','94ee3ddc9055b4e85701990b2b9a4437',NULL),
(1713,'Požehnané jsou srdce, která se dovedou ohýbat; ta se nikdy nezlomí.',1,'Blessed are the hearts that can bend; they shall never be broken.','eng','Albert Camus','961ef7660180fff699f1f6b904e843b5',NULL),
(1714,'Pamatujte, že máte nejen právo být jednotlivcem, ale máte povinnost být jedním.',0,'Remember always that you not only have the right to be an individual, you have an obligation to be one.','eng','Eleanor Roosevelt','11eee254960473d4e6ab9ec55b381fe2',NULL),
(1715,'Pokud se snažíte dosáhnout, budou zátarasy. Měl jsem je, měl je každý. Překážky vás ale nemusí zastavit. Pokud narazíte na zeď, neotáčejte se a nevzdávejte to. Zjistěte, jak na ni vylézt, projít jí nebo ji obejít.',0,'If you\'re trying to achieve, there will be roadblocks. I\'ve had them; everybody has had them. But obstacles don\'t have to stop you. If you run into a wall, don\'t turn around and give up. Figure out how to climb it, go through it, or work around it.','eng','Michael Jordan','af4511284446cb6de2505b73896e4dd2',NULL),
(1716,'Změna nepřijde, pokud budeme čekat na jinou osobu nebo jinou dobu. My jsme ti, na které jsme čekali. My jsme tou změnou, kterou hledáme.',0,'Change will not come if we wait for some other person or some other time. We are the ones we\'ve been waiting for. We are the change that we seek.','eng','Barack Obama','e4bbd494eca79f71c802ba982a1f240e',NULL),
(1717,'Ten, kdo je příliš naléhavý na své vlastní názory, najde jen málo, aby s ním souhlasil.',0,'One who is too insistent on his own views, finds few to agree with him.','eng','Laozi','2a074bf70ceea8294ef1f85c5197777e',NULL),
(1718,'Vytváříme si vlastní jmění a nazýváme je osudem.',1,'We make our own fortunes and we call them fate.','eng','Benjamin Disraeli','1d87cf99fccf9cb69f7cf615270e950f',NULL),
(1719,'To, co dělá Supermana hrdinou, není to, že má moc, ale že má moudrost a zralost, aby využil sílu moudře.',0,'What makes Superman a hero is not that he has power, but that he has the wisdom and the maturity to use the power wisely. From an acting point of view, that\'s how I approached the part.','eng','Christopher Reeve','d8aedef522de1bceb69dd35ba075b258',NULL),
(1720,'Nikdy si nemýlíte návrh na akci.',0,'Never mistake motion for action.','eng','Ernest Hemingway','0fd7e2db85da801953eaa8b0f39d2a74',NULL),
(1721,'Jednou z výhod nepořádnosti je to, že člověk neustále dělá vzrušující objevy.',1,'One of the advantages of being disorderly is that one is constantly making exciting discoveries.','eng','A. A. Milne','89a74a0b9d650547d0796007bacb3eaa',NULL),
(1722,'Tvrdil bych, že poděkování je nejvyšší forma myšlení a že vděčnost je štěstí zdvojnásobené úžasem.',1,'I would maintain that thanks are the highest form of thought, and that gratitude is happiness doubled by wonder.','eng','G. K. Chesterton','63bba6aae0af04fee1acd4c391e25c6e',NULL),
(1723,'Nepřestáváme hraní, protože stárneme, stárneme, protože jsme přestali hrát.',0,'We do not quit playing because we grow old, we grow old because we quit playing.','eng','Oliver Wendell Holmes Jr.','46e221462e2e2fe1d69ed7040411e989',NULL),
(1724,'Pokud trávíte celý svůj život čekáním na bouři, nikdy si užijete slunce.',0,'If you spend your whole life waiting for the storm, you\'ll never enjoy the sunshine.','eng','Morris West','e0ff283929ba32bafbfb298fe600bb0d',NULL),
(1725,'Nemůžete být osamělí, pokud máte rádi osobu, se kterou jste sami.',0,'You cannot be lonely if you like the person you\'re alone with.','eng','Wayne Dyer','fd0d378c614b2cc9187a7788a3547f93',NULL),
(1726,'Není třeba chrámů, není třeba komplikovaných filosofií. Můj mozek a mé srdce jsou mými chrámy; mou filozofií je laskavost.',0,'There is no need for temples, no need for complicated philosophies. My brain and my heart are my temples; my philosophy is kindness.','eng','Dalai Lama','824d107e18f771654840bccec64ec653',NULL),
(1727,'Přátelé ukazují svou lásku v době potíží, nikoli ve štěstí.',0,'Friends show their love in times of trouble, not in happiness.','eng','Euripides','5ffec683397f8344ae8e8cab615c2447',NULL),
(1728,'Nesledujte, kam může cesta vést. Jděte místo toho tam, kde není cesta, a zanechte stopu.',1,'Do not follow where the path may lead. Go, instead, where there is no path and leave a trail.','eng','Ralph Waldo Emerson','8deed2f6bc30773ec74d62d2a3371422',NULL),
(1729,'Bůh vám dal jednu tvář a vy si uděláte další.',1,'God has given you one face, and you make yourself another.','eng','William Shakespeare','3103f08a43cd4b9a9b139a71e61e15ae',NULL),
(1730,'Je lepší mít dostatek nápadů, aby se některé z nich mohly mýlit, než mít vždy pravdu a nemít vůbec žádné nápady.',0,'It is better to have enough ideas for some of them to be wrong, than to be always right by having no ideas at all.','eng','Edward de Bono','5b05257073d627264b21ab052fdb3d9e',NULL),
(1731,'Předsudky je břemeno, které zaměňuje minulost, ohrožuje budoucnost a činí současnost nepřístupnou.',0,'Prejudice is a burden that confuses the past, threatens the future and renders the present inaccessible.','eng','Maya Angelou','cf518b713c1bd950fb5e5722c1657940',NULL),
(1732,'Přátelé jsou sourozenci, které nám Bůh nikdy nedal.',0,'Friends are the siblings God never gave us.','eng','Mencius','db7a995142beb8bdf60e5763c0bd900d',NULL),
(1733,'Ten, kdo si přeje zajistit dobro ostatních, již zajistil své vlastní.',0,'He who wishes to secure the good of others, has already secured his own.','eng','Confucius','4c654dda1164467d078564f84a8f632c',NULL),
(1734,'Zvítězíš, když ustoupíš přátelům.',1,'You win the victory when you yield to friends.','eng','Sophocles','56c5d62d0666a99a98326397aa4a09a6',NULL),
(1735,'Raději bych litoval věcí, které jsem udělal, než věci, které jsem neudělal.',0,'I\'d rather regret the things that I have done than the things that I have not done.','eng','Lucille Ball','7075a4755e842d8ec9749446b33b8a3b',NULL),
(1736,'Ať už v životě děláte cokoli, obklopte se inteligentními lidmi, kteří se s vámi budou hádat.',0,'Whatever you do in life, surround yourself with smart people who\'ll argue with you.','eng','John Wooden','0a0122a9acf8e77936a7c818193fcc96',NULL),
(1737,'Musíte být opatrní, pokud nevíte, kam jdete, protože se tam možná nedostanete.',0,'You got to be careful if you don\'t know where you\'re going, because you might not get there.','eng','Yogi Berra','3aaf623546a642dbf223b4a71f6589b0',NULL),
(1738,'Přátelství je láska bez jeho křídel!',0,'Friendship is Love without his wings!','eng','Lord Byron','764649c2cc33e2646cb1646b0ca81bb9',NULL),
(1739,'Slyšel jsem a zapomínám. Vidím a vzpomínám si. Já ano a nepřetrvávám.',0,'I hear and I forget. I see and I remember. I do and I understand.','fra','Confucius','987aa5cfe2a9a67055450a20ac19e6a2',NULL),
(1740,'Pravda není pro všechny lidi, ale pouze pro ty, kteří to hledají.',0,'The truth is not for all men, but only for those who seek it.','eng','Ayn Rand','2c40cf0857a20c19a3ddf327ecb84eb4',NULL),
(1741,'Lidský duch musí zvítězit nad technologií.',0,'The human spirit must prevail over technology.','eng','Albert Einstein','e8bdec8f8c1e7774642139716995155e',NULL),
(1742,'Právě na našich selháních založíme nový a odlišný a lepší úspěch.',0,'It is on our failures that we base a new and different and better success.','eng','Havelock Ellis','a934c79646b192c4e87e85d94c9b1b3e',NULL),
(1743,'Jsem toho názoru, že můj život patří komunitě, a pokud žiji, je moje privilegium dělat za to, co umím.',0,'I am of the opinion that my life belongs to the community, and as long as I live it is my privilege to do for it whatever I can.','eng','Bernard Shaw','72a60f2d2797ba174848639391a8c0f7',NULL),
(1744,'Jediná růžová může být moje zahrada ... jediný přítel, můj svět.',0,'A single rose can be my garden... a single friend, my world.','fra','Leo Buscaglia','c0231f6865606651f469673581da13e9',NULL),
(1745,'Vděčnost není jen největší z ctností, ale rodičem všech ostatních.',1,'Gratitude is not only the greatest of virtues, but the parent of all the others.','eng','Cicero','7d6d644a805522655dc2c8ab8e0832c6',NULL),
(1746,'Není hlupák, který dává to, co nemůže udržet, aby získal to, co nemůže ztratit.',0,'He is no fool who gives what he cannot keep to gain what he cannot lose.','eng','Jim Elliot','cc3cd6bf22c1e97e3d39719347aff3a7',NULL),
(1747,'Jeden dnes stojí za dvě zítřky.',1,'One today is worth two tomorrows.','eng','Benjamin Franklin','455a8e0fe5c5600fa8737d90d8697e99',NULL),
(1748,'Věřím, že jsme zásadně stejní a máme stejný základní potenciál.',0,'I believe that we are fundamentally the same and have the same basic potential.','eng','Dalai Lama','90e0ef1cad6e24c69fba31e8f7260745',NULL),
(1749,'Kdybychom dělali věci, kterých jsme schopni, sami sebe bychom ohromili.',1,'If we did the things we are capable of, we would astound ourselves.','eng','Thomas Edison','767d554ee3d5c8a0cd20bf7b59358892',NULL),
(1750,'Pokud se ukáže, že Bůh existuje, nemyslím si, že je zlý. Ale nejhorší, co o něm můžete říct, je, že v podstatě nevyužívá svůj potenciál.',1,'If it turns out that there is a God, I don\'t think that he\'s evil. But the worst that you can say about him is that basically he\'s an underachiever.','eng','Woody Allen','d63df2ce2e8230ec02e3dbbb06e2c887',NULL),
(1751,'Nikdy nedělejte věci, které mohou ostatní dělat a budou dělat, pokud existují věci, které ostatní nemohou dělat nebo nebudou dělat.',0,'Never do things others can do and will do, if there are things others cannot do or will not do.','eng','Amelia Earhart','cbb03a1582a3b6bf6e68a78bdde28ac6',NULL),
(1752,'Americká svoboda náboženství a svoboda od náboženství nabízí každé tradici moudrosti příležitost řešit naše nejhlubší duchovní potřeby: křesťanství, judaismus, islám, buddhismus, hinduismus, světský humanismus, agnosticismus a ateismus mimo jiné.',1,'America\'s freedom of religion, and freedom from religion, offers every wisdom tradition an opportunity to address our soul-deep needs: Christianity, Judaism, Islam, Buddhism, Hinduism, secular humanism, agnosticism and atheism among others.','eng','Parker Palmer','1186d635964c2bcd9485c1603530929c',NULL),
(1753,'Miluji moudrost. A nikdy nemůžete být v ničem skvělí, pokud to nemilujete. Nebuďte do toho zamilovaní, ale milujte tu věc, obdivujte ji. A zdá se, že pokud tu věc milujete a nechcete ji jen vlastnit, ona vás najde.',1,'I love wisdom. And you can never be great at anything unless you love it. Not be in love with it, but love the thing, admire the thing. And it seems that if you love the thing, and you don\'t just want to possess it, it will find you.','eng','Maya Angelou','944e18bade735e5b588dc4587e2e9451',NULL),
(1754,'Když vyjadřujeme vděčnost, nesmíme nikdy zapomenout, že nejvyšším uznáním není vyslovovat slova, ale žít jimi.',0,'As we express our gratitude, we must never forget that the highest appreciation is not to utter words, but to live by them.','eng','John F. Kennedy','0fc2da0c4fe4eeda75d800b09c2bede6',NULL),
(1755,'Nejlepší cesta ven je vždy.',0,'The best way out is always through.','eng','Robert Frost','be1af3c874ed6606a9889f57bba1b6f8',NULL),
(1756,'Zkušenost není to, co se člověku stane. To je to, co člověk dělá s tím, co se mu stane.',0,'Experience is not what happens to a man. It is what a man does with what happens to him.','eng','Aldous Huxley','b1156523eabdd332097dcb0618558c40',NULL),
(1757,'Přátelství nepotřebuje žádná slova - je to osamělost dodávaná z úzkosti osamělosti.',0,'Friendship needs no words - it is solitude delivered from the anguish of loneliness.','eng','Dag Hammarskjöld','48fe8b39ae47ee8c331feb64ec05b9c9',NULL),
(1758,'Optimismus je víra, která vede k úspěchu. Nic se nedá dělat bez naděje a důvěry.',1,'Optimism is the faith that leads to achievement. Nothing can be done without hope and confidence.','eng','Helen Keller','dd7c5dc19df566150e89f2a902b8f83f',NULL),
(1759,'Univerzální národ Zulu stojí za uznáním moudrosti, porozumění, svobody, spravedlnosti a rovnosti, míru, jednoty, lásky a radosti, práce, překonávání negativního pozitivním, vědy, matematiky, víry, faktů a zázraků Božích, ať už mu říkáme Alláh, Jehovah, Yahweh nebo Jah.',1,'The Universal Zulu Nation stands to acknowledge wisdom, understanding, freedom, justice, and equality, peace, unity, love, and having fun, work, overcoming the negative through the positive, science, mathematics, faith, facts, and the wonders of God, whether we call him Allah, Jehovah, Yahweh, or Jah.','eng','Afrika Bambaataa','b0c3d9c0038b86a25b4649da60533b82',NULL),
(1760,'Pokud se vzdáte větru, můžete je jezdit.',0,'If you surrender to the wind, you can ride it.','eng','Toni Morrison','ca77e52c3c8e7e41617a660fbaba7c87',NULL),
(1761,'Skutečnými přáteli mohou být jen ti s velkým srdcem. Zlí a zbabělí se nikdy nedozví, co znamená opravdové přátelství.',0,'It is only the great hearted who can be true friends. The mean and cowardly, can never know what true friendship means.','eng','Charles Kingsley','07eb859e08fbfbf2c8f727026d5dc0c2',NULL),
(1762,'Udržování skutečného přátelství je mnohem náročnější, než za to dáváme uznání.',0,'Sustaining true friendship is a lot more challenging than we give it credit for.','eng','Mariella Frostrup','9eb835241e61e3bf0aa830d8b4b8a4f2',NULL),
(1763,'Nespokojte se s vztahem, který vám nedovolí být sám.',0,'Don\'t settle for a relationship that won\'t let you be yourself.','eng','Oprah Winfrey','873cac727d2fb65d1319d171ac501190',NULL),
(1764,'Nezajímá mě věk. Lidé, kteří mi říkají, že jejich věk je hloupý. Jsi tak starý, jak se cítíš.',0,'I\'m not interested in age. People who tell me their age are silly. You\'re as old as you feel.','eng','Elizabeth Arden','171d8b9d2c059db18ff3dbf06f713469',NULL),
(1765,'Využití síly rozhodnutí vám dává schopnost překonat jakoukoli omluvu ke změně jakékoli a každé části vašeho života v okamžiku.',0,'Using the power of decision gives you the capacity to get past any excuse to change any and every part of your life in an instant.','eng','Tony Robbins','304b90afb09736ee4dc556027e12fd6b',NULL),
(1766,'Muž není starý, pokud něco hledá.',1,'A man is not old as long as he is seeking something.','eng','Edmond Rostand','3336677edc92f5d7a5b60d508fd2728c',NULL),
(1767,'Logika vás dostane z A do B. Představivost vás vezme všude.',0,'Logic will get you from A to B. Imagination will take you everywhere.','eng','Albert Einstein','c907c43f8e3874ae45543611ac4973ed',NULL),
(1768,'Život je jako jízda na kole. Abyste udrželi rovnováhu, musíte pokračovat v pohybu.',0,'Life is like riding a bicycle. To keep your balance you must keep moving.','eng','Albert Einstein','45173c033b88ca4b8dfdb90ae03042bd',NULL),
(1769,'Osoba, která nikdy neudělala chybu, nikdy nezkoušela nic nového.',1,'A person who never made a mistake never tried anything new.','eng','Albert Einstein','e10def0254156c42c371ad3f338303f0',NULL),
(1770,'Bůh vždy vede nejjednodušší cestu.',0,'God always takes the simplest way.','eng','Albert Einstein','131e553eb7fe15b8618bf0711da455f3',NULL),
(1771,'Existují pouze dva způsoby, jak žít svůj život. Jedním z nich je, jako by nic nebyl zázrak. Druhým je, jako by všechno byl zázrak.',0,'There are only two ways to live your life. One is as though nothing is a miracle. The other is as though everything is a miracle.','eng','Albert Einstein','6db663e139d6044ec1128d8bc8868155',NULL),
(1772,'Představivost je důležitější než znalosti. Protože zatímco znalosti definují vše, co v současné době známe a rozumíme, představivost ukazuje na vše, co bychom ještě mohli objevit a vytvořit.',0,'Imagination is more important than knowledge. For while knowledge defines all we currently know and understand, imagination points to all we might yet discover and create.','eng','Albert Einstein','492dbed28742351675bc76264467c31b',NULL),
(1773,'Snažte se ne stát se mužem úspěchu, ale zkuste se stát hodnotným mužem.',0,'Try not to become a man of success, but rather try to become a man of value.','eng','Albert Einstein','3e2364878907699c749ad2391bcf2522',NULL),
(1774,'Pokus kombinovat moudrost a sílu byl jen zřídka úspěšný a poté jen na krátkou dobu.',0,'The attempt to combine wisdom and power has only rarely been successful and then only for a short while.','eng','Albert Einstein','3e33f08de4cf0ecf909d4ab138db6e3e',NULL),
(1775,'Pokud je A úspěch v životě, pak A se rovná x plus y plus z. Práce je x, hra je y a z je držet hubu.',1,'If A is success in life, then A equals x plus y plus z. Work is x; y is play; and z is keeping your mouth shut.','eng','Albert Einstein','b22fb1de3f9e2ced72a81ab1448988dd',NULL),
(1776,'Každý, kdo nebere pravdu vážně v malých věcech, nelze věřit ani ve velkých.',0,'Anyone who doesn\'t take truth seriously in small matters cannot be trusted in large ones either.','eng','Albert Einstein','e9bcde8454a1a20f2d10b9146ee43804',NULL),
(1777,'Nemám žádný zvláštní talent. Jsem jen vášnivě zvědavá.',0,'I have no special talent. I am only passionately curious.','eng','Albert Einstein','568696c3c29e7508db5b45e702ad0b7e',NULL),
(1778,'Nemůžeme vyřešit naše problémy se stejným myšlením, které jsme použili, když jsme je vytvořili.',1,'We cannot solve our problems with the same thinking we used when we created them.','eng','Albert Einstein','3a10d3695b4ed1b97c9dd99161ac6531',NULL),
(1779,'Nastavení příkladu není hlavním prostředkem ovlivňování jiného, je to jediný prostředek.',0,'Setting an example is not the main means of influencing another, it is the only means.','eng','Albert Einstein','4a0ce3a76abc1a7c5cdc8564b538f477',NULL),
(1780,'Je zjevně zřejmé, že naše technologie překročila naše lidstvo.',0,'It has become appallingly obvious that our technology has exceeded our humanity.','eng','Albert Einstein','e958401286c2742a0d1f4dfc3f59bed5',NULL),
(1781,'Jedinou skutečnou cennou věcí je intuice.',1,'The only real valuable thing is intuition.','eng','Albert Einstein','bc1ff2281ed53823a5ddd828bd3627ed',NULL),
(1782,'Realita je pouze iluze, i když velmi trvalá.',0,'Reality is merely an illusion, albeit a very persistent one.','eng','Albert Einstein','a5d2b0241aca87a6eef9791383f94973',NULL),
(1783,'Učte se od včerejška, žijte pro dnešek, naděje na zítřek.',0,'Learn from yesterday, live for today, hope for tomorrow.','eng','Albert Einstein','4a2e25240efc29eed82eb7dcfe3ee4cf',NULL),
(1784,'Skvělé myšlenky často čelí prudkému odporu ze strany průměrných myslí.',1,'Great ideas often receive violent opposition from mediocre minds.','eng','Albert Einstein','17f7358e64de2fcd24c4c7bea2f8ccf1',NULL),
(1785,'Věřím, že jednoduchý a nenáročný způsob života je nejlepší pro všechny, nejlepší jak pro tělo i mysl.',0,'I believe that a simple and unassuming manner of life is best for everyone, best both for the body and the mind.','eng','Albert Einstein','e954a1f2cb2108e36ec88f737bb2bd67',NULL),
(1786,'Muž by měl hledat, co je, a ne to, co si myslí, že by mělo být.',1,'A man should look for what is, and not for what he thinks should be.','eng','Albert Einstein','83f958eec8eed65432f5b193ca8fd6ce',NULL),
(1787,'Jakmile přijmeme své limity, překročíme je.',1,'Once we accept our limits, we go beyond them.','eng','Albert Einstein','02925522d7617d9d1ceb30502cc1575f',NULL),
(1788,'Pocit a touhu jsou motivové síly za všemi lidskými úsilí a lidskými výtvory.',0,'Feeling and longing are the motive forces behind all human endeavor and human creations.','eng','Albert Einstein','97b232caf989ee6d5082dd3eb63dfc47',NULL),
(1789,'Když je řešení jednoduché, Bůh odpovídá.',0,'When the solution is simple, God is answering.','eng','Albert Einstein','53a5c215a2cf86bf99ad0423841e8435',NULL),
(1790,NULL,0,'If you can\'t explain it simply, you don\'t understand it well enough.','eng','Albert Einstein','2895a3da67f25ea131f7653c1bf81eb5',NULL),
(1791,NULL,2,'Peace cannot be kept by force. It can only be achieved by understanding.','eng','Albert Einstein','08bc668033a1711f4c57de08570ce4be',NULL),
(1792,'Pokud otevřeme hádku mezi minulostí a současností, zjistíme, že jsme ztratili budoucnost.',0,'If we open a quarrel between past and present, we shall find that we have lost the future.','eng','Winston Churchill','99000e8d090fb3cebecc57f7cf2026f3','2025-09-07 10:50:28'),
(1793,'Appeaser je ten, kdo živí krokodýl, doufá, že ho bude jíst naposledy.',0,'An appeaser is one who feeds a crocodile, hoping it will eat him last.','eng','Winston Churchill','f50075a66b7b8a38f8e0ff7c54f6da4f',NULL),
(1794,NULL,0,'The inherent vice of capitalism is the unequal sharing of blessings; the inherent virtue of socialism is the equal sharing of miseries.','eng','Winston Churchill','d9660410299080c31d2a438493443754',NULL),
(1795,'Čím dále se můžete podívat, čím dál kupředu můžete vidět.',0,'The farther backward you can look, the farther forward you can see.','eng','Winston Churchill','dc73852252f765e0c27dbea2b657c790',NULL),
(1796,'Historie je napsána vítězi.',0,'History is written by the victors.','eng','Winston Churchill','8de2122bbb70a30a30a0e87ce63d608d',NULL),
(1797,'Nejlepší argument proti demokracii je pětiminutový rozhovor s průměrným voličem.',0,'The best argument against democracy is a five-minute conversation with the average voter.','eng','Winston Churchill','8bf356d4a906889a42c12083b2966a97',NULL),
(1798,NULL,0,'Before you can inspire with emotion, you must be swamped with it yourself. Before you can move their tears, your own must flow. To convince them, you must yourself believe.','eng','Winston Churchill','a3b54a49c0db51521c49c7374828caec',NULL),
(1799,NULL,0,'The pessimist sees difficulty in every opportunity. The optimist sees the opportunity in every difficulty.','eng','Winston Churchill','b7ca9c106d099dba082e317fd6b8fa53',NULL),
(1800,'Nikdy se nestarám o akci, ale pouze o nečinnost.',0,'I never worry about action, but only inaction.','eng','Winston Churchill','f68a7d3268bdd6d5ba046ab926423054',NULL),
(1801,'Děláme živobytí podle toho, co získáme, ale děláme život tím, co dáváme.',0,'We make a living by what we get, but we make a life by what we give.','fra','Winston Churchill','0c5c2db792bc4218c0da46dc2b9e3403',NULL),
(1802,NULL,0,'Success is not final; failure is not fatal: it is the courage to continue that counts.','eng','Winston Churchill','547e3e27cb0c1b7348582e5e7adfd3fa',NULL),
(1803,'Historie bude ke mně laskavá, protože to mám v úmyslu napsat.',0,'History will be kind to me for I intend to write it.','eng','Winston Churchill','d72e03f6344ebadd692d4aa5c85c5db6',NULL),
(1804,'Klíčem k odemknutí našeho potenciálu je neustálé úsilí - ne síla nebo inteligence.',0,'Continuous effort - not strength or intelligence - is the key to unlocking our potential.','eng','Winston Churchill','15c7784e3bc0c69596ced0ce1c146825',NULL),
(1805,'Odvaha jde od selhání k selhání, aniž by ztratila nadšení.',0,'Courage is going from failure to failure without losing enthusiasm.','eng','Winston Churchill','ef70d78221b1dad7996f3bdc3805a740',NULL),
(1806,'Cena velikosti je odpovědnost.',0,'The price of greatness is responsibility.','eng','Winston Churchill','949884c4ac0a1742de0ad6056ee44836',NULL),
(1807,NULL,0,'Courage is what it takes to stand up and speak; courage is also what it takes to sit down and listen.','eng','Winston Churchill','ddb9a9b6e79e093a41f8904eca1b328e',NULL),
(1808,'Nikdy, nikdy, nikdy se nevzdávejte.',0,'Never, never, never give up.','eng','Winston Churchill','b0f71b6d6404b76f600e18e79edb40b8',NULL),
(1809,NULL,0,'You have enemies? Good. That means you\'ve stood up for something, sometime in your life.','eng','Winston Churchill','b8349e1e65834f3bc1b7d7fd28eea66f',NULL),
(1810,'Krátká slova jsou nejlepší a stará slova, jsou -li krátká ze všech.',0,'Short words are best and the old words when short are best of all.','eng','Winston Churchill','274e4ceb794d71bd84790acdf0c2f3df',NULL),
(1811,NULL,0,'Always tell the truth. That way, you don\'t have to remember what you said.','eng','Mark Twain','c3f42c85f4f871c4b8fbb61228ee34cb',NULL),
(1812,'Kdokoli je šťastný, také učiní ostatní radost.',0,'Whoever is happy will make others happy, too.','eng','Mark Twain','e59be315859932af0e8e9e97e598350a',NULL),
(1813,'Dlouho očekávaná věc má podobu neočekávaného, když to konečně přijde.',0,'A thing long expected takes the form of the unexpected when at last it comes.','eng','Mark Twain','05ca7ecb121987ac95130b9d43564bb4',NULL),
(1814,'Za dvacet let budete více zklamáni věcmi, které jste neudělali, než těmi, které jste udělali.',0,'Twenty years from now you will be more disappointed by the things that you didn\'t do than by the ones you did do.','eng','Mark Twain','46b0df5fbaf903f712f350b9f0efb8b7',NULL),
(1815,NULL,0,'To get the full value of joy you must have someone to divide it with.','eng','Mark Twain','3728f30098f46432eb87c61825558c95',NULL),
(1816,'Kindness je jazyk, který slyší neslyšící a nevidomí.',0,'Kindness is the language which the deaf can hear and the blind can see.','eng','Mark Twain','22cf18b2768bc9f56c6832e3659fb6e5',NULL),
(1817,'Tajemství toho, že se dostane dopředu, začíná.',0,'The secret of getting ahead is getting started.','eng','Mark Twain','b7e9ec7595c670eb579f3bcf7f142d08',NULL),
(1818,'Pokud máte pochybnosti, řekněte pravdu.',0,'When in doubt, tell the truth.','eng','Mark Twain','278b7121412b1487f84e221f89b5c0cf',NULL),
(1819,'Cvičení mimořádného daru je supremistické potěšení v životě.',0,'The exercise of an extraordinary gift is the supremist pleasure in life.','eng','Mark Twain','c6f10ac38150e49b9788f90fd5aa7eea',NULL),
(1820,NULL,2,'There are basically two types of people. People who accomplish things, and people who claim to have accomplished things. The first group is less crowded.','eng','Mark Twain','3154a6175baab6477c64da1c3b327fa4',NULL),
(1821,'Jediná věc, která má dělat s dobrou radou, je předat to.',0,'The only thing to do with good advice is to pass it on. It is never of any use to oneself.','eng','Oscar Wilde','3dc74eb57f664b674bd40f74d4efab6e',NULL),
(1822,NULL,0,'The aim of life is self-development. To realize one\'s nature perfectly - that is what each of us is here for.','eng','Oscar Wilde','93db542a9ccc9b961bfe213de226bd99',NULL),
(1823,NULL,0,'Be yourself; everyone else is already taken.','eng','Oscar Wilde','b13a7f12cd187eafc6e4f96e32b9de17',NULL),
(1824,'Smích není vůbec špatným začátkem přátelství a je to pro jeden nejlepší konec.',0,'Laughter is not at all a bad beginning for a friendship, and it is far the best ending for one.','eng','Oscar Wilde','9cb29abe90819b6b51e05e0abf165299',NULL),
(1825,NULL,0,'The smallest act of kindness is worth more than the grandest intention.','eng','Oscar Wilde','be6164ed72f59b150f52863f4837ab0b',NULL),
(1826,'Skuteční přátelé vás bodnou vpředu.',0,'True friends stab you in the front.','eng','Oscar Wilde','b6068e8d70bc3dd4908a9d96b57316d6',NULL),
(1827,NULL,0,'Experience is simply the name we give our mistakes.','eng','Oscar Wilde','b24c17bccbfe1e6a0d988779a3a89380',NULL),
(1828,'Nemá žádné nepřátele, ale jeho přátelé ho intenzivně nelíbí.',0,'He has no enemies, but is intensely disliked by his friends.','eng','Oscar Wilde','5ed0f2fb406d387ea280ede29c8dfe2b',NULL),
(1829,NULL,0,'Anybody can make history. Only a great man can write it.','eng','Oscar Wilde','db6a84eece8ce9d42d4279927ef3245f',NULL),
