(2036,'Síla lidského myšlení roste exponenciálně s počtem myslí, které sdílejí tuto myšlenku.',0,'The power of human thought grows exponentially with the number of minds that share that thought.','eng','Dan Brown','edfa5aef597341899b623ee37e6d863d',NULL),
