(2038,NULL,2,'From a certain point onward there is no longer any turning back. That is the point that must be reached.','eng','Franz Kafka','33fef2ae6b8d0c4e097624051cf5040d',NULL),
(2039,NULL,0,'Be approximately right rather than exactly wrong.','eng','John Tukey','3765d14114f7d1c966dbc4ade73c8fd6',NULL),
