(2041,'Vytváření své známky na světě je těžké.',0,'Making your mark on the world is hard. If it were easy, everybody would do it.','eng','Barack Obama','aefed38d67c818c4e9b535f2fe9758d0',NULL),
(2042,NULL,0,'Whatever you decide to do, make sure it makes you happy.','por','Paulo Coelho','eec3a3518e0d175aeeb3fe8502682ed8',NULL),
(2043,'Zasadit zahradu znamená věřit v zítra.',0,'To plant a garden is to believe in tomorrow.','eng','Audrey Hepburn','13128f8c10dd7707e87d6ee54c7fe282',NULL),
(2044,NULL,0,'It doesn\'t matter how much you want. What really matters is how much you want it.','eng','Ralph Marston','a9709d169b987a503173ffc9572ad736',NULL),
(2045,'Zralé ovoce padá samy o sobě - ale do úst nespadá.',0,'Ripe fruit falls by itself - but it doesn\'t fall in your mouth.','eng','Chinese Proverb','be81852120b2e5966e8f521c48b14544',NULL),
(2046,NULL,0,'The less you want, the richer you are. The more you need in order to be happy, the more miserable you\'ll be.','eng','Yanni','898dcee042141f9a0bb36dcc00fd3f94',NULL),
