(2048,NULL,0,'Wit is educated insolence.','eng','Aristotle','a0bb81c206457eccee9b9dd869625ea9',NULL),
(2049,'Neexistují žádné rozdíly, ale rozdíly v míře mezi různými stupni rozdílů a žádným rozdílem.',0,'There are no differences but differences of degree between different degrees of difference and no difference.','eng','William James','f6eaa27566458c48564e61dc1ca6e646',NULL),
(2050,'Znalost vlastní tmy je nejlepší metoda pro řešení temnoty jiných lidí.',0,'Knowing your own darkness is the best method for dealing with the darknesses of other people.','eng','Carl Jung','b1f2906256523e525135d4683a79ef66',NULL),
(2051,NULL,0,'Don\'t want anything. Then you get everything.','eng','Seungsahn','47addf4da2c79bf8b5a5b9a2db4ecd07',NULL),
(2052,'Právě teď máte v sobě, vše, co potřebujete, abyste se vypořádali s tím, co na vás může svět hodit.',0,'You have within you right now, everything you need to deal with whatever the world can throw at you.','eng','Brian Tracy','125396307cde9a8fcf7e6e698357e670',NULL),
(2053,'Všichni jsme jiní. Nesuďte, místo toho porozumění.',0,'We are all different. Don\'t judge, understand instead.','deu','Roy T. Bennett','7e89e3af00a177b8d18d453459d38b7d',NULL),
(2054,'Pokud máte jen jeden úsměv, dejte to lidem, které máte rádi.',0,'If you have only one smile in you give it to the people you love.','eng','Maya Angelou','4b1c1be45a6ae16165443bf898770a02',NULL),
(2055,'Ten, kdo opustí hru, to vyhraje.',0,'He who leaves the game wins it.','eng','Nicolas Chamfort','f0104f7e19d1f7df01c501a58a1379e9',NULL),
(2056,NULL,0,'It is useless to meet revenge with revenge; it will heal nothing.','eng','J.R.R. Tolkien','0df0573b4092d5f0d1522219f21ff685',NULL),
(2057,'Hněv, ego, žárlivost jsou největší nemoci, udržujte se před těmito třemi nemocemi.',0,'Anger, ego, jealousy are the biggest diseases,Keep yourself aloof from these three diseases.','eng','Sathya Sai Baba','1a2044e4039e3bd3b06e103968abfcdd',NULL),
(2058,'Všimněte si, že tato cesta je jedinečně vaše, nikdo se nese.',0,'Note that this journey is uniquely yours, no one elses. So the path has to be your own.','eng','Jon Kabat-Zinn','ddaa91f4286cc54ca321c3b0da3cafe3',NULL),
(2059,NULL,0,'If you truly love Nature, you will find beauty everywhere.','eng','Vincent van Gogh','d0e188533e028374260ef0a171ef2a17',NULL),
(2060,'Úspěch nelze sledovat, musí být přitahován osobou, kterou se stanete.',0,'Success is not to be pursued, it is to be attracted by the person you become.','eng','Jim Rohn','90971fa4b58a2c1e88077982ac2b7d08',NULL),
