(2062,'Ti, kteří to vědí, ano. Ti, kteří rozumí, učí.',0,'Those who know, do. Those that understand, teach.','deu','Aristotle','2886c30f01834212da810fc925852dec',NULL),
(2063,'Pokud si chcete ponechat své vzpomínky, musíte je nejprve žít.',0,'If you want to keep your memories, you first have to live them.','eng','Bob Dylan','14b745a83a9ab49b9e06b1260f176ec2',NULL),
(2064,'Všichni jsme v okapu, ale někteří z nás se dívají na hvězdy.',0,'We are all in the gutter, but some of us are looking at the stars.','eng','Oscar Wilde','929438196d4c50ed981297313f83cd38',NULL),
