(2066,'Věk mládeže, nezralost se vyrostla, nevědomost může být vzdělaná a opilství vytrvalo, ale hloupý trvá věčně.',0,'Youth ages, immaturity is outgrown, ignorance can be educated, and drunkenness sobered, but stupid lasts forever.','eng','Aristophanes','0b0e59ad1a1c85907d6f7820754d85fb',NULL),
