(2068,NULL,0,'There is no greater agony than bearing an untold story inside you.','eng','Maya Angelou','6fc875566c4c2f53e896bef44e85b592',NULL),
(2069,'Přijímat bez stížnosti, pracujte s osudem.',0,'Receive without complaint, Work with fate.','eng','Ming-Dao Deng','a2b3947a7f4b0dd2a031157add712117',NULL),
(2070,'K vytvoření šťastného života je zapotřebí jen velmi málo;',0,'Very little is needed to make a happy life; it is all within yourself, in your way of thinking.','eng','Marcus Aurelius','a84a0f7c7f2c192a0af2bccf32491b51',NULL),
(2071,NULL,0,'Be as fluid as water, do not give your enemies anything solid to attack.','eng','Robert Greene','a99c39111cfba799c880ca9e5c8332d0',NULL),
(2072,'Mějte vizi, věřte si, porušte některá pravidla, ignorujte naysayers, nebojte se selhat.',0,'Have a vision, trust yourself, break some rules, ignore the naysayers, don\'t be afraid to fail.','eng','Arnold Schwarzenegger','9b97add0ebd8236231b6c51c5f7dcbf3',NULL),
(2073,'Lepší diamant s vadou než oblázkem bez jednoho.',0,'Better a diamond with a flaw than a pebble without one.','eng','Chinese Proverb','051bdf34bd58ff785046b92f5bfbc985',NULL),
(2074,'Když víte, co chcete, a chcete to dost špatné, najdete způsob, jak to získat.',0,'When you know what you want, and you want it bad enough, you will find a way to get it.','eng','Jim Rohn','a1ff9ff0f12552321a94e586db0390ea',NULL),
(2075,'Můžete se vyhnout realitě, ale nemůžete se vyhnout důsledkům vyhýbání se realitě.',0,'You can avoid reality, but you cannot avoid the consequences of avoiding reality.','eng','Ayn Rand','77aa312437c835e84fb97cf05fa522fb',NULL),
(2076,NULL,0,'Your task is not to seek for love, but merely to seek and find all the barriers within yourself that you have built against it.','eng','Rumi','1663c471fbbf6d02c2e53b013db83530',NULL),
(2077,NULL,0,'A day without laughter is a day wasted.','eng','Charlie Chaplin','3bd607703d2ad9ab8ef03d84027741f5',NULL),
(2078,NULL,0,'I do not exist to impress the world. I exist to live my life in a way that will make me happy.','eng','Richard Bach','39eee91a4503735fd2782ff3f1c04528',NULL),
(2079,NULL,2,'I am not proud, but I am happy; and happiness blinds, I think, more than pride.','eng','Alexandre Dumas','865b4644824cd31fded3d49cf1eec0d1',NULL),
(2080,'Požehnaný je ten, kdo nic neočekává, protože nikdy nebude zklamán.',0,'Blessed is he who expects nothing, for he shall never be disappointed.','eng','Alexander Pope','e8795218694cb442a693facdf68d1565',NULL),
(2081,'Uprostřed chaosu je také příležitost.',0,'In the midst of chaos, there is also opportunity.','eng','Sun Tzu','ebbd1c3100154ed3d8a386f4d581ca2c',NULL),
(2082,'Téměř každá krize se zdá být nejhorší, ale po skončení to není tak špatné.',0,'Nearly every crisis seems to be the worst one, but after it\'s over, it isn\'t so bad.','eng','Harry S. Truman','c0dd6e6b238a528a731c2f665bc57078',NULL),
(2083,'Získáte sílu, odvahu a důvěru ze všech zkušeností, ve které se opravdu přestanete vypadat strach do tváře.',0,'You gain strength, courage and confidence by every experience in which you really stop to look fear in the face.','eng','Eleanor Roosevelt','035096c2575bf7ba5eeed2fd3ae5a89d',NULL),
(2084,'Převezměte odpovědnost za své vlastní štěstí, nikdy to nevložte do rukou jiných lidí.',0,'Take responsibility of your own happiness, never put it in other people\'s hands.','eng','Roy T. Bennett','5b0c04fe73e95d545991abaf2b9c0c8f',NULL),
(2085,NULL,0,'It doesn\'t matter if the glass is half empty or half full. Be grateful you have a glass - you\'re the only person that can decide what\'s in it.','eng','Gurbaksh Chahal','84b602bd74933a4a893993c64bb8ac3a',NULL),
