(2089,'Jednoduchým pravidlem při jednání s těmi, s nimiž je těžké se s nimi vypořádat, je pamatovat si, že tato osoba se snaží prosadit svou nadřazenost;',0,'A simple rule in dealing with those who are hard to get along with is to remember that this person is striving to assert his superiority; and you must deal with him from that point of view.','eng','Alfred Adler','6dfc905f736b6c7df24ceec3c7d5813e',NULL),
(2090,'Výjimeční myslitelé ignorují své kritiky a chodí o historii jejich podnikání.',0,'Exceptional thinkers ignore their critics and go about their business making history.','eng','John Eliot','8ae956773573546f0d21024fd887a6c8',NULL),
(2091,'Z vašich zranitelnosti přijde vaše síla.',0,'Out of your vulnerabilities will come your strength.','eng','Sigmund Freud','f31d83befe3fb1cf84effd93905c661d',NULL),
(2092,'Lidé jen zřídka dělají tomu, v co věří. Dělají to, co je pohodlné, pak činí činí.',0,'People seldom do what they believe in. They do what is convenient, then repent.','eng','Bob Dylan','51b8939ff199d478c1f21e0e49d7421d',NULL),
(2093,'Samotná svoboda vyžaduje nepohodlí.',0,'Freedom itself demands discomfort.','eng','Mark Manson','4d23a007466e38bef2fcba9bce51906e',NULL),
(2094,NULL,0,'Failure is an option here. If things are not failing, you are not innovating enough.','eng','Elon Musk','df47875ff89bf62b4e1e1b35ebdecc40',NULL),
(2095,'Úspěšný muž je ten, kdo může položit pevný základ s cihly, které na něj ostatní hodili.',0,'A successful man is one who can lay a firm foundation with the bricks others have thrown at him.','eng','David Brinkley','ddb714ac2e40a9fee5ceca1f57110c05',NULL),
(2096,'Kdykoli uděláte věc, chovejte se, jako by se celý svět díval.',0,'Whenever you do a thing, act as if all the world were watching.','eng','Thomas Jefferson','b8803db4b6f8e56695a3bc5a22583aba',NULL),
(2097,NULL,0,'There are no uninteresting things, only uninterested people.','eng','Gilbert Chesterton','6c4216dbc5f4dad39259e2a455b07e0e',NULL),
