(2099,'Koncentrovaná síla byla vždy nepřítelem svobody.',0,'Concentrated power has always been the enemy of liberty.','eng','Ronald Reagan','a45dc6559ba43aef89cf99ce73165a9b',NULL),
(2100,'Pronásledujte svou vášeň, ne váš důchod.',1,'Chase your passion, not your pension.','eng','Denis Waitley','bf171c0d9ac8b11d3b06762218746b1d',NULL),
(2101,NULL,0,'Be grateful for what you have now, and nothing should be taken for granted.','eng','Roy T. Bennett','2f089f8895065a3ca64b106fc299d48d',NULL),
(2102,'Básník by měl být tak lstivý slovy, že mu závidí i pro své bolesti.',0,'A poet should be so crafty with words that he is envied even for his pains.','eng','Criss Jami','0e51d819834a2fcede4cd22d2139f065',NULL),
