(2104,'Jednou z opravdu těžkých věcí je zjistit, na jaké otázky je třeba položit.',0,'One of the really tough things is figuring out what questions to ask. Once you figure out the question, then the answer is relatively easy.','eng','Elon Musk','eff98e1df226e092b2b9a6de99d5464e',NULL),
(2105,'Je velmi divné, že lidé, které milujete, jsou často lidé, na které jste nejvíce kruté.',0,'It\'s very strange that the people you love are often the people you\'re most cruel to.','eng','Kenneth Branagh','7be4c42d552061d1d8a505ffbc04d69e',NULL),
(2106,'Učení nikdy nevyčerpá mysl.',0,'Learning never exhausts the mind.','eng','Leonardo da Vinci','ac5d16298736302f1a3501aa4c4e0565',NULL),
(2107,'Naděje je bdělý sen.',0,'Hope is a waking dream.','eng','Aristotle','a6431f21aa332e0b0d606eaf5437fb01',NULL),
(2108,'Lidé se nestarají o to, kolik toho víte, dokud neví, kolik vám záleží.',0,'People don\'t care how much you know until they know how much you care.','fra','Theodore Roosevelt','13e1e7581db5354fc428481cdfec9c55',NULL),
(2109,'Pravda je tak vzácná věc, je potěšeno, že to řekne.',0,'Truth is such a rare thing, it is delighted to tell it.','eng','Emily Dickinson','58d70107aee7afd576028bc97fef4767',NULL),
