(2111,'Bez ohledu na to, jak vysoká je hora, nemůže zablokovat slunce.',0,'No matter how tall the mountain is, it cannot block the sun.','eng','Chinese Proverb','554b6431ee97cd66081451de335f03ff',NULL),
(2112,NULL,2,'Today I begin a new life. I will greet this day with love in my heart.','eng','Og Mandino','fd9db261c49dfba6bc4087549aa7ef58',NULL),
(2113,NULL,0,'Great minds discuss ideas. Average minds discuss events. Small minds discuss people.','eng','Eleanor Roosevelt','46a9da635db22e9b6a8eef7ef31ddbc4',NULL),
(2114,NULL,2,'Life is filled with secrets. You can\'t learn them all at once.','eng','Dan Brown','f96967e6be4f7fb1683ead77cabc85ea',NULL),
(2115,'Žijte okamžik na okamžik.',0,'Live the moment for the moment.','eng','Michael Jordan','caa834f605c7f5e676a1ef072b8d7342',NULL),
(2116,NULL,0,'Life is a gift. Never forget to enjoy and bask in every moment you are in.','eng','Celestine Chua','8f5d3caac9c4aea6a9622341836225d7',NULL),
(2117,'Změňte se - máte kontrolu.',0,'Change yourself - you are in control.','eng','Mahatma Gandhi','65e3d3b7d2d7477cbd2e0e94ae63a3cb',NULL),
(2118,NULL,0,'To the world you may be one person; but to one person you may be the world.','eng','Dr. Seuss','30963d69a8d8885ad6a42f8fc2a1d8b2',NULL),
(2119,NULL,2,'A man has to learn that he cannot command things but that he can command himself; that he cannot coerce the wills of others but that he can mold and master his own will.','eng','James Allen','d816a0f988275c2b9699ceb09cc092ff',NULL),
(2120,'Srdce, které dává, shromažďuje.',0,'The heart that gives, gathers.','eng','Lao Tzu','3c6f79f70b1dc679ba14552220f7cdd5',NULL),
(2121,'Žijte, cestujte, dobrodružství, žehnej a nemilujte se.',0,'Live, travel, adventure, bless, and don\'t be sorry.','eng','Jack Kerouac','bcec0056c753641c73fe0677aa9eb01f',NULL),
(2122,'Je nejbohatší, kdo je spokojený s obsahem, je bohatství přírody.',0,'He is richest who is content with the least, for content is the wealth of nature.','eng','Socrates','469e7e3733069f17755970edaaaaa1dd',NULL),
(2123,NULL,0,'What would you do if you weren\'t afraid?','nld','Spencer Johnson','9eb2d9cf7ca220d861a5dc8a883b64aa',NULL),
(2124,'V životě potřebujete buď inspiraci nebo zoufalství.',0,'In life you need either inspiration or desperation.','eng','Tony Robbins','64bffcadf7edb194fe6e70d01e7f2b70',NULL),
(2125,NULL,0,'Today you are you, that is truer than true. There is no one alive who is you-er than you.','eng','Dr. Seuss','950767066f969d23a8566d26848458c2',NULL),
(2126,'Život má více představivosti, než ve svých snech neseme.',0,'Life has more imagination than we carry in our dreams.','eng','Christopher Columbus','389b732d13615b4a532a29babf326dfb',NULL),
(2127,'Postupně se jeden pohybuje daleko.',0,'Little by little, one travels far.','eng','J.R.R. Tolkien','ebcaf4dd7c7f18bbae59055181b35737',NULL),
(2128,'Jste tím, čím si myslíte, že jste.',0,'You are what you believe yourself to be.','eng','Paulo Coelho','6687bb1e20f05f1bdfa9622f43360f3b',NULL),
(2129,NULL,0,'Remembering that you are going to die is the best way I know to avoid the trap of thinking you have something to lose.','eng','Steve Jobs','56d0d3248ccfd680802034c9f1e90a9d',NULL),
(2130,'Strach ze slabosti pouze posiluje slabost.',0,'A fear of weakness only strengthens weakness.','eng','Criss Jami','7abb891bf78f01e248f19a4955ea7823',NULL),
(2131,NULL,0,'You must learn to let go. Release the stress. You were never in control anyway.','eng','Steve Maraboli','932319741a16f1935352bfce28bbcc53',NULL),
(2132,NULL,0,'Tall oaks grow from little acorns.','eng','Andrew Carnegie','01b396040efbcf9be07249f266275e45',NULL),
(2133,'Buďte zdvořilí ke všem, ale intimní s několika.',0,'Be polite to all, but intimate with few.','eng','Thomas Jefferson','6de5dd320feaa8ad708cad3f3257bcd7',NULL),
(2134,'Pokud chcete dobře pracovat, vyberte rušného muže;',0,'If you want work well done, select a busy man; the other kind has no time.','eng','Elbert Hubbard','dabccf3734d25b36bcb1dca7fd0a7432',NULL),
(2135,'Nezáleží na tom, kde jste, nejste nikde ve srovnání s tím, kam můžete jít.',0,'It doesn\'t matter where you are, you are nowhere compared to where you can go.','eng','Bob Proctor','f80dd219c5265f88a7b7f00d6696f850',NULL),
(2136,NULL,0,'Always keep your eyes open. Keep watching. Because whatever you see can inspire you.','eng','Grace Coddington','799b63b267caca4da9fe3a3d05f9b3d2',NULL),
(2137,'Nejlepší cenou, kterou život může nabídnout, je šance tvrdě pracovat v práci, která stojí za to udělat.',0,'Far and away the best prize that life has to offer is the chance to work hard at work worth doing.','eng','Theodore Roosevelt','c32a020199af675bfadb928dfe5bbf10',NULL),
(2138,'Obdivujte co nejvíce. Většina lidí dostatečně neobdivuje.',0,'Admire as much as you can. Most people do not admire enough.','fra','Vincent van Gogh','8319e56efd7e4558d93dce99322983c7',NULL),
(2139,'Kouzlo věří v sebe, pokud to dokážete, můžete se něco stát.',0,'Magic is believing in yourself, if you can do that, you can make anything happen.','eng','Johann Wolfgang von Goethe','57ad7126ccbed32be5e56ed4c7b87f16',NULL),
