(2162,'Pokud se vám nelíbí něco, změní se to. Pokud to můžete změnit, změňte na to svůj postoj. Nestěžujte si.',0,'If you don\'t like something change it. If you can\'t change it, change your attitude about it. Don\'t complain.','fra','Maya Angelou','1504623f34e0020c4a17a698ab40eb13',NULL),
