(2242,'Pokud spustíte, stojíte šanci na ztrátu, ale pokud neběžíte, už jste ztratili.',0,'If you run you stand a chance of losing, but if you don\'t run you\'ve already lost.','eng','Barack Obama','d0b4387970857dab432d347e4822f37a',NULL),
