(2342,NULL,0,'When it hurts - observe. Life is trying to teach you something.','eng','Anita Krizzan','45eb11668e4c2593ee90e2dbdbd21e41',NULL),
(2343,NULL,0,'Showing off is the fool\'s idea of glory.','eng','Bruce Lee','006f904d955f4a6e121f9675ca538f4d',NULL),
(2344,'Odvaha vědí, čeho se nebojí.',0,'Courage is knowing what not to fear.','eng','Plato','2b66e415e1dfa80901abb65b09761f5c',NULL),
(2345,'Změna je způsobena, protože obyčejní lidé dělají mimořádné věci.',0,'A change is brought about because ordinary people do extraordinary things.','eng','Barack Obama','e5697de467e154a71c1859ebe3430d7c',NULL),
(2346,'Můžete si dát rtěnku na prase.',0,'You can put lipstick on a pig. It\'s still a pig.','eng','Barack Obama','5f39e2bd2cb27d12cc7cf66693b2454e',NULL),
(2347,'Mnohem důležitější než to, co víme nebo nevíme, je to, co nechceme vědět.',0,'Far more crucial than what we know or do not know is what we do not want to know.','eng','Eric Hoffer','69061eae247285c4501dd7846eee7132',NULL),
(2348,'Váš život se díky štěstí nezlepšuje, změnou se to zlepšuje.',0,'Your life does not get better by chance, it gets better by change.','fra','Jim Rohn','57d5fca7b05cc54aa5e9bc10a23bc92d',NULL),
(2349,'Soudit muže podle jeho otázek spíše než jeho odpovědi.',0,'Judge a man by his questions rather than his answers.','eng','Voltaire','a9ac5fc0c22258cb551011c8fc828db5',NULL),
(2350,NULL,0,'A comfort zone is a beautiful place, but nothing ever grows there.','eng','Unknown','f610f0cef31f4b89bd8f63e187b873e7',NULL),
(2351,'Láska je výraz svých hodnot.',0,'Love is the expression of one\'s values.','eng','Ayn Rand','abf8451089f26f71b736e604cf42b373',NULL),
(2352,'Vždy můžete změnit názor a vybrat jinou budoucnost nebo jinou minulost.',0,'You\'re always free to change your mind and choose a different future, or a different past.','eng','Richard Bach','8ff59625893f778ee1ded6c35740f856',NULL),
(2353,NULL,0,'Don\'t hate the player. Change the game.','eng','Steve Harvey','cc88de1440435dfca03b27361f980de5',NULL),
(2354,'V životě nebudu chodit dozadu.',0,'I will not walk backward in life.','eng','J.R.R. Tolkien','7f7a2802ca34638ae1c6315c4320d778',NULL),
(2355,NULL,0,'Live simply, expect little, give much.','eng','Norman Vincent Peale','734270807540fe3b378e9e0f4f0e17e1',NULL),
(2356,'Pokud nevíte, je třeba se bát, ale učit se.',0,'If you don\'t know, the thing to do is not to get scared, but to learn.','eng','Ayn Rand','beea3402bdbaa23e4be4356d32f8454e',NULL),
(2357,'Když je nemůžete přimět, aby viděli světlo, přimějte je, aby cítili teplo.',0,'When you can\'t make them see the light, make them feel the heat.','eng','Ronald Reagan','f4cf91239800aeef41de2c8c38123e4c',NULL),
(2358,'Klíčem k nesmrtelnosti je nejprve žít život, který stojí za to zapamatovat.',0,'The key to immortality is first living a life worth remembering.','eng','Bruce Lee','8ff50dc731cfc1d0392f085cd9c041a6',NULL),
(2359,'Naděje a strach pocházejí z pocitu, že nám něco chybí;',0,'Hope and fear come from feeling that we lack something; they come from a sense of poverty.','eng','Pema Chodron','1886cae91c9063d15d63a79bfa852455',NULL),
(2360,NULL,0,'Choose to be optimistic, it feels better.','eng','Dalai Lama','fa179db9aece10b1467dbd5219dae04b',NULL),
(2361,NULL,0,'Do Something. If it works, do more of it. If it doesn\'t, do something else.','eng','Franklin D. Roosevelt','84a4ccfb624dd9143f3390d11348bb0c',NULL),
(2362,'Pokud je ve vašem srdci světlo, najdete cestu domů.',0,'If light is in your heart, you will find your way home.','eng','Rumi','96aa28700818fe73325248c4d39281fa',NULL),
(2363,'Nejlepší je začít na začátku.',0,'It is best to begin at the beginning.','eng','Amelia Earhart','1728d6c7b46d6fc4980a13380c3b083d',NULL),
(2364,'Stupeň odpovědnosti, kterou za svůj život přebíráte, určuje, jak velkou změnu v něm můžete vytvořit.',0,'The degree of responsibility you take for your life determines how much change you can create in it.','eng','Celestine Chua','16c53c452418e15ecc213e75c87b14d2',NULL),
(2365,'Všechno, na co se díváte, se může stát pohádkou a můžete získat příběh ze všeho, čeho se dotknete.',0,'Everything you look at can become a fairy tale and you can get a story from everything you touch.','eng','Hans Christian Andersen','5561bbbca9e1dacca1d125402cfd22a4',NULL),
(2366,NULL,0,'To forget the whole world is easy; to make the whole world forget you is hard.','eng','Zhuangzi','db15d27358b0bd3cfedffbcd428b9a97',NULL),
(2367,'Příroda miluje skrýt.',0,'Nature loves to hide.','spa','Heraclitus','f219681e060bbc3be5f3fea1faba0dda',NULL),
(2368,'Pokud máte rádi život, neztrácejte čas, na čas je to život.',0,'If you love life, don\'t waste time, for time is what life is made up of.','eng','Bruce Lee','a78735dfd49f960643afe6b14630c7cc',NULL),
(2369,'Znalost sebe sama je začátkem veškeré moudrosti.',0,'Knowing yourself is the beginning of all wisdom.','eng','Aristotle','80b2d8797e7f93749012867dc9a0d07b',NULL),
(2370,'Nedovolte, aby hluk druhých utopil svůj vlastní vnitřní hlas.',0,'Don\'t let the noise of others\' opinions drown out your own inner voice.','fra','Steve Jobs','98a18189dffde9322066145af59c1444',NULL),
(2371,'Dobrodružství není venku;',0,'Adventure is not outside man; it is within.','eng','George Eliot','df7711d2418efe4bfc452acdc1ee9148',NULL),
(2372,'Život není problém, který je třeba vyřešit, ale realita, která má být prožívána.',0,'Life is not a problem to be solved, but a reality to be experienced.','eng','Soren Kierkegaard','704aae5ea06bd9528da1973e77cc8572',NULL),
(2373,'Důvěřujte sebe: každé srdce vibruje na ten železný strunu.',0,'Trust thyself: every heart vibrates to that iron string.','eng','Ralph Waldo Emerson','a6bc45699755d31143f9670af6d951ad',NULL),
(2374,'Rozdíl mezi zradou a vlastenectvím je jen otázkou dat.',0,'The difference between treason and patriotism is only a matter of dates.','eng','Alexandre Dumas','b89874fca2bc02a068737be51d530853',NULL),
(2375,NULL,2,'A man with outward courage dares to die: a man with inner courage dares to live.','por','Lao Tzu','5b2c29a1096b1d282911ae2608cf174c',NULL),
(2376,'Hlavním nebezpečím v životě je, že můžete přijmout příliš mnoho preventivních opatření.',0,'The chief danger in life is that you may take too many precautions.','eng','Alfred Adler','0daf368b0c2ca19ba7f1737fb0e43395',NULL),
(2377,'Podařilo se mi to, co si myslí všichni ostatní.',0,'I succeeded by saying what everyone else is thinking.','eng','Joan Rivers','8ad06af39406f19138d0e33b8f776546',NULL),
(2378,'Projděte se směrem k slunci a stíny padnou za vámi.',0,'Walk towards the sunshine, and the shadows will fall behind you.','eng','Mary Engelbreit','906ab4ec9a968b7d7c784b2372ac3796',NULL),
(2379,'Neúspěch znamená, že jste se nyní naučili další cennou lekci, která vás tlačí o krok blíže k úspěchu.',0,'Failure means you\'ve now learned another valuable lesson that pushes you one step closer to success.','eng','Steve Harvey','93619fe95ae39363c13ea505c6ee956f',NULL),
(2380,'Váš účel bude jasný pouze tehdy, když posloucháte své srdce.',0,'Your purpose will be clear only when you listen to your heart.','eng','Lolly Daskal','9f69eb15427b24db36e462bfcd39c498',NULL),
(2381,'Tragédie je nástroj pro život, aby získal moudrost, nikoli průvodce, kterým žít.',0,'Tragedy is a tool for the living to gain wisdom, not a guide by which to live.','eng','Robert F. Kennedy','7cae154b5f3642ee542a08c18980710d',NULL),
(2382,'Žijete podle toho, na co vzrušujete, a je tu konec.',0,'You live by what you thrill to, and there\'s the end of it.','eng','D. H. Lawrence','bd5c61d4af42d238fb471de11fef6b1a',NULL),
(2383,'Když se dostanete na vrchol hory, pokračujte v lezení.',0,'When you reach the top of the mountain, keep climbing.','eng','Zen Proverb','3a2caf2465966714b28c8ea5a6dfbc63',NULL),
(2384,'Někdy je důležitější zjistit, co člověk nemůže udělat, než co člověk může udělat.',0,'Sometimes it is more important to discover what one cannot do, than what one can do.','eng','Lin Yutang','bb97f9394592b0153e29661b830e8f3e',NULL),
(2385,NULL,2,'We can change our lives. We can do, have, and be exactly what we wish.','eng','Tony Robbins','628e1052ea0915203ad833aa75bb3020',NULL),
(2386,NULL,0,'The mind is the limit.','eng','Arnold Schwarzenegger','d7ddee58061722b89f9eb0a9312a2571',NULL),
(2387,'Nejvyšší forma nevědomosti je, když odmítáte něco, o čem nic nevíte.',0,'The highest form of ignorance is when you reject something you don\'t know anything about.','eng','Wayne Dyer','9c360e95637fc626d972bd3372641729',NULL),
(2388,'Nejsilnější a nejsladší písně ještě musí být zpívány.',0,'The strongest and sweetest songs yet remain to be sung.','eng','Walt Whitman','213d04f0e32f575e1ef687587a43d253',NULL),
(2389,'Život je tanečník a ty jsi tanec.',0,'Life is the dancer and you are the dance.','eng','Eckhart Tolle','f179d180ad0374c3b21d175dcd181c55',NULL),
(2390,'Pozorujte věci tak, jak jsou, a nevěnujte pozornost ostatním lidem.',0,'Observe things as they are and don\'t pay attention to other people.','eng','Huang Po','5b568e937c3503b6adba7a581d5739d7',NULL),
(2391,'Mohu žít bez peněz, ale nemohu žít bez lásky.',0,'I can live without money, but I cannot live without love.','eng','Judy Garland','01eb051d291ea94bdc3b78d12947bc10',NULL),
(2392,'Ti, kteří jsou snadno šokováni, by měli být šokováni častěji.',0,'Those who are easily shocked should be shocked more often.','eng','Mae West','cfcc633443a77e6a096ac40a7e574340',NULL),
(2393,'Pokud chcete být úspěšní, musíte skočit, neexistuje způsob, jak to.',0,'If you want to be successful, you have to jump, there\'s no way around it.','eng','Steve Harvey','fc08e8ee41f6399c54bcabd17645ea05',NULL),
(2394,'Jsou to ti, kteří se soustředí na jednu věc najednou, kteří postupují v tomto světě.',0,'It is those who concentrate on but one thing at a time who advance in this world.','eng','Gary Keller','27b1ec7418a8e93352f2c066c0673f24',NULL),
(2395,'Říkat nic někdy neříká nejvíce.',0,'Saying nothing sometimes says the most.','eng','Emily Dickinson','758f1724d561a0662e79ee389c06128b',NULL),
(2396,'Ti, kteří hledají snadný způsob, nehledají skutečný způsob.',0,'Those who seek the easy way do not seek the true way.','eng','Dogen','4f9351ddf3ca29fdb1618a9d70ed2578',NULL),
(2397,'Všechny problémy jsou iluze mysli.',0,'All problems are illusions of the mind.','eng','Eckhart Tolle','146c2407f1be4fdf7f4b4198525b3101',NULL),
(2398,NULL,0,'Everything is in your own heart.','eng','Thich Nhat Hanh','3c805a4a2f52482c1281a820f2c54534',NULL),
(2399,'Ztráta není nic jiného než změna a změna je potěšením přírody.',0,'Loss is nothing else but change and change is nature\'s delight.','eng','Marcus Aurelius','b466657834704fad5acb9ecc503184c0',NULL),
(2400,NULL,0,'A path is made by walking on it.','eng','Zhuangzi','2e3c46e70215da296fcf1229668968e7',NULL),
(2401,NULL,2,'Believe in yourself! Have faith in your abilities! Without a humble but reasonable confidence in your own powers you cannot be successful or happy.','eng','Norman Vincent Peale','70451789f26a158adb4a968b6cd28560',NULL),
(2402,NULL,0,'Have the courage to follow your heart and intuition. They somehow know what you truly want to become.','eng','Steve Jobs','de87dd6d0e64cc6353fbafdab8d887a7',NULL),
(2403,'Mír začíná úsměvem.',0,'Peace begins with a smile.','eng','Mother Teresa','67f523297581fae9db3ef4651db4aec5',NULL),
(2404,'Nejste přilepeni tam, kde jste, pokud se nerozhodnete.',0,'You are not stuck where you are unless you decide to be.','fra','Wayne Dyer','d6f21fac9c8952f48181cf56f70d01b7',NULL),
(2405,'Den je pro poctivé muže, noc pro zloděje.',0,'The day is for honest men, the night for thieves.','eng','Euripides','70f584e07ef4c0fcd6640805f40e10e8',NULL),
(2406,'Raději bych přivítal změnu, než se držet minulosti.',0,'I\'d rather welcome change than cling to the past.','eng','Robert Kiyosaki','4e4ddfdec31b1f7515a5fb31b229d625',NULL),
(2407,NULL,0,'Don\'t be pushed by your problems; be led by your dreams.','fra','Unknown','57d1981558b854e8744c1f8cd39d148d',NULL),
(2408,'Nevzdávejte se svých snů, jinak se vás vaše sny vzdá.',0,'Don\'t give up on your dreams, or your dreams will give up on you.','eng','John Wooden','023d69e440b15181112ee1ccc5974036',NULL),
(2409,'Čím více přebíráte odpovědnost za svou minulost a současnost, tím více dokážete vytvořit budoucnost, kterou hledáte.',0,'The more you take responsibility for your past and present, the more you are able to create the future you seek.','eng','Celestine Chua','764c7e08a3604856345586fed6ed37b9',NULL),
(2410,'Pamatujte, že vchod do svatyně je uvnitř vás.',0,'Remember the entrance to the sanctuary is inside you.','eng','Rumi','3f8482206b1050ced8a072dc80eaca01',NULL),
(2411,NULL,0,'Resilience is not what happens to you. It\'s how you react to, respond to, and recover from what happens to you.','eng','Jeffrey Gitomer','ddbf27ada9956cfedac8d20e34fe166f',NULL),
(2412,'Každý, kdo se přestane učit, je starý, ať už na dvacet nebo osmdesát.',0,'Anyone who stops learning is old, whether at twenty or eighty. Anyone who keeps learning stays young.','eng','Henry Ford','5ae0c5756b8b66996855da56cb3d1b7a',NULL),
(2413,'Nakonec si nebudeme pamatovat slova našich nepřátel, ale ticho našich přátel.',0,'In the End, we will remember not the words of our enemies, but the silence of our friends.','eng','Martin Luther King, Jr.','30d499947cbf2a93409551dbac1e6eb2',NULL),
(2414,NULL,2,'You have power over your mind - not outside events. Realize this, and you will find strength.','eng','Marcus Aurelius','f834bc95d08a44ee03259eaea87ffc97',NULL),
(2415,NULL,0,'The Truth is realized in an instant; the Act is practiced step by step.','eng','Seungsahn','9c1a1dcc118011e4caf70887e8c37235',NULL),
(2416,'Všechna náboženství, umění a vědy jsou větve stejného stromu.',0,'All religions, arts and sciences are branches of the same tree.','eng','Albert Einstein','c716e8e9bc7b3eac77b8f724d2d7a3fa',NULL),
(2417,NULL,0,'Convinced myself, I seek not to convince.','eng','Edgar Allan Poe','76fe685b5b5292e83949e6c8f0c8f640',NULL),
(2418,NULL,0,'Tradition is the illusion of permanence.','eng','Woody Allen','b7867d4ac17d19d6f7b32997b897755a',NULL),
(2419,'Jste průměrem pěti lidí, se kterými trávíte nejvíce času.',0,'You are the average of the five people you spend the most time with.','eng','Jim Rohn','39d2688de48b1a164403409031125804',NULL),
(2420,'Štěstí lze najít, i když nejtemnější časy, pokud si člověk pamatuje pouze zapnout světlo.',0,'Happiness can be found, even in the darkest of times, if one only remembers to turn on the light.','eng','Albus Dumbledore','a98d71161d07cbc2bcad5db058557f70',NULL),
(2421,NULL,0,'There are two ways of seeing: with the body and with the soul. The body\'s sight can sometimes forget, but the soul remembers forever.','eng','Alexandre Dumas','096837f0254d66b52d75549bf8276b8a',NULL),
(2422,NULL,0,'Love and compassion are necessities, not luxuries. Without them, humanity cannot survive.','eng','Dalai Lama','23952fcb821323db9b476d4a84d3107a',NULL),
(2423,'Na konferenci se nikdy nenarodil žádný velký nápad, ale zemřelo tam mnoho pošetilých nápadů.',0,'No grand idea was ever born in a conference, but a lot of foolish ideas have died there.','eng','F. Scott Fitzgerald','607c5fe4ab1ccdf4fbdc4d4a1e37d10b',NULL),
(2424,'Jsem dnes tím, kým jsem kvůli možnostem, které jsem udělal včera.',0,'I am who I am today because of the choices I made yesterday.','eng','Eleanor Roosevelt','4be869598fa11f5ed8573d656141e738',NULL),
(2425,'Lidé nerozhodují o své budoucnosti, rozhodují o svých návycích a jejich návyky rozhodují o jejich budoucnosti.',0,'People do not decide their futures, they decide their habits and their habits decide their futures.','eng','Gary Keller','54f4edad6a628fc5cf63d7f0e911a4ba',NULL),
(2426,'V životě nemůžeme vždy dělat skvělé věci, ale můžeme dělat malé věci s velkou láskou.',0,'We cannot always do great things in life, but we can do small things with great love.','eng','Dan Millman','6f8987ef5bf7e92efe6aae77066dabef',NULL),
(2427,NULL,0,'Dark times lie ahead of us and there will be a time when we must choose between what is easy and what is right.','eng','Albus Dumbledore','1b2cd5c8d78cb09424ba7f64b86d2e58',NULL),
(2428,'Nezáleží na mužích ve vašem životě, ale na životě ve vašich mužích.',1,'It\'s not the men in your life that matters, it\'s the life in your men.','eng','Mae West','4b050327bb25d068d2b8a5e1b27f19e0',NULL),
(2429,'Váš duch je skutečný štít.',0,'Your spirit is the true shield.','eng','Morihei Ueshiba','fa977693b7cb49fac05c6e85e85f5ae8',NULL),
(2430,'Nejúčinnějším způsobem, jak to udělat, je to udělat.',0,'The most effective way to do it, is to do it.','eng','Amelia Earhart','66ceb876a1acfd1d766f2f33de6ea665',NULL),
(2431,'Slova, jakmile jsou vytištěny, mají vlastní život.',0,'Words, once they are printed, have a life of their own.','eng','Carol Burnett','04cfb0b70214a0e34749fc9345ad5b2e',NULL),
(2432,NULL,2,'Time goes from present to past.','por','Shunryu Suzuki','509eb86a1123c05e2cd71c8c551827e8',NULL),
(2433,'Dávání lásky je samo o sobě vzdělání.',0,'The giving of love is an education in itself.','eng','Eleanor Roosevelt','dae6f455952bc2266b523438f168addd',NULL),
(2434,'Samotnou podstatou instinktu je, že je sledován nezávisle na rozumu.',0,'The very essence of instinct is that it\'s followed independently of reason.','eng','Charles Darwin','f4b7ef2f8e1a6a43c6f6227eff7c7358',NULL),
(2435,'Přál si, abys byl někdo jiný, je ztrácet osobu, kterou jste.',0,'To wish you were someone else is to waste the person you are.','eng','Unknown','007c52a80138b81d0ecdc86410d0640f',NULL),
(2436,'Naučte se pravidla jako profesionál, takže je můžete rozbít jako umělec.',0,'Learn the rules like a pro, so you can break them like an artist.','eng','Pablo Picasso','0c3dff91adaa6367be9cf8d292a103be',NULL),
(2437,NULL,0,'Obstacles can\'t stop you. Problems can\'t stop you. Most of all, other people can\'t stop you. Only you can stop you.','eng','Jeffrey Gitomer','0f7fc5dcad4e1cf3b8dad731a54211c5',NULL),
(2438,'Nic není příliš vysoké na to, aby se člověk mohl dostat, ale musí se pečlivě vylézt',0,'Nothing is too high for a man to reach, but he must climb with care and confidence','eng','Hans Christian Andersen','1a5f1f65e38dcc2a961d6b378abbe16a',NULL),
(2439,'Mentor je někdo, kdo ve vás vidí více talentu a schopností, než vidíte v sobě, a pomáhá ho z vás vynést.',0,'A mentor is someone who sees more talent and ability within you, than you see in yourself, and helps bring it out of you.','eng','Bob Proctor','b372265e77a9f044e410ad446a2b09e5',NULL),
(2440,NULL,0,'Positive thinking can be contagious. Being surrounded by winners helps you develop into a winner.','eng','Arnold Schwarzenegger','5855233b0dfc7d61dad1096cd1a1b66c',NULL),
(2441,'Buďte vděční za všechno, co se ve vašem životě děje;',0,'Be thankful for everything that happens in your life; it\'s all an experience.','eng','Roy T. Bennett','0a9e615c53d969e4dba3bc0d32abca09',NULL),
(2442,'Život je láska a láska je život.',0,'Life is love and love is life.','eng','Elvis Presley','175cc53f33b95a5f2f8072cd6717d207',NULL),
(2443,'Pokud nežijete každý den s vzrušením, energií a vášní, pak nežijete věrní svému životnímu účelu.',0,'If you are not living each day with excitement, energy, and passion, then you are not living true to your life purpose.','eng','Celestine Chua','5da3d71d1d4b0cb7b34e606cbb425a6e',NULL),
(2444,'Skvělé činy jsou tvořeny malými skutky.',0,'Great acts are made up of small deeds.','eng','Lao Tzu','a74d79cc14c082d7d49c2d6715b2093a',NULL),
(2445,'Muž, který přesunul horu, byl ten, kdo začal přenášet nejmenší kameny.',0,'The man who moved the mountain was the one who began carrying away the smallest stones.','eng','Zen Proverb','0bf755286904aa1d16d6daa576f508a5',NULL),
(2446,'Porucha je dálnice k úspěchu.',0,'Failure is the highway to success.','eng','Og Mandino','8627241f455e1fc1114fd88e4f26a075',NULL),
(2447,'Vytváříme řetězy, které nosíme v životě.',0,'We forge the chains we wear in life.','eng','Charles Dickens','0ec9d1fcc4bed651b1b1d90cc439ab67',NULL),
(2448,'Možná si myslíte, že jsem malý, ale mám uvnitř své mysli vesmír.',0,'You may think I\'m small, but I have a universe inside my mind.','eng','Yoko Ono','e37176e1657d25a05048cb299a8ac4a7',NULL),
