(2564,'Když je něco dost důležité, uděláte to, i když šance nejsou ve váš prospěch.',0,'When something is important enough, you do it even if the odds are not in your favor.','eng','Elon Musk','66e364b6ce5fc49a7e470392dbe1bf68',NULL),
