(2567,NULL,0,'You have a brain and mind of your own. Use it, and reach your own decisions.','eng','Napoleon Hill','7fc59d83d72ab893117cc08c8adb0484',NULL),
(2568,'Chyby jsou vždy odpuštěny, pokud má člověk odvahu je přiznat.',0,'Mistakes are always forgivable, if one has the courage to admit them.','eng','Bruce Lee','2ea2c28d48ad769f300292e5633fe5b1',NULL),
