(2759,NULL,0,'It is not because things are difficult that we do not dare; it is because we do not dare that things are difficult.','eng','Seneca','f33cc9b06033e6328ed8208519588a86',NULL),
(2760,NULL,0,'It doesn\'t matter where you are coming from. All that matters is where you are going.','eng','Brian Tracy','d323a68c8d43c3d7c64f04b8a3502e27',NULL),
(2761,'Čas uzdravuje, jaký důvod nemůže.',0,'Time heals what reason cannot.','eng','Seneca','22c842dc7a564e769cf1259f1a63c77f',NULL),
(2762,'Skutečné učení se objevuje, když konkurenční duch přestal.',0,'Real learning comes about when the competitive spirit has ceased.','fra','Jiddu Krishnamurti','9e327fe821b72c0df47a7b1ce1b01f6b',NULL),
(2763,'Pamatujte, že někdy nedostanete to, co chcete, je nádherný úder štěstí.',0,'Remember that sometimes not getting what you want is a wonderful stroke of luck.','eng','Dalai Lama','274922e145eb297ea55bdb370d81d285',NULL),
(2764,'Schopnost pozorovat bez hodnocení je nejvyšší formou inteligence.',0,'The ability to observe without evaluating is the highest form of intelligence.','eng','Jiddu Krishnamurti','0c00e2c24fbd86c1fc641fad4b79b43a',NULL),
(2765,'Nebývejte v minulosti, nesníte o budoucnosti, soustřeďte mysl na tento okamžik.',0,'Do not dwell in the past, do not dream of the future, concentrate the mind on the present moment.','eng','Buddha','98035545bdaa1864c540aa96c2e7796e',NULL),
(2766,'Ten, kdo ví nejlépe ví, jak málo ví.',0,'He who knows best knows how little he knows.','eng','Thomas Jefferson','3abd84b2d929de3b1680ea6b4a4a598c',NULL),
(2767,'Rozdejte to, co se nejvíce chcete vrátit.',0,'Give out what you most want to come back.','fra','Robin Sharma','0c2623658daa6dca229854672dd5d36e',NULL),
(2768,'Dobře znáte pravidla, takže je můžete efektivně rozbít.',0,'Know the rules well, so you can break them effectively.','eng','Dalai Lama','ec5a12ea387003309818d18f62c0bfec',NULL),
(2769,'Vaše mysl je nekonečná, jsou to vaše pochybnosti, které omezují.',0,'Your mind is infinite, it\'s your doubts that are limiting.','eng','Robert Kiyosaki','e4fba51a895d51ccdad608645459f869',NULL),
(2770,'Nové názory jsou vždy podezřelé a obvykle proti, bez jakéhokoli jiného důvodu, ale proto, že nejsou běžné.',0,'New opinions are always suspected, and usually opposed, without any other reason but because they are not common.','eng','John Locke','190414243589b1e354a13d939689ebcf',NULL),
(2771,NULL,0,'Do not take life too seriously. You will never get out of it alive.','eng','Elbert Hubbard','92533f88eaccbc182783f3529323c5a9',NULL),
(2772,'Když máte sen, musíte ho chytit a nikdy se pustit.',0,'When you have a dream, you\'ve got to grab it and never let go.','eng','Carol Burnett','aa6854181d64df6c0e182395686ebb3f',NULL),
(2773,'Představivost je skutečný magický koberec.',0,'Imagination is the true magic carpet.','eng','Norman Vincent Peale','ad50820114b1f10b3c85aea2541a14cd',NULL),
(2774,NULL,0,'Raise your words, not voice. It is rain that grows flowers, not thunder.','eng','Rumi','9748cec5c90cc16221687f64307e8e9e',NULL),
(2775,'Ten, kdo si přeje být poslouchán, musí vědět, jak přikázat.',0,'He who wishes to be obeyed must know how to command.','eng','Niccolo Machiavelli','a977361f6ac10cc187110158697306b0',NULL),
(2776,'Vaše štěstí je to, na čem je nejdůležitější.',0,'Your happiness is what truly matters most. Do what you have to do in order to be happy.','eng','Brian Tracy','ef374541c62ef64249b21ff3e9b73805',NULL),
(2777,'Tichí lidé mají nejhlasitější mysl.',0,'Quiet people have the loudest minds.','fra','Stephen King','b32c96277f98174b5304b26d841c12c4',NULL),
(2778,'Muž, který si cení sám sebe, nemůže nic ocenit.',0,'The man who does not value himself, cannot value anything or anyone.','eng','Ayn Rand','edc37e5fc1f41b9ffb6df59acc5bd5b4',NULL),
(2779,'Pokud nenajdete čas, pokud neděláte práci, nedostanete výsledky.',0,'If you don\'t find the time, if you don\'t do the work, you don\'t get the results.','eng','Arnold Schwarzenegger','cb23940775da748d8a7cd2156cd7ad7e',NULL),
(2780,'Každý může stoupat nad jejich okolnosti a dosáhnout úspěchu, pokud jsou věnováni a vášniví, co dělají.',0,'Everyone can rise above their circumstances and achieve success if they are dedicated to and passionate about what they do.','eng','Nelson Mandela','564cee58de706f88ab5737813dfc87a5',NULL),
(2781,'Život a jeho jednoduchá krása je příliš dobrá na to, aby se předala.',0,'Life and the simple beauty of it is too good to pass up.','eng','Christopher McCandless','741477dbfec3318119a1fdc4300d9724',NULL),
(2782,NULL,0,'Failure is the key to success; each mistake teaches us something.','eng','Morihei Ueshiba','dca7091449f3c7381b34aa1b2eefbfe6',NULL),
(2783,'Pokud vždy děláte to, co jste vždy udělali, vždy dostanete to, co jste vždy dostali.',0,'If you always do what you\'ve always done, you\'ll always get what you\'ve always got.','fra','Henry Ford','295582af57bac2efe14221f318049103',NULL),
(2784,'V každém okamžiku rozhodnutí je nejlepší věc, kterou můžete udělat, správná věc.',0,'In any moment of decision, the best thing you can do is the right thing. The worst thing you can do is nothing.','eng','Theodore Roosevelt','14e97321d3e3f1d1b73b355f1f02488b',NULL),
(2785,'Pokud nekonesíte já, bude vás dobytí já.',0,'If you do not conquer self, you will be conquered by self.','eng','Napoleon Hill','08bcdff6a2937cd2e5c90f40820baf3f',NULL),
(2786,'Pokud nemáte sílu, abyste naživovali své vlastní podmínky, musíte přijmout podmínky, které vám nabízí.',0,'If you haven\'t the strength to impose your own terms upon life, then you must accept the terms it offers you.','eng','T.S. Eliot','6b8b266a9af806a6a2d7ba4fff621801',NULL),
(2787,'Možná nebudeme zodpovědní za svět, který vytvořil naši mysl, ale můžeme převzít odpovědnost za mysl, se kterou vytváříme náš svět.',0,'We may not be responsible for the world that created our minds, but we can take responsibility for the mind with which we create our world.','eng','Gabor Mate','5f45c46ebd2b23aefbe655efea53f675',NULL),
(2788,'Spíše než láska, než peníze, než sláva, mi dejte pravdu.',0,'Rather than love, than money, than fame, give me truth.','eng','Henry David Thoreau','d220c1672c2e0460a49983158665e52f',NULL),
(2789,NULL,0,'Change begets change. Nothing propagates so fast.','eng','Charles Dickens','f23e34c92dd4c6747378ce800c75a54f',NULL),
(2790,'Neúspěch je prostě příležitost začít znovu, tentokrát inteligentněji.',0,'Failure is simply the opportunity to begin again, this time more intelligently.','eng','Henry Ford','99bec45c4bee23b38225195ce8a54cd7',NULL),
(2791,'Osoba, která nikdy neudělala chybu, nikdy nezkoušela nic nového.',0,'The person who never made a mistake never tried anything new.','eng','Albert Einstein','6c35e7d5ed6e65af6e350c11c1e9c148',NULL),
(2792,'Navždy je složen z nyní.',0,'Forever is composed of now\'s.','eng','Emily Dickinson','2e1de4ed0b1367547342569c22c889b6',NULL),
(2793,NULL,0,'No one can compete with you on being you. Most of life is a search for who and what needs you the most.','eng','Naval Ravikant','d0cb4496b90e8e5e65feb6bb5f7454c5',NULL),
(2794,'Pokud si myslíte, že je dobrodružství nebezpečné, zkuste rutinu; je to smrtelné.',0,'If you think adventure is dangerous, try routine; it is lethal.','fra','Paulo Coelho','c7af0f78d9966d91418778850c68e0b3',NULL),
(2795,'Ať už děláte cokoli, snažte se to udělat tak dobře, že žádný muž, který žije a žádný muž mrtvý a žádný člověk, který se ještě narodil, to nemohl udělat lépe.',0,'Whatever you do,strive to do it so well that no man living and no man dead and no man yet to be born could do it any better.','eng','Benjamin Mays','ab01910c5c28e58450e2af9e872567ba',NULL),
(2796,'Čím tišší se stanete, tím více jste schopni slyšet.',0,'The quieter you become, the more you are able to hear.','eng','Rumi','4992a316029b8c012017f0215b829a15',NULL),
(2797,'To, co udržuje život fascinující, je neustálá kreativita duše.',0,'What keeps life fascinating is the constant creativity of the soul.','eng','Deepak Chopra','b0a0635ce8731a9e5be7569ebe79ae37',NULL),
(2798,'Ti, kteří jsou osvíceni, se nikdy nepřestávají kování.',0,'Those who are enlightened never stop forging themselves.','eng','Morihei Ueshiba','8eb34caa2e5e6c05b6cd6896e193cbbe',NULL),
(2799,NULL,0,'We\'re kept from our goal not by obstacles, but by a clear path to a lesser goal.','por','Bhagavad Gita','ca5bcc4d16db876f388717e44143e45e',NULL),
(2800,'Jedinou obranou proti světu je o tom důkladná znalost.',0,'The only defense against the world is a thorough knowledge of it.','eng','John Locke','296b7b21db5db11bd5116f0c8fd3a407',NULL),
(2801,'Pokud jste znali jen velkolepost 3, 6 a 9, pak byste měli klíč k vesmíru.',0,'If you only knew the magnificence of the 3, 6, and 9, then you would have a key to the universe.','eng','Nikola Tesla','0c8704e3b0cb82e2909d893c3b6858b8',NULL),
(2802,'Během našich nejtemnějších okamžiků se musíme soustředit na světlo.',0,'It is during our darkest moments that we must focus to see the light.','eng','Aristotle','9f014b790f272b27d733ddea9024af35',NULL),
(2803,'Někteří muži vidí věci tak, jak jsou, a ptají se proč.',0,'Some men see things as they are and ask why. Others dream things that never were and ask why not.','eng','George Bernard Shaw','930ea93675c3c7e7799959fedf057c0a',NULL),
(2804,'Pokud někdo opravdu nemá moc říci ne, nikdy nemá opravdu moc říct ano.',0,'Unless someone truly has the power to say no, they never truly have the power to say yes.','eng','Dan Millman','ff690917238ca819fe55997168c8f038',NULL),
(2805,'Ten, kdo může mít trpělivost, může mít to, co chce.',0,'He that can have patience can have what he will.','fra','Benjamin Franklin','6bdde5563f4f3cfd482a5d267ed5b759',NULL),
(2806,'Nic nedává jedné osobě tolik výhody oproti druhému, že zůstane vždy chladný a za všech okolností.',0,'Nothing gives one person so much advantage over another as to remain always cool and unruffled under all circumstances.','eng','Thomas Jefferson','add1eae9b8f5a5be18e153a3ddc00b79',NULL),
(2807,'Vaše vize budou jasné, pouze pokud se můžete podívat do svého vlastního srdce.',0,'Your visions will become clear only when you can look into your own heart. Who looks outside, dreams; who looks inside, awakes.','eng','Carl Jung','f73caa5104867709fa33a9a5a5bfaa35',NULL),
(2808,NULL,2,'Question everything. Learn something. Answer nothing.','eng','Euripides','3beee125b25bbe5fd4ba3458630a851d',NULL),
(2809,NULL,0,'Take care of your body. It\'s the only place you have to live.','eng','Jim Rohn','401c193590b30ed9425d0129fc9e4e27',NULL),
(2810,'Držte se dál od lidí, kteří se snaží omezit vaše ambice.',0,'Keep away from people who try to belittle your ambitions.','eng','Mark Twain','0dd1fd19cbe19959466ab478f3829c0c',NULL),
(2811,NULL,0,'I must also have a dark side if I am to be whole.','eng','Carl Jung','0ab2378ab0a4cabcb621f38b8f5fde4d',NULL),
(2812,'Vaše jediná omezení jsou ta, která jste nastavili ve své mysli, nebo umožňují ostatním nastavit pro vás.',0,'Your only limitations are those you set up in your mind or permit others to set up for you.','eng','Og Mandino','4da233e3044e9698cb63f8e849d85fe7',NULL),
(2813,'Pokud to, co děláte, není vaše vášeň, nemáte co ztratit.',0,'If what you\'re doing is not your passion, you have nothing to lose.','eng','Celestine Chua','d59759a661ee3f00a54c6e3b9cf2d307',NULL),
(2814,'Udělejte každý den své mistrovské dílo.',0,'Make each day your masterpiece.','fra','John Wooden','8a1b9ef5264c7b1729e70ac3adc259a4',NULL),
(2815,'Hlavním nepřítelem kreativity je dobrý smysl.',0,'The chief enemy of creativity is good sense.','eng','Pablo Picasso','8b57c327061478472872eae52b3eb8d0',NULL),
(2816,NULL,0,'There are only two ways to live your life. One is as if nothing is a miracle. The other is as if everything is a miracle.','eng','Albert Einstein','ce39082bd4dceacab12fbc0b4cb4dcd3',NULL),
(2817,'Pouze ten, kdo nemá pro Impérium, je způsobilý, aby byl svěřen.',0,'Only he who has no use for the empire is fit to be entrusted with it.','eng','Zhuangzi','4f68535f20fdf26d65fa5f73c61d9c19',NULL),
(2818,'Pachnutí nepřestanou být omyly, protože se stanou módou.',0,'Fallacies do not cease to be fallacies because they become fashions.','eng','Gilbert Chesterton','75e940200ea30372d4d03a9ed83cced7',NULL),
(2819,'Jděte a udělejte věci, které nemůžete.',0,'Go and do the things you can\'t. That is how you get to do them.','eng','Pablo Picasso','383eae0855bdcee44345a20a066c248b',NULL),
(2820,NULL,0,'I am not absentminded. It is the presence of mind that makes me unaware of everything else.','eng','Gilbert Chesterton','acc1115e24b0dc98418e9c28513b08f8',NULL),
(2821,'Pokud pronásledujete dva králíky, žádné chytíte.',0,'If you chase two rabbits, you catch none.','eng','Confucius','3368e7d677978c6ac7612e30b9f1045e',NULL),
(2822,NULL,0,'The seasons do not push one another; neither do clouds race the wind across the sky. All things happen in their own good time.','eng','Dan Millman','c02081945dd14d8195565debb5f2ed56',NULL),
(2823,'Když tančíte, vaším účelem není dostat se na určité místo na podlaze.',0,'When you dance, your purpose is not to get to a certain place on the floor. It\'s to enjoy each step along the way.','eng','Wayne Dyer','be5fea8c901956c394aa2029e71fe19a',NULL),
(2824,'Nikdy nenechte své vzpomínky větší než vaše sny.',0,'Never let your memories be greater than your dreams.','fra','Doug Ivester','61cf26c0e2ec39ddbfd8ab03c87ba072',NULL),
(2825,NULL,0,'At the center of your being you have the answer; you know who you are and you know what you want.','eng','Lao Tzu','f4cac950557a92eaf5e36b2f8738ee5b',NULL),
(2826,'Mezi lidskými bytostmi existuje velmi hluboké spojení.',0,'There\'s a very deep connection among human beings. All we have to do is open our minds to it.','eng','Yanni','8d818edf515c282c75b20d51a9609be2',NULL),
(2827,'Nikdy nemůžete překročit oceán, pokud nemáte odvahu ztratit ze zřetele břeh.',0,'You can never cross the ocean unless you have the courage to lose sight of the shore.','eng','Christopher Columbus','d361b0c8eaacb694cde8b85cb794ffbb',NULL),
(2828,'Pokud by nikdo nikdy neporušil pravidla, nikdy bychom nepokročili.',1,'If no one ever broke the rules, then we\'d never advance.','eng','Simon Sinek','9cde2d97329ef02be5bd64000a567977',NULL),
(2829,'Vyprázdněte svou mysl, buďte bez formy, bez tvaru, jako voda.',1,'Empty your mind, be formless, shapeless, like water.','eng','Bruce Lee','e596c318ed1d342e5f6a04a5fa9d3dcc',NULL),
(2830,NULL,0,'Nothing is hopeless; we must hope for everything.','eng','Euripides','4a5ff1d04315624937c82e517e46fac8',NULL),
(2831,'Všichni se vzdáme velkých očekávání.',0,'We all give up great expectations along the way.','eng','Carlos Ruiz Zafon','74ccb06708facf4a48e2ce2d2b5e6d8b',NULL),
(2832,'Buď napsat něco, co stojí za přečtení, nebo udělat něco, co stojí za psaní.',0,'Either write something worth reading or do something worth writing.','eng','Benjamin Franklin','1de4a6a2e7231069e142dfc3ebf2cf51',NULL),
(2833,'Buď se rozhodnete zůstat na mělkém konci bazénu, nebo jdete do oceánu.',0,'Either you choose to stay in the shallow end of the pool or you go out into the ocean.','eng','Christopher Reeve','9ae7dfc8a798bf8336fefbbad8efbaed',NULL),
(2834,'Špatné věci nejsou nejhorší věci, které se nám stanou.',0,'Bad things are not the worst things that an happen to us. NOTHING is the worst thing that can happen to us.','eng','Richard Bach','cd28f527739d0b3f31bb9be2fa8da6a4',NULL),
(2835,'Usilujte o dokonalost, ne dokonalost, protože nežijeme v dokonalém světě.',0,'Strive for excellence, not perfection, because we don\'t live in a perfect world.','eng','Joyce Meyer','5ce5e02ea4ffc9823aba30db09b6561f',NULL),
(2836,'Pokud je strach příliš silný, genius je potlačen.',0,'If fear is too strong, the genius is suppressed.','eng','Robert Kiyosaki','a452dbe236b11e9862950e8c79e2d7d5',NULL),
(2837,'Je lepší selhat v originalitě, než uspět v napodobování.',0,'It is better to fail in originality than to succeed in imitation.','eng','Herman Melville','ae0591b47f3e39fe8dff3d133e4eb58e',NULL),
(2838,NULL,0,'Don\'t try to be young. Just open your mind. Stay interested in stuff.','eng','Betty White','038d5b42fea62f3efc4a7c40f2c81230',NULL),
(2839,'Příležitosti se množí, jak jsou zabaveny.',0,'Opportunities multiply as they are seized.','eng','Sun Tzu','c364af9c953e2767e8ad0c80f6357010',NULL),
(2840,NULL,0,'Avoiding danger is no safer in the long run than exposure.','eng','Helen Keller','987283159e9d58f2de671cd395cbb9a4',NULL),
(2841,NULL,0,'Move out of your comfort zone. You can only grow if you are willing to feel awkward and uncomfortable when you try something new.','eng','Brian Tracy','37a7b9a9e89eac4973857cbdc159d202',NULL),
(2842,NULL,0,'Education breeds confidence. Confidence breeds hope. Hope breeds peace.','eng','Confucius','d19ef53d97844f7169a3386706701805',NULL),
(2843,'Nebojujte s prasaty - budete rozmazán v bahně, ale prase bude to líbit.',0,'Do not fight with pigs - you will be smeared in mud but the pig will like it.','eng','George Bernard Shaw','4158ebbe1821f191420db5d5f93953dd',NULL),
(2844,'Většina skvělých lidí dosáhla svého největšího úspěchu jen jeden krok za jejich největší selhání.',0,'Most great people have achieved their greatest success just one step beyond their greatest failure.','eng','Napoleon Hill','419a71d1fdd1eb0ed306cb381cfeef8e',NULL),
(2845,'Žádný velký objev nebyl nikdy proveden bez odvážného odhadu.',0,'No great discovery was ever made without a bold guess.','eng','Isaac Newton','35efecf60b7bb73682433db7b0cf129f',NULL),
(2846,'Pouze ti, kteří vůbec nic nedělají, nedělají žádné chyby.',0,'Only those who do nothing at all make no mistakes.','eng','Unknown','3a99deee982e8440586076a80dca4fc4',NULL),
(2847,'Hudba je jako vytváření emocionálního obrazu.',0,'Music is like creating an emotional painting. The sounds are the colors.','eng','Yanni','3f906dff85741957d48a12a01becb960',NULL),
(2848,'Jedním z prvních příznaků začátku porozumění je přání zemřít.',0,'One of the first signs of the beginning of understanding is the wish to die.','eng','Franz Kafka','67b696ddfa01af03c1566e730a17084c',NULL),
(2849,NULL,0,'Persistence is very important. You should not give up unless you are forced to give up.','eng','Elon Musk','9f97c9ccc95983736a88419bf1f9666d',NULL),
(2850,'Čím moudřejší dostanete, tím méně vás zajímá, že vypadáte jako blázen.',0,'The wiser you get, the less you care to look like a fool.','eng','Maxime Lagace','fccda07c7edf7bfdcf5de0a6f83289c4',NULL),
(2851,'Jednou z nejstarších lidských potřeb je mít někoho, kdo by se divil, kde jste, když v noci nepřijdete domů.',0,'One of the oldest human needs is having someone to wonder where you are when you don\'t come home at night.','eng','Margaret Mead','1a4114c088d4e9b5c110421439447915',NULL),
(2852,'Superstars myslí jako superhvězdy dlouho předtím, než je fanoušci nebo tiskové pomazaní.',0,'Superstars think like superstars long before the fans or the press anoint them.','eng','John Eliot','b4d61e5939904944f63964aed14a2c1f',NULL),
(2853,'Když se rozhodnete, změníte budoucnost.',0,'When you make a choice, you change the future.','eng','Deepak Chopra','9b5ce8613efc8d12f5e2e79c4d3b8c14',NULL),
(2854,'Pokud to není rozbité, pohrávejte si s ním, dokud nezjistíte, jak to funguje.',0,'If it\'s not broken, tinker with it till you find out how it works.','eng','Bob Proctor','ba5db58e97df09fb97c2320830b29b9d',NULL),
(2855,'Nemůžete si vybudovat pověst toho, co budete dělat.',0,'You can\'t build a reputation on what you are going to do.','eng','Henry Ford','e927a439aae86f90a0a65583cecdade6',NULL),
(2856,'Zásluha všech věcí spočívá v jejich obtížích.',0,'The merit of all things lies in their difficulty.','eng','Alexandre Dumas','c53da6c77abc7f625e1dcebeb92dc15d',NULL),
(2857,'Obdivuji ty, kteří dělají dobře a na oplátku nic neočekávají.',0,'I admire those who do good and expect nothing in return.','eng','Roy T. Bennett','120633a86bb635e8c28ff8cf9f3bce32',NULL),
(2858,'Vůdce je ten, kdo zná cestu, jde cestou a ukazuje cestu.',0,'A leader is one who knows the way, goes the way, and shows the way.','eng','Unknown','aaf6b9ea004515625c2be17112e5359e',NULL),
(2859,'Musíte dělat méně věcí pro větší efekt místo toho, abyste dělali více věcí s vedlejšími účinky.',0,'You need to be doing fewer things for more effect instead of doing more things with side effects.','eng','Gary Keller','9fa6d2f1959614e3a7cf80e8cca262c9',NULL),
(2860,'Veškeré bohatství je produktem práce.',0,'All wealth is the product of labor.','eng','John Locke','c0d628193be74974b4e94967e139c0ad',NULL),
