(2939,NULL,2,'Stuff your eyes with wonder... live as if you\'d drop dead in ten seconds. See the world. It\'s more fantastic than any dream made or paid for in factories.','eng','Ray Bradbury','a9c6e8bffc84a37c8c691762a2748937',NULL),
