(3367,'Pokud vyzvednete hladovějícího psa a uděláte ho prosperujícím, nebude vás kousat.',0,'If you pick up a starving dog and make him prosperous he will not bite you. This is the principal difference between a dog and man.','eng','Mark Twain','794ae2935cde5876f4d15dd74b6705bb',NULL),
(3368,NULL,0,'The traveler sees what he sees. The tourist sees what he has come to see.','eng','Gilbert Chesterton','7f534f7fcdb236419d766bccaf319c0d',NULL),
(3369,'Život je jako vstoupit na loď, která se chystá plavit k moři a ponořit se.',0,'Life is like stepping onto a boat which is about to sail out to sea and sink.','eng','Shunryu Suzuki','65120ce0e74a04a3581b2d6e12e51bfd',NULL),
(3370,'Pokušení vzdát se je nejsilnější těsně před vítězstvím.',0,'The temptation to give up is strongest just before victory.','eng','Zen Proverb','2c6323ced11f0bfb5f72e02ba83ac5f4',NULL),
