(3372,'Čím těžší pracujete, tím těžší je vzdát se.',0,'The harder you work, the harder it is to surrender.','eng','Vince Lombardi','cfbc5fbd0c88f40e8a8d9dbb14fd59c5',NULL),
(3373,'Nepodařilo se mi. Právě jsem našel 10 000 způsobů, jak fungovat.',0,'I have not failed. I⟨ve just found 10,000 ways that won⟨t work.','fra','Thomas Edison','4166b4c5207704b7eaccde22dccf8a18',NULL),
(3374,'Opal času je palec zlata, ale můžete si koupit ten centimetr času s palcem zlata.',0,'An inch of time is an inch of gold but you can⟨t buy that inch of time with an inch of gold.','eng','Chinese Proverb','19de0923a4537f4aeb4419d3a8b57784',NULL),
(3375,'Hlavní příčinou selhání a neštěstí je obchodování s tím, co chcete nejvíce pro to, co právě teď chcete.',0,'The chief cause of failure and unhappiness is trading what you want most for what you want right now.','eng','Zig Ziglar','2dde4170603502c01452f6c6fe201eba',NULL),
(3376,'Vždy se snažte být trochu laskavější, než je nutné.',1,'Always try to be a little kinder than necessary.','eng','James Matthew Barrie','f49b443be919d271d290937d4fdacc15',NULL),
(3377,'Když uvažujete o věcech, jako jsou hvězdy, zdá se, že naše záležitosti nezáleží, že?',0,'When you consider things like the stars, our affairs don⟨t seem to matter very much, do they?','eng','Virginia Woolf','5109e7b5a7c7a8d44b05d79d9e16fa0b',NULL),
(3378,'Mnoho lidí bude chodit dovnitř a ven z vašeho života, ale ve vašem srdci zanechají stopy.',0,'Many people will walk in and out of your life, but only true friends will leave footprints in your heart.','eng','Eleanor Roosevelt','c3e3198737fd41e71c98ca365a398ebb',NULL),
(3379,NULL,0,'Life is from the inside out. When you shift on the inside, life shifts on the outside.','eng','Kamal Ravikant','aad38b7e6f10167b169abea5fe7821d2',NULL),
