(3381,'Všichni muži, kteří dosáhli skvělých věcí, byli skvělí snů.',0,'All men who have achieved great things have been great dreamers.','eng','Orison Swett Marden','3e150bf4bf130488d079808ae5c752a6',NULL),
(3382,'Život je dar a nabízí nám privilegium, příležitost a odpovědnost, abychom se něco vrátili.',0,'Life is a gift, and it offers us the privilege, opportunity, and responsibility to give something back by becoming more.','eng','Tony Robbins','57b37e4a51f2003ccaa3c0ea30cd0465',NULL),
