(3384,'Pokud stanovíte své cíle směšně vysoko a jeho selhání, selže nad úspěchem všech.',0,'If you set your goals ridiculously high and its a failure, you will fail above everyone elses success.','eng','James Cameron','77618cc3261e10fceaa85f4211def31a',NULL),
(3385,'Snad nejtragičtější věcí na lidstvu je to, že všichni sníme o nějaké magické zahradě nad obzorem, místo abychom si užívali růže, které jsou dnes přímo venku.',0,'Perhaps the most tragic thing about mankind is that we are all dreaming about some magical garden over the horizon, instead of enjoying the roses that are right outside today.','eng','Andrew Carnegie','0c63022459da60dcd5560100e03992af',NULL),
