(3394,'Nenechávejte to, co nemůžete udělat, zasahovat do toho, co můžete udělat.',0,'Don⟨t let what you cannot do interfere with what you can do.','fra','John Wooden','805f7d2c6d1f0cdfed9d07301e6b0a27',NULL),
(3395,'Vytrvalost a duch dělali zázraky ve všech věkových kategoriích.',0,'Perseverance and spirit have done wonders in all ages.','eng','George Washington','692cb9335346ebb9ee580e52229bf59a',NULL),
