(3408,'Skvělé mysli se vždy obávají menších myslí.',0,'Great minds are always feared by lesser minds.','ita','Dan Brown','a60e619e6219afb414bea447d56c7070',NULL),
(3409,'Nezáleží na tom, na čem se někdo narodil, ale to, čím rostou.',0,'It matters not what someone is born, but what they grow to be.','eng','Albus Dumbledore','76efffe6ff1b34ca4bd9acefa5785053',NULL),
(3410,NULL,2,'The unthankful heart discovers no mercies; but the thankful heart will find, in every hour, some heavenly blessings.','eng','Henry Ward Beecher','3f40bb40a83d81d6eb19afacc5bb5df4',NULL),
(3411,NULL,0,'Every moment you get is a gift. Spend it on things that matter. Don⟨t spend it by dwelling on unhappy things.','eng','Celestine Chua','08aa604cc4b9baab661e08fe2fce5468',NULL),
(3412,'V životě nejsou žádné chyby, pouze lekce.',0,'There are no mistakes in life, only lessons.','eng','Robin Sharma','ea6ffcd5e32dfcf24d7523537aa711f6',NULL),
(3413,NULL,0,'Hope is important because it can make the present moment less difficult to bear. If we believe that tomorrow will be better, we can bear a hardship today.','eng','Thich Nhat Hanh','a9f059109002076ba9dd89f7813ddb74',NULL),
