(3415,'Mít spoustu peněz, zatímco nemáte vnitřní mír, je jako umírání žízně při koupání v oceánu.',0,'Having lots of money while not having inner peace is like dying of thirst while bathing in the ocean.','eng','Paramahansa Yogananda','a51f80db1d2b13654966143f72f2ffee',NULL),
(3416,NULL,2,'Life is growth. If we stop growing, technically and spiritually, we are as good as dead.','eng','Morihei Ueshiba','4de74612573402439f28635f82db80c9',NULL),
