(3419,'Pokrok spočívá v posílení toho, co je, ale v postupu k tomu, co bude.',0,'Progress lies not in enhancing what is, but in advancing toward what will be.','eng','Kahlil Gibran','bbe7a3f379f358dcbfb53dc40a3b55ef',NULL),
