(3421,'Účelem života je rozšíření štěstí.',0,'The purpose of life is the expansion of happiness.','eng','Deepak Chopra','390fd9beef03cd0ca2da31ff3d927afa',NULL),
(3422,'Dárky jsou vytvářeny pro potěšení z toho, kdo jim dává, ne zásluhy toho, kdo je přijímá.',0,'Presents are made for the pleasure of who gives them, not the merits of who receives them.','eng','Carlos Ruiz Zafon','d0a6ce0b5e06bcc05564dfa690a9e1f7',NULL),
(3423,'Štěstí je dar a trikem to není očekávat, ale potěšit ho, až to přijde.',0,'Happiness is a gift and the trick is not to expect it, but to delight in it when it comes.','eng','Charles Dickens','7e39cb4b760e68ad106df8f810616d8e',NULL),
(3424,'Váš svět je živým vyjádřením toho, jak používáte a používáte svou mysl.',0,'Your world is a living expression of how you are using and have used your mind.','eng','Earl Nightingale','780aadb397a2120d3b02b7cc3cb595cc',NULL),
