(3426,'Život je a bude někdy zůstat rovnicí neschopný řešení, ale obsahuje určité známé faktory.',0,'Life is and will ever remain an equation incapable of solution, but it contains certain known factors.','eng','Nikola Tesla','34e6b0701a52630f08a4e1f2fd2bd233',NULL),
(3427,'Dlouhověkost je prchavý okamžik, který trvá věčně.',0,'Longevity is a fleeting moment that lasts forever.','eng','Vidal Sassoon','d4654d5f2e6f4405f532263edb37c8e7',NULL),
(3428,NULL,0,'Integrity is telling myself the truth. And honesty is telling the truth to other people.','eng','Spencer Johnson','802513aa3c2c1171222a006861278fd1',NULL),
(3429,'Být plně naživu znamená cítit, že je vše možné.',0,'To be fully alive is to feel that everything is possible.','eng','Eric Hoffer','84a72a66f165b71cf5eec6bf4113fa46',NULL),
(3430,'Pro všechny zlo existují dvě prostředky - čas a ticho.',0,'For all evils there are two remedies - time and silence.','eng','Alexandre Dumas','463188682e2d2cf63c5b7dd9d09d7472',NULL),
(3431,NULL,2,'We learn to walk by falling down. If we never fell down, we would never walk.','eng','Robert Kiyosaki','78ec0a0bff06f389bd10a116449b6cca',NULL),
