(3433,'Můžete se dostat na místo, o kterém nevěříte, že existuje.',0,'You can⟨t get to a place that you don⟨t believe exists.','eng','Unknown','cb4e7894460d84057747e85e0d2f4928',NULL),
(3434,NULL,0,'Do not ignore your gift. Your gift is the thing you do the absolute best with the least amount of effort.','eng','Steve Harvey','cd9bab6ca49eb177992ea2e809f78ea6',NULL),
