(3436,NULL,0,'We must not cease from exploration. And the end of all our exploring will be to arrive where we began and to know the place for the first time.','eng','T.S. Eliot','e2958f05e8a6abbf19df2a0588785335',NULL),
(3437,'Opakování neměňuje lež v pravdu.',0,'Repetition does not transform a lie into a truth.','eng','Franklin D. Roosevelt','115f7140d7411de1a6c3cf28fc4557bc',NULL),
(3438,'Cíle jsou palivo v peci úspěchu.',0,'Goals are the fuel in the furnace of achievement.','eng','Brian Tracy','e45cff194729996489bc9d8e55213dd1',NULL),
(3439,'Je to pod největším protivenstvím, že existuje největší potenciál pro dobro, jak pro sebe, tak pro ostatní.',0,'It is under the greatest adversity that there exists the greatest potential for doing good, both for oneself and others.','eng','Dalai Lama','71d2194d8702050b0515f08de4368a1e',NULL),
(3440,'Tam, kde vaše talenty a potřeby světa kříží, leží vaše povolání.',0,'Where your talents and the needs of the world cross, there lies your vocation.','eng','Aristotle','c65c2beaf3f39f34f209aa341790f948',NULL),
(3441,'Život je příliš krátký na to, abys ztratil čas na lidi, kteří vás nerespektují, oceňují a váží si vás.',0,'Life is too short to waste your time on people who don⟨t respect, appreciate, and value you.','eng','Roy T. Bennett','c23decef6d6e840c9c54259fa4ec803a',NULL),
(3442,'Motivace vás dostane a zvyk vás tam dostane.',0,'Motivation gets you going and habit gets you there.','eng','Zig Ziglar','d47747c1c062eb7dce8ac8af4c60b857',NULL),
