(3447,'Nejúčinnějším způsobem, jak vykreslit chudé neškodné, je naučit je, aby chtěli napodobit bohaté.',0,'The most efficient way of rendering the poor harmless is to teach them to want to imitate the rich.','eng','Carlos Ruiz Zafon','1f58eeecbd428c18b08fad0523735e9a',NULL),
(3448,'Čím starší dostanete, tím lépe se dostanete. Pokud nebudete banán.',0,'The older you get, the better you get. Unless you⟨re a banana.','fra','Betty White','14b0fb510c9d6d2a22001b3766296e21',NULL),
