(3450,'Být - nezkoušejte se stát',0,'Be - don⟨t try to become','eng','Osho','3e27f95a67a6f2219703a3cc36aeaf39',NULL),
(3451,'Skutečný život se žije, když dojde k drobným změnám.',0,'True life is lived when tiny changes occur.','eng','Leo Tolstoy','080c1fe129c71b32cd3cf0c19ad94fce',NULL),
