(3453,'Zapojte se do těch akcí a myšlenek, které vychovávají dobré vlastnosti, které chcete mít.',0,'Engage in those actions and thoughts that nurture the good qualities you want to have.','eng','Paramahansa Yogananda','023ecea37c3ca04c34b50b343dfd1a49',NULL),
(3454,'Každý den je příležitost udělat nový šťastný konec.',0,'Every day is an opportunity to a make a new happy ending.','eng','Jonathan Swift','3245edd2b0db715e706f8a5fd8b2711f',NULL),
(3455,'Problém s většinou z nás spočívá v tom, že jsme raději zničili chválu, než zachráněni kritikou.',0,'The trouble with most of us is that we⟨d rather be ruined by praise than saved by criticism.','eng','Norman Vincent Peale','522d92818a7e9d42f002bcf868c31f06',NULL),
(3456,'Čas je hra hraná krása od dětí.',0,'Time is a game played beautifully by children.','fra','Heraclitus','0ae3ae75886a03ff4ddca418460cae05',NULL),
(3457,NULL,0,'Stress happens when the mind resists what is.','eng','Dan Millman','8922427b4fa6d20fa277f60ebe1e680c',NULL),
(3458,'Příroda nespěchá, přesto je vše dosaženo.',0,'Nature does not hurry, yet everything is accomplished.','eng','Lao Tzu','85665e59e44af7e1a0da9b1e95e9da8b',NULL),
(3459,'Sny mají pouze jednoho majitele najednou.',0,'Dreams have only one owner at a time. That⟨s why dreamers are lonely.','eng','William Faulkner','76de17320c1d4222932f4b1676e389e8',NULL),
