(3461,'Život je prostě to, co pro nás naše pocity dělají.',0,'Life is simply what our feelings do to us.','eng','Honore de Balzac','54ad0a49b7c4bc915428fdc6cb7f58bf',NULL),
(3462,'Když jste zvědaví, najdete spoustu zajímavých věcí.',0,'When you⟨re curious, you find lots of interesting things to do.','eng','Walt Disney','1cdeb757402302091534e171fdfc8617',NULL),
(3463,'Máte tolik smíchu, kolik máte víru.',0,'You have as much laughter as you have faith.','eng','Martin Luther','8aa280fb5e8f223877cad791ec305a4c',NULL),
