(3989,'Čím více se zaměřujete na čas - minulost a budoucnost - čím více vám chybí, nejcennější je.',0,'The more you are focused on time - past and future - the more you miss the Now, the most precious thing there is.','eng','Eckhart Tolle','eadfd607bf65ca46109f5c14af350636',NULL),
