(4219,'Každý blázen může zavřít oči, ale kdo ví, co pštros vidí v písku.',0,'Any fool can turn a blind eye but who knows what the ostrich sees in the sand.','eng','Samuel Beckett','41fbf3dc7d9d52775b217397d6702345',NULL),
