(4232,'Neexistuje žádný lék jako naděje, žádná motivace tak skvělá a žádná tonikum tak mocná, jako je očekávání z toho zítra.',0,'There is no medicine like hope, no incentive so great, and no tonic so powerful as expectation of something tomorrow.','eng','Orison Swett Marden','3dacccc08573d5f10db3f4a369a2ea99',NULL),
