(4404,NULL,0,'Avoiding failure is to avoid progress.','eng','Unknown','a8ff6666d1da2a7777ae9756ad6ebe14',NULL),
(4405,'Otevřená mysl je jednou z nejdůležitějších vlastností, které můžeme vlastnit.',0,'Having an open mind is one of the most important qualities we can possess. Once our minds close, we stop evolving.','eng','Yanni','bbd58b02642c8389817f13a71c5c24ff',NULL),
