(4416,'Starší muži prohlašují, že to bylo. Ale je to mládež, která musí bojovat a.',0,'Older men declare war. But it is youth that must fight and die.','deu','Herbert Hoover','20740a1ad8f17428b0a7861a255e5672',NULL),
