(4425,'Mír nenajdete tím, že přeskupujete okolnosti vašeho života, ale uvědomíte si, kdo jste na nejhlubší úrovni.',0,'You find peace not by rearranging the circumstances of your life, but by realizing who you are at the deepest level.','eng','Eckhart Tolle','6786f1717f73751bf57a52938ef34d21',NULL),
(4426,'Neměli bychom se ohlédnout zpět, pokud to není odvodit užitečné lekce z minulých chyb.',0,'We should not look back unless it is to derive useful lessons from past errors.','fra','George Washington','403defc1a72f487dbed5658bd4604f0e',NULL),
(4427,NULL,0,'The greatest weariness comes from work not done.','eng','Eric Hoffer','2b41cc477e2b5631727fa89dfcf9db75',NULL),
