(4429,'Hrdina je obyčejný člověk, který dělá věci extra běžným způsobem.',0,'A hero is an ordinary person doing things in an extra ordinary way.','eng','Christopher Reeve','d4e15fe1db60f505875e230f0086ced2',NULL),
(4430,'Nezapomeňte, že nejlepší vztah je ten, ve kterém vaše láska k sobě navzájem překračuje vaši potřebu navzájem.',0,'Remember that the best relationship is one in which your love for each other exceeds your need for each other.','eng','Dalai Lama','85b62796dd8f249be487dbdc2934fcd1',NULL),
(4431,'Každý, kdo někdy dal důležitost, byl disciplinovaný.',0,'Anyone who has ever made anything of importance was disciplined.','eng','Andrew Hendrixson','dc3cbd4f300a37caea12c59061b4fa6a',NULL),
