(4433,'Budete mít špatné časy, ale vždy vás probudí k věcem, kterým jste věnovali pozornost.',0,'You will have bad times, but they will always wake you up to the stuff you weren⟨t paying attention to.','eng','Robin Williams','9bc0e57bb2700ad42d923f0cc65b45ae',NULL),
