(4446,'Primárním bodem této existence je žít a všechny živé věci se pohybují a rostou.',0,'The primary point of this existence is to live, and all living things move and grow.','eng','Ming-Dao Deng','fcbca1f66d95f9f71c2f4967dde36b6e',NULL),
