(4448,'Bydlel jsem s několika zenovými mistry - všechny kočky.',0,'I have lived with several Zen masters -- all of them cats.','eng','Eckhart Tolle','d033f68734ea78b035221c7ef2e93fd1',NULL),
(4449,'Být dobrým příkladem je nejlepší forma služby.',0,'Being a good example is the best form of service.','eng','Sathya Sai Baba','b2d0803254ee01a74ec91bf3405c7804',NULL),
(4450,'Nikdy v životě jsem se nic nenaučil od každého člověka, který se mnou souhlasil.',0,'I have never in my life learned anything from any man who agreed with me.','eng','Dudley Field Malone','ce9065293147d884d6cfc25500890475',NULL),
(4451,'Strach je to, co vás zastaví.',0,'Fear is what stops you. Courage is what keeps you going.','eng','Unknown','c4d3b032f62ae9425c956d781f04e625',NULL),
(4452,'Nejlepší věc, kterou se v životě drží, je navzájem.',0,'The best thing to hold onto in life is each other.','eng','Audrey Hepburn','c94f4b5aec8f3d424d45ce84fb208e99',NULL),
