(4455,'Stačí zahodit všechny myšlenky na představy a stát pevně v tom, čím jsi.',1,'Just throw away all thoughts of imaginary things, and stand firm in that which you are.','eng','Kabir','ea602f314c8321dd452da1d8238d72df',NULL),
(4456,'Pokud něco opravdu chcete, nečekejte na to - naučte se.',0,'If you genuinely want something, don⟨t wait for it - teach yourself.','eng','Gurbaksh Chahal','a016be23c432ac5316394f93fde510ce',NULL),
(4457,'Sny jsou královskou cestou do bezvědomí.',0,'Dreams are the royal road to the unconscious.','eng','Sigmund Freud','501381087a9186c866eae84829a02685',NULL),
(4458,'Nejobtížnější je rozhodnutí jednat, zbytek je jen houževnatost.',0,'The most difficult thing is the decision to act, the rest is merely tenacity. The fears are paper tigers.','eng','Amelia Earhart','6da79c44e486844bd968271340e91f0d',NULL),
(4459,'Čím více jste motivováni láskou, tím nebojácnější a svobodná bude vaše akce.',0,'The more you are motivated by Love, The more Fearless & Free your action will be.','eng','Dalai Lama','48c09d462208883029abb063e12e547f',NULL),
(4460,NULL,0,'Procrastination is attitude⟨s natural assassin. There⟨s nothing so fatiguing as an uncompleted task.','eng','William James','319f0e2ac679afde831d001312dc66d8',NULL),
