(4465,'Světlo, které svítí zevnitř, nemůže nic ztlumit.',0,'Nothing can dim the light which shines from within.','eng','Maya Angelou','d2273dddbb9201ca24011bc1224c8a28',NULL),
(4466,NULL,2,'Be the reason someone smiles. Be the reason someone feels loved and believes in the goodness in people.','eng','Roy T. Bennett','8db3f9d68604aad3b45e495ed6b4f750',NULL),
(4467,'Pomozte ostatním a něco vraťte.',0,'Help others and give something back.','eng','Arnold Schwarzenegger','e2035f131809d59088cd87053e8aa991',NULL),
(4468,'Nebojte se stát za to, v co věříte, i když to znamená stát sám.',0,'Don⟨t be afraid to stand for what you believe in, even if that means standing alone.','eng','Unknown','b513b96f9979b09c246a3d7042fa1553',NULL),
(4469,'Čím více něco ohrožuje vaši identitu, tím více ji zmocníte.',0,'The more something threatens your identity, the more you will avoid it.','fra','Mark Manson','7bac12a48b3f9846305fea7e281ea522',NULL),
(4470,NULL,0,'It⟨s not what happens to you, but how you react to it that matters.','eng','Epictetus','1e5710250ffa579496de981766f13a9e',NULL),
(4471,'Je na každém z nás zpívat, když se cítíme pohyblivou celkovou písní života.',0,'It is up to each of us to sing as we feel moved by the overall song of life.','eng','Ming-Dao Deng','63dd59e4915da3a440228932c4c2091a',NULL),
(4472,'Cílem není ukázat, jak skvělí jste pro ostatní, ale jak jste pro sebe zranitelní.',0,'The goal is not to show how great you are to others, but how vulnerable you are to yourself.','eng','Maxime Lagace','1080275386036a06f5eadc2549e89716',NULL),
(4473,'Money Poison je vy, když to máte, a hladoví vás, když jste to nebyli.',0,'Money poisons you when you⟨ve got it, and starves you when you haven⟨t.','deu','D. H. Lawrence','d13ba9034a93bcc6fd4b8f13fbedd89f',NULL),
