(4476,'Když dovolíme negativním zprávám, aby se v naší hlavě festeroval, vezmou si vlastní život.',0,'When we allow negative messages to fester in our head, they take on a life of their own.','eng','Lolly Daskal','1621ddf1833d80c2b528365ff29f4f4f',NULL),
(4477,'Vždy se zaměřte na přední čelní sklo a ne na zadní zrcátko.',0,'Always focus on the front windshield and not the rear view mirror.','eng','Colin Powell','f4b9b33d33634f8a6c65db044e81e7fa',NULL),
(4478,'Příliš mnoho zdravého rozumu může být šílenství a nejbláznivější ze všech, vidět život tak, jak je a ne tak, jak by měl být.',0,'Too much sanity may be madness and the maddest of all, to see life as it is and not as it should be.','eng','Miguel de Cervantes','dd90a4afe4c92605dce667ae4c236831',NULL),
(4479,NULL,0,'Scared people want comfort and certainty so they avoid failure. People living fully seek challenges because this is where they feel alive.','eng','Maxime Lagace','ad55f7ef9b3e2e55056f7eacfbeda849',NULL),
(4480,NULL,0,'Create with the heart; build with the mind.','eng','Criss Jami','70d73d9f400374f7514c48ebff0719c2',NULL),
