(4482,'Prvním pravidlem konfliktu zacházení je, že se nesedí kolem lidí, kteří se neustále zapojují do konfliktu.',0,'The first rule of handling conflict is don⟨t hang around people who are constantly engaging in conflict.','eng','Naval Ravikant','33aa5de768aa7f07d33f3576accad6be',NULL),
(4483,'To, co se stanete, je mnohem důležitější než to, co dostanete.',0,'What you become is far more important than what you get.','eng','Jim Rohn','22e0975986cd5d2532dc6696c9e250d2',NULL),
(4484,NULL,2,'You can have it all. You just can⟨t have it all at once.','eng','Oprah Winfrey','b47a9bf208618820d5a6932892eec189',NULL),
(4485,NULL,0,'No one ever is defeated until defeat has been accepted as a reality.','eng','Napoleon Hill','f6c72ff9e9d77a7c002ee6652f6c9d8b',NULL),
(4486,NULL,0,'Life and death are of supreme importance. Time swiftly passes by and opportunity is lost.','eng','Dogen','29cc8bb5a49e9d0c5572e958f3cda9f0',NULL),
(4487,'Naučte se sedět a pozorovat, ne všechno potřebuje reakci.',0,'Learn to sit back and observe, not everything needs a reaction.','eng','Unknown','8b058436562ce7683bb9a871ea20ecf4',NULL),
(4488,'Moudrý muž se může dozvědět více z pošetilé otázky, než se blázen může poučit z moudré odpovědi.',0,'A wise man can learn more from a foolish question than a fool can learn from a wise answer.','fra','Bruce Lee','0311f1b5e69381505c10b5c84b746a17',NULL),
(4489,NULL,0,'The most important thing in life is to stop saying ⟨I wish⟨ and start saying ⟨I will⟨. Consider nothing impossible, then treat possibilities as probabilities.','eng','Charles Dickens','29fa7bac5a4ec12a40176a31028a96be',NULL),
(4490,'Pokud je život videohra, grafika je skvělá, ale spiknutí je matoucí a tutoriál je příliš dlouhý.',0,'If life is a video game, the graphics are great, but the plot is confusing and the tutorial is way too long.','eng','Elon Musk','c48a9aab22c3421d7f82580d881afb42',NULL),
(4491,'Svět vám vždy nedává chtít, ale často vám dává to, co potřebujete.',0,'The world doesn⟨t always give you want, but it often gives you what you need.','eng','Naval Ravikant','1a827711b1989d36406436d8821eed6d',NULL),
(4492,'S proudem může jít mrtvá věc, ale proti tomu může jít jen živá věc.',0,'A dead thing can go with the stream, but only a living thing can go against it.','eng','Gilbert Chesterton','0f8c2c097b77878ef9a38b9b883e9ed2',NULL),
(4493,NULL,0,'My instinct is always to seek out challenges as opposed to avoiding them.','eng','Josh Waitzkin','c146e4edf893b1a19ca7813d1fcba968',NULL),
(4494,'Teprve když padám, vstanu znovu.',0,'Only when I fall do I get up again.','fra','Vincent van Gogh','bb3dac7506e5911e8ceb578dc380947a',NULL),
(4495,'Když jste jediným zdravým člověkem, vypadáte jako jediný šílený člověk.',0,'When you⟨re the only sane person, you look like the only insane person.','fra','Criss Jami','2933af52c1784a6c144518e673744108',NULL),
(4496,'Jsme ochotni věřit něčemu jinému než pravdu.',0,'We are willing to believe anything other than the truth.','eng','Carlos Ruiz Zafon','c680c5db9ec7f59dc62e8418cdb8f081',NULL),
(4497,NULL,2,'Life⟨s too mysterious to take too serious.','por','Mary Engelbreit','8dec6aa71d2910fbf700c0c8256493f9',NULL),
(4498,NULL,0,'Decide whether or not the goal is worth the risks involved. If it is, stop worrying.','eng','Amelia Earhart','76efa99c6e8ce7d43f756e69384ae494',NULL),
(4499,'Chcete -li získat skutečnou vlastní sílu, musíte se cítit pod nikým, být imunní vůči kritice a být nebojácný.',0,'To acquire true self power you have to feel beneath no one, be immune to criticism and be fearless.','eng','Deepak Chopra','6799244aef13e75d295a543e8574ec05',NULL),
(4500,'Přibližná odpověď na správnou otázku stojí za mnohem více než přesnou odpověď na nesprávnou otázku.',0,'An approximate answer to the right question is worth a great deal more than a precise answer to the wrong question.','eng','John Tukey','039e0d16d605274b606d603042849354',NULL),
(4501,'Sním o svém obraze a malováním svého snu.',0,'I dream my painting and I paint my dream.','eng','Vincent van Gogh','9ac64597ed22f8ae977b55a0bbe78c0f',NULL),
(4502,'Strach ze smrti se musí více bát, než samotná smrt.',0,'The fear of death is more to be feared, than death itself.','eng','Publilius Syrus','8558dd7244e2f8e0ba4b3a48527cfea7',NULL),
(4503,'Nechte každého muže vykonávat umění, které zná.',0,'Let each man exercise the art he knows.','fra','Aristophanes','42fa92cd51df6e2881380ce1367aace9',NULL),
(4504,NULL,0,'The truth is simple. If it was complicated, everyone would understand it.','eng','Walt Whitman','bf52908fc56dde693570f9c8a2927dd3',NULL),
(4505,NULL,2,'My powers are ordinary. Only my application brings me success.','eng','Isaac Newton','c533c116d59fbf301e17dcfb44ae932e',NULL),
(4506,NULL,0,'It⟨s easy to be a critic, but being a doer requires effort, risk, and change.','eng','Wayne Dyer','eb876bca3a5242475adf3f6548f06e00',NULL),
(4507,'Neměňte se za snadný život, modlete se za to, aby síla vydržela obtížnou.',0,'Do not pray for an easy life, pray for the strength to endure a difficult one.','eng','Bruce Lee','4f432c6c286eade21fa2144f7646a9cb',NULL),
(4508,'Dejte úvěr tam, kde je úvěr splatný: jednoduše řekl: Pokud chcete loajalitu a nejlepší úsilí, musíte být zamyšlení.',0,'Give credit where credit is due: simply said, if you want loyalty and best effort, you must be thoughtful.','eng','Estee Lauder','07399fb2d013e871525ec36bb3b0b111',NULL),
(4509,'Buďte pravdiví o svých emocích a používejte svou mysl a emoce ve svůj prospěch, ne proti sobě.',0,'Be truthful about your emotions, and use your mind and emotions in your favor, not against yourself.','eng','Robert Kiyosaki','42c771667f6edf96b82a6909777c818d',NULL),
(4510,'Vnější podmínky života člověka budou vždy zjištěny, že odrážejí jejich vnitřní přesvědčení.',0,'The outer conditions of a person⟨s life will always be found to reflect their inner beliefs.','eng','James Allen','568dfeb44f4406c72637cf81071e23b3',NULL),
(4511,'Skutečné umění v učení se odehrává, když se pohybujeme nad rámec znalosti, když se naše práce stává výrazem naší podstaty.',0,'The real art in learning takes place as we move beyond proficiency, when our work becomes an expression of our essence.','eng','Josh Waitzkin','4cb612a7aad4b3bb6e363f6100b16ae2',NULL),
