(4514,'I když si myslíte, že máte svůj život mapovaný, stane se věci, které utvářejí váš osud způsobem, který jste si nikdy nepředstavovali.',0,'Even when you think you have your life all mapped out, things happen that shape your destiny in ways you might never have imagined.','eng','Deepak Chopra','af111e1a1ce426c0ccf189919e227260',NULL),
(4515,NULL,0,'Success seems to be connected to action. Successful people keep moving. They make mistakes, but they don⟨t quit.','eng','Conrad Hilton','d5c30bf135d3b279cbb81bed68a7e16d',NULL),
(4516,'Nikdy zítra neodejděte, co můžete udělat dodnes.',0,'Never put off to tomorrow what you can do to-day.','eng','Thomas Jefferson','b637c1718c7e08123abec1f3292ac294',NULL),
(4517,'Včera je, ale dnes je paměť, zítra je dnes sen.',0,'Yesterday is but today⟨s memory, tomorrow is today⟨s dream.','eng','Kahlil Gibran','f797f8b27be7728369d1a0675904aeb3',NULL),
(4518,'Je nemožné, aby se člověk dozvěděl, co si myslí, že už ví.',0,'It is impossible for a man to learn what he thinks he already knows.','eng','Epictetus','5d0a33e7e1edf36388cfb7a367366ac3',NULL),
