(4520,NULL,0,'Give a man a fish and you feed him for a day. Teach a man to fish and you feed him for a lifetime.','eng','Lao Tzu','80be1bc2ae1ce9ec5b6f612c0c2275fd',NULL),
(4521,'Neexistuje žádný obří krok, který by to nečinil.',0,'There is no one giant step that does it. It⟨s a lot of little steps.','eng','Peter A. Cohen','215776dfa46289b937b1d1e5148c3822',NULL),
(4522,'Jen udělejte to nejlepší, co můžete.',0,'Just do the best you can. No one can do more than that.','eng','John Wooden','f344dc9146861fd6a707a0753ec180aa',NULL),
(4523,'Jakýkoli nápad, plán nebo účel může být v mysli umístěn opakováním myšlení.',0,'Any idea, plan, or purpose may be placed in the mind through repetition of thought.','eng','Napoleon Hill','3f49fd5ce4e586cbe22d85156d85bf67',NULL),
(4524,NULL,0,'Live in each season as it passes; breathe the air, drink the drink, taste the fruit, and resign yourself to the influence of the earth.','eng','Henry David Thoreau','41a8f79ac5909f0a6138e865f31eaa5b',NULL),
(4525,NULL,0,'To seek is to suffer. To seek nothing is bliss.','eng','Bodhidharma','c9deaf7a822eb99aa0c4db854f5943a7',NULL),
(4526,'Duše bez představivosti by byla observatoř bez dalekohledu.',0,'The soul without imagination is what an observatory would be without a telescope.','eng','Henry Ward Beecher','0e18a6461cbd0cd6439c9f01c2b43ff0',NULL),
(4527,'Umění šťastného spočívá v síle extrakce štěstí z běžných věcí.',0,'The art of being happy lies in the power of extracting happiness from common things.','eng','Henry Ward Beecher','653f62b8a01cfbe4acc1ed3feee4bf51',NULL),
(4528,'Hledáme a omylu se učíme.',0,'By seeking and blundering we learn.','deu','Johann Wolfgang von Goethe','5e28e70e2b3d30652fd5fe400ffd82e9',NULL),
(4529,'Ten, kdo ví, jak čekat, potřebuje žádné ústupky.',0,'He who knows how to wait need make no concessions.','eng','Sigmund Freud','f5dca0cec41c399f322573290cfe03f7',NULL),
(4530,NULL,0,'The art of being wise is knowing what to overlook.','eng','William James','7656246221c76add94423ab456f80997',NULL),
