(4532,'Lidé s jasnými, písemnými cíli, dosahují mnohem více v kratším časovém období, než si lidé, aniž by si to dokázali představit.',0,'People with clear, written goals, accomplish far more in a shorter period of time than people without them could ever imagine.','eng','Brian Tracy','12512a862594a8b572c4af916b5d89df',NULL),
