(4534,'Jsi vaše nejlepší věc.',0,'You are your best thing.','eng','Toni Morrison','2cc9788f3c65aa4b4434ee823fed31a8',NULL),
(4535,'Protože se pro vás zdá obtížná, nemyslete si, že je to nemožné.',0,'Because a thing seems difficult for you, do not think it impossible.','eng','Marcus Aurelius','ef099b750700d215fb448c9c05d51aaf',NULL),
(4536,'Když jste spokojeni, že jste prostě sami a porovnáte nebo soutěží, všichni vás budou respektovat.',0,'When you are content to be simply yourself and don⟨t compare or compete, everybody will respect you.','eng','Lao Tzu','e29e7a5686a7976f97080d0ab229cff2',NULL),
(4537,NULL,0,'It is important that we forgive ourselves for making mistakes. We need to learn from our errors and move on.','eng','Steve Maraboli','8fb0c5613f3fdbb7b438a9d6ec5486bb',NULL),
