(4540,'Změníte svět tím, že jsi sám.',0,'You change the world by being yourself.','eng','Yoko Ono','7a4e3a981859185970f8f2a033fd2a22',NULL),
(4541,NULL,0,'Failure is acceptable. Not trying is a whole different ball park.','eng','Michael Jordan','2e05f1d3ebfc72773dbf4470c8767658',NULL),
(4542,'Nemůžete plavat pro nové obzory, dokud nebudete mít odvahu ztratit ze zřetele břeh.',0,'You cannot swim for new horizons until you have courage to lose sight of the shore.','eng','William Faulkner','8ac468a349b5081805f4f55927afb77b',NULL),
