(4544,'Každá hra se stává důležitá, když znáte a milujete hráče.',0,'Any game becomes important when you know and love the players.','eng','W.P. Kinsella','2fb8bd72c9e76d6a64d863bb71f48d43',NULL),
(4545,'Ten, kdo porušuje jinou čest, ztratí svou vlastní.',0,'He who violates another⟨s honor loses his own.','eng','Publilius Syrus','5cd1c1846028ae31409806e9f8f394e9',NULL),
(4546,NULL,0,'The more you give, the more comes back to you.','eng','Napoleon Hill','3b880367b0e0ac3363d144a4da1aea34',NULL),
(4547,'Když se na konci lana uvazujete uzel a vydržte.',0,'When you⟨re at the end of your rope, tie a knot and hold on.','eng','Theodore Roosevelt','ee8cc76edca42ce1456c75a23c140a47',NULL),
