(4549,NULL,0,'It is secondary whether we choose belief or defiance. What is precious is that we are always able to choose.','eng','Ming-Dao Deng','17659b779ac0018306b4b9fe2234c16d',NULL),
(4550,'Mít srdce, které nikdy neztvrdne, a temperament, který nikdy neunavuje, a dotek, který nikdy neublíží.',0,'Have a heart that never hardens, and a temper that never tires, and a touch that never hurts.','eng','Charles Dickens','1c90b549ae64494b784bd7d2260294ce',NULL),
(4551,'Hodně učení se nepoučit porozumění.',0,'Much learning does not teach understanding.','fra','Heraclitus','7e490f401434c6dfbbbc0db02f3b5cac',NULL),
(4552,'Není nic skutečně uměleckého, než milovat lidi.',0,'There is nothing more truly artistic than to love people.','eng','Vincent van Gogh','60bbda0fcb3344c7ffd6b444a010b606',NULL),
(4553,'Není to o tom, co to je, to o tom, co se může stát.',0,'It⟨s not about what it is, it⟨s about what it can become.','eng','Dr. Seuss','bb0f866faaa440e1b58ad6e6270b2bd0',NULL),
(4554,'Nepotřebujete počasí, aby věděl, jakým způsobem fouká vítr.',0,'You don⟨t need a weatherman to know which way the wind blows.','eng','Bob Dylan','e072be34a0d577cce22556f54546b421',NULL),
(4555,'Pokud se za sebe chvíli stydíte, nejste upřímní.',0,'Unless you⟨re ashamed of yourself now and then, you⟨re not honest.','eng','William Faulkner','0dfef91922559136c2e171f18e3f3302',NULL),
(4556,'Úspěch je progresivní realizace hodného cíle nebo ideálu.',0,'Success is the progressive realization of a worthy goal or ideal.','eng','Earl Nightingale','a7f7823a982556b6d2b7a4a66dcd51e1',NULL),
(4557,'Odvaha je cena, kterou život vypovídá za udělení míru.',0,'Courage is the price that life exacts for granting peace.','eng','Amelia Earhart','fcce7f478c3db5459e74b428c320004d',NULL),
(4558,'Musíme si vytvořit vlastní svět nebo zemřeme na nečinnost.',0,'We must create our own world or we will die from inaction.','eng','Robert Greene','583248963c25a325e0ca3c5508c5e603',NULL),
