(4560,'Čím méně mluvíte o své hanbě, tím více máte.',0,'The less you talk about your shame, the more of it you have.','eng','Mark Manson','5c50bacf172078bd60ed6bc3313300f1',NULL),
(4561,NULL,0,'Before enlightenment; chop wood, carry water. After enlightenment; chop wood, carry water.','eng','Buddha','057846ec8819e751c091f8a08092adb8',NULL),
(4562,'Kolik bolesti nás stálo, zlo, které se nikdy nestalo.',0,'How much pain they have cost us, the evils which have never happened.','eng','Thomas Jefferson','c0daef93ccc339680ac4c581693857a2',NULL),
(4563,'Neplač, protože to přechází. Úsměv, protože se to stane.',0,'Don⟨t cry because it⟨s over. Smile because it happened.','fra','Dr. Seuss','e1662382c22009b4e988acb268922c79',NULL),
(4564,'Je to vášeň, díky které je člověka naživo;',0,'It is passion that makes man live; wisdom makes one only last.','eng','Nicolas Chamfort','1d07d71060e66dfc1af2c7f76e989830',NULL),
(4565,NULL,0,'Excellence is not an exception, it is a prevailing attitude.','fra','Colin Powell','8e6ac5dd850487c64434fc303eaa409b',NULL),
(4566,NULL,0,'As you grow older you will discover that you have two hands. One for helping yourself, the other for helping others.','eng','Audrey Hepburn','b3aaf4ad6c2e4b2e3788a59bc95b20da',NULL),
(4567,'Největší ze všech chyb je nic dělat, protože si myslíte, že můžete udělat jen trochu.',0,'The greatest of all mistakes is to do nothing because you think you can only do a little.','eng','Zig Ziglar','130b10a5db79ce7d1e09ae83ec3b520c',NULL),
(4568,'Musíme žít život s pocitem naléhavosti, takže není zbytečná minuta.',0,'We have to live life with a sense of urgency so not a minute is wasted.','eng','Les Brown','9875b64e82b1fa4945b441857dd7bf18',NULL),
(4569,'Mírový je ten, kdo nic neočekává.',0,'Peaceful is the one who expects nothing.','eng','Maxime Lagace','38e016330661b9afe299349dee1b3eaa',NULL),
(4570,'Soudy nám brání v tom, abychom viděli dobro, které leží mimo vzhled.',0,'Judgments prevent us from seeing the good that lies beyond appearances.','eng','Wayne Dyer','9dfc694ede54540cfb0a4e390c31ad79',NULL),
(4571,NULL,0,'No experience is a cause of success or failure. We do not suffer from the shock of our experiences, so-called trauma - but we make out of them just what suits our purposes.','eng','Alfred Adler','4966a383de76cf24febd8eaa9f4b6e27',NULL),
(4572,NULL,0,'It is often safer to be in chains than to be free.','eng','Franz Kafka','3b4be05d79a8bb172468117826e60219',NULL),
(4573,'Každý blázen dokáže namalovat obrázek, ale je to moudrého muže, aby jej mohl prodat.',0,'Any fool can paint a picture, but it takes a wise man to be able to sell it.','eng','Samuel Butler','26fd92f087190ee153856db929d55016',NULL),
(4574,NULL,0,'Be who you are and say what you feel because those who mind don⟨t matter and those who matter don⟨t mind.','eng','Dr. Seuss','7bafc0b3a8ab75b9a7c94ac608519f1a',NULL),
(4575,'Nebojím se smrti, ale v žádném spěchu zemřu.',0,'I⟨m not afraid of death, but I⟨m in no hurry to die.','eng','Stephen Hawking','3d464b5426aa60dbabb72ea370d528a0',NULL),
(4576,NULL,0,'The mirror is a worthless invention. The only way to truly see yourself is in the reflection of someone elses. eyes.','eng','Voltaire','c5d7a71cd924b1003a1746c04891c513',NULL),
(4577,'Měnící se mysl je těžší než najít lidi, kteří již souhlasí.',0,'Changing minds is harder than finding people who already agree.','eng','Jack Butcher','97a2a93269febdfaac6250dc95a8c7d5',NULL),
(4578,NULL,0,'Our greatest weakness lies in giving up. The most certain way to succeed is always to try just one more time.','eng','Thomas Edison','96b96c6cf4cfb56224e4bb483c796d58',NULL),
(4579,'Moudří dosahují všeho, co chtějí, aniž by vzbudili závist nebo opovržení druhých.',0,'The wise accomplish all that they want without arousing the envy or scorn of others.','eng','Ming-Dao Deng','4e9cdd161301b6923ec7ebd8bb9f55d2',NULL),
(4580,'Nikdy nedovolte člověku, aby vám neřekl, kdo nemá moc říct ano.',0,'Never allow a person to tell you no who doesn⟨t have the power to say yes.','eng','Eleanor Roosevelt','71c0321d836b113572c857f97036e29c',NULL),
(4581,'Lidé, kteří se nemohou motivovat, musí být spokojeni s průměrností, bez ohledu na to, jak působivé jejich další talenty.',0,'People who are unable to motivate themselves must be content with mediocrity, no matter how impressive their other talents.','eng','Andrew Carnegie','c79c0e2aa9ad11a0a1c2ff51b2f5565f',NULL),
(4582,'Stáváme se odvážnými tím, že děláme statečné činy.',0,'We become brave by doing brave acts.','eng','Aristotle','11ad65d8a1ae5bba627806221f1656b2',NULL),
(4583,NULL,2,'Keep true. Never be ashamed of doing right. Decide what you think is right and stick to it.','eng','George Eliot','130ef20111dd5fbbccdef69e4e72b2e0',NULL),
(4584,'Pokud přetrvávám dostatečně dlouho, vyhraji.',0,'If I persist long enough I will win.','eng','Og Mandino','6eaa620955207930fe4d72951eb8ed47',NULL),
(4585,'Život je dlouhá lekce pokory.',0,'Life is a long lesson in humility.','eng','James Matthew Barrie','db6ea68d2831bae13265e9fa53e00334',NULL),
